INSERT INTO `products_translations` (`id`, `title`, `description`, `basic_description`, `price`, `old_price`, `abbr`, `for_id`) VALUES
(106, 'Apple AirPods with Charging Case (Wired)', 'Brand Apple\nConnections Wireless\nModel Name Apple AirPods with Wired Charging Case\nColor White\nHeadphones Form Factor In EarAutomatically on, automatically connected\nEasy setup for all your Apple devices\nQuick access to Siri by saying “Hey Siri”\nDouble-tap to play or skip forward\nNew Apple H1 headphone chip delivers faster wireless connection to your devices\nCharges quickly in the case\nCase can be charged using the Lightning connector', 'Brand Apple\nConnections Wireless\nModel Name Apple AirPods with Wired Charging Case\nColor White\nHeadphones Form Factor In Ear', '128.98', '131.56', 'en', 108),
(107, 'Apple 20W USB-C Power Adapter', 'Compatible Devices Smartphones, Headphones, Laptops\nBrand Apple\nColor White\nPower Source Corded Electric\nInput Voltage 15 VoltsThe Apple 20W USB‑C Power Adapter offers fast, efficient charging at home, in the office, or on the go.\nWhile the power adapter is compatible with any USB‑C enabled device, Apple recommends pairing it with the 11-inch iPad Pro and 12.9-inch iPad Pro (3rd generation) for optimal charging performance.\nYou can also pair it with iPhone 8 or later to take advantage of the fast-charging feature.\nCharging cable sold separately.', 'Compatible Devices Smartphones, Headphones, Laptops\nBrand Apple\nColor White\nPower Source Corded Electric\nInput Voltage 15 Volts', '16.99', '17.33', 'en', 109),
(108, 'Apple AirPods with Wireless Charging Case', '<p>Brand Apple Connections Bluetooth, NFC Model Name Apple AirPods with Wireless Charging Case Color White Headphones Form Factor In EarUniversal fit that’s comfortable all day Automatically on, automatically connected Easy setup for all your Apple devices Quick access to Siri by saying “Hey Siri” Seamless switching between devices</p>\r\n', '<p>Brand Apple Connections Bluetooth, NFC Model Name Apple AirPods with Wireless Charging Case Color White Headphones Form Factor In Ear</p>\r\n', '188.92', '192.7', 'en', 110),
(109, 'Apple AirPods Pro', 'Brand Apple\nConnections Wireless\nModel Name Apple AirPods Pro\nColor White\nHeadphones Form Factor In EarActive noise cancellation for immersive sound\nTransparency mode for hearing and connecting with the world around you\nThree sizes of soft, tapered silicone tips for a customizable fit\nSweat and water resistant\nAdaptive EQ automatically tunes music to the shape of your ear\nEasy setup for all your Apple devices\nQuick access to Siri by saying “Hey Siri”\nThe Wireless Charging Case delivers more than 24 hours of battery life', 'Brand Apple\nConnections Wireless\nModel Name Apple AirPods Pro\nColor White\nHeadphones Form Factor In Ear', '199.0', '202.98', 'en', 111),
(110, 'Animal Crossing: New Horizons - Nintendo Switch', 'Build your community from scratch on a deserted island brimming with possibility; Create your personal getaway and customize your character, home, decorations, and even the landscape itself\nCollect materials to construct everything from furniture to tools! Then, use what you create to give your island a personal touch\nWatch as the time of day and seasons match real life—even your hemisphere! Each day holds potential for surprises and discoveries\nGet to know the island residents, garden, fish, decorate, hunt for fossils, and more!\nShow off your paradise – play on the same system with a total of 4 people, or play together online or over local wireless for fun with up to 8 players', '', '59.99', '61.19', 'en', 112),
(111, 'Apple Lightning to 3.5 mm Headphone Jack Adapter', 'This adapter lets you connect devices that use a 3.5 mm audio plug to your Lightning devices.\nWorks with all devices that have a Lightning connector and support iOS 10 or later, including iPod touch, iPad, and iPhone.', '', '7.99', '8.15', 'en', 113),
(112, 'Apple EarPods with Lightning Connector - White', 'Brand Apple\nConnections Lightning\nModel Name Apple EarPods\nColor White\nHeadphones Form Factor In EarUnlike traditional, circular earbuds, the design of the EarPods is defined by the geometry of the ear which makes them more comfortable for more people than any other earbud-style headphones\nThe speakers inside the EarPods have been engineered to maximize sound output and minimize sound loss, which means you get high-quality audio\nThe EarPods with lightning connector also include a built-in remote that lets you adjust the volume, control the playback of music and video, and answer or end calls with a pinch of the cord\nWorks with all devices that have a lightning connector and support iOS 10 or later, including iPod touch, iPad, and iPhone', 'Brand Apple\nConnections Lightning\nModel Name Apple EarPods\nColor White\nHeadphones Form Factor In Ear', '16.98', '17.32', 'en', 114),
(113, 'Nintendo Switch Pro Controller', '<p>Take your game sessions up a notch with the Nintendo Switch Pro Controller Handheld Nintendo Switch gaming at a great price Comes with charging cable (USB C to USB A)</p>\r\n', '', '59.0', '60.18', 'en', 115),
(114, 'Hyrule Warriors: Age of Calamity - Nintendo Switch', 'Experience the events of the Great Calamity 100 years before the Legend of Zelda: Breath of the Wild game\nDozens of gripping cutscenes shed new light on characters like Zelda, the four Champions, the King of Hyrule, and more\nPlay as characters like Link, Zelda and more and learn their distinct attacks and combat styles\nThe four Champions are playable for the first time\nSee a lively Hyrule before it was ravaged by Calamity Ganon', '', '45.99', '0', 'en', 116),
(115, 'Super Smash Bros. Ultimate - Nintendo Switch', 'New stages and fighters are joined by the combined rosters of every past Super Smash Bros. game\nChallenge others anytime, anywhere, whether you\'re on the couch or on the go\nPlay any way you want—locally, online, in TV mode, Tabletop mode, Handheld mode, or even with GameCube Controllers\nFight faster and smarter with new and returning techniques, like the perfect shield and directional air dodge\nFace off in 2-4 player battles, or play against the computer', '', '58.95', '0', 'en', 117),
(116, 'Apple Pencil', 'Color White\nBrand Apple\nMaterial Unspecified\nBatteries 1 CR2 batteries required. (included)\nItem Weight 0.3 Pounds\nCompatible Devices\nIPad Air (3rd generation), iPad mini (5th generation), iPad (6th and 7th generations), iPad Pro 12.9‑inch (1st an…\nSee moreApple Pencil features the precision, responsiveness, and natural fluidity of a traditional writing instrument and the versatility to become so much more.\nWith Apple Pencil, you can turn iPad into your notepad, canvas, or just about anything else you can imagine.\nCompatible with 9.7-inch iPad Pro (Previous Model), 10.5-inch iPad Pro (Previous Model), 12.9-inch iPad Pro (1st Generation - Previous Model and 2nd Generation - Previous Model), iPad Air (3rd Generation - Latest Model), iPad (6th Generation - Previous Model and 7th Generation - Latest Model) and iPad mini (5th Generation - Latest Model).', 'Color White\nBrand Apple\nMaterial Unspecified\nBatteries 1 CR2 batteries required. (included)\nItem Weight 0.3 Pounds\nCompatible Devices\nIPad Air (3rd generation), iPad mini (5th generation), iPad (6th and 7th generations), iPad Pro 12.9‑inch (1st an…\nSee more', '94.88', '96.78', 'en', 118),
(117, 'Super Mario 3D All-Stars - Nintendo Switch', 'Discover (or rediscover) three of Mario’s most memorable adventures all in one package—available on the Nintendo Switch system\nTake these three adventures on the go with the Nintendo Switch system’s handheld or tabletop mode\nJump into paintings to collect Power Stars and save Princess Peach in the Super Mario 64 game\nSpray away paint-like goop with the help of your water-spouting friend, FLUDD, in the Super Mario Sunshine game\nTravel from planet to planet and power up Rosalina’s Comet Observatory in the Super Mario Galaxy game—motion controls and a two-player Co-Star mode included', '', '57.94', '59.1', 'en', 119),
(118, 'Just Dance 2021 - Nintendo Switch Standard Edition', 'Dance to over 600 songs with the Just Dance Unlimited subscription streaming service. One month FREE included with the game\nPlay with friends and share the fun with co-op mode\nDance the way you like by creating your own personalized custom playlists\nEnjoy eight new kid-friendly songs and choreographies for a family-fun experience\nUse your smartphone to track moves with the Just Dance Controller app – no additional accessories required! Up to six players can join', '', '29.83', '30.43', 'en', 120),
(119, 'Beats Solo3 Wireless On-Ear Headphones - Apple W1 Headphone Chip, Class 1 Bluetooth, 40 Hours Of Listening Time - Black (Latest Model)', 'Brand Beats\nConnections Bluetooth, NFC\nModel Name Solo\nColor Black\nHeadphones Form Factor On EarHigh-performance wireless Bluetooth headphones in black\nFeatures the Apple W1 chip and Class 1 wireless Bluetooth connectivity\nWith up to 40 hours of battery life, Beats Solo3 wireless is your perfect everyday headphone\nCompatible with iOS and Android devices\nWith Fast Fuel, 5 minutes of charging gives you 3 hours of playback when battery is low\nAdjustable fit with comfort-cushioned ear cups made for everyday use\nSleek, streamlined design that’s durable and foldable to go everywhere you do', 'Brand Beats\nConnections Bluetooth, NFC\nModel Name Solo\nColor Black\nHeadphones Form Factor On Ear', '104.72', '106.81', 'en', 121),
(120, 'SanDisk 128GB microSDXC UHS-I-Memory-Card for Nintendo-Switch - SDSQXAO-128G-GNCZN', 'Brand SanDisk\nMemory Type Micro SDXC\nHardware Interface MicroSDXC\nSpeed Class Class 10\nMemory Storage Capacity 128 GBIncredible speeds in a microSD card officially licensed for the Nintendo Switch and Nintendo Switch Lite systems\nSpend less time waiting and more time playing with read speeds up to 100 MB/s(1) and write speeds up to 90MB/s(1).\nInstantly add up to 128GB (1GB=1,000,000,000 bytes. Actual user storage less.)\nStore your downloaded games, screenshots and video captures in one place so you can travel light.\nLifetime limited warranty (2)', 'Brand SanDisk\nMemory Type Micro SDXC\nHardware Interface MicroSDXC\nSpeed Class Class 10\nMemory Storage Capacity 128 GB', '25.45', '25.96', 'en', 122),
(121, 'Duracell - CopperTop AA Alkaline Batteries - long lasting, all-purpose Double A battery for household and business - 24 Count', '<p>Batteries 24 AA batteries required. Brand Duracell Voltage 9 Battery Weight 626 Grams Compatible Devices Remotes, ToyDuracell AA Batteries: The Duracell CopperTop Double A alkaline battery is designed for use in household items like remotes, toys, and more. Duracell guarantees these batteries against defects in material and workmanship. Should any device be damaged due to a battery defect, we will repair or replace it at our option.* Long Lasting Power: Duracell alkaline batteries are designed and developed for long lasting performance. Guaranteed for 10 years in Storage: Duracell AA alkaline batteries are guaranteed for 10 years in storage. #1 Trusted Battery Brand: Duracell CopperTop batteries are available in Double A (AA), Triple A (AAA), C, D and 9V sizes.</p>\r\n', '<p>Batteries 24 AA batteries required. Brand Duracell Voltage 9 Battery Weight 626 Grams Compatible Devices Remotes, Toy</p>\r\n', '16.21', '16.53', 'en', 123),
(122, 'Apple Pencil (2nd Generation)', 'Brand Apple\nBatteries 1 Lithium Polymer batteries required. (included)\nItem Weight 20.7 Grams\nItem Dimensions LxWxH 8.27 x 2.18 x 0.98 inches\nAre Batteries Included Yes\nBatteries Required? YesApple Pencil features the precision, responsiveness, and natural fluidity of a traditional writing instrument and the versatility to become so much more.\nWith Apple Pencil, you can turn iPad into your notepad, canvas, or just about anything else you can imagine.\nCompatible with iPad Pro 11-inch and iPad Pro 12.9-inch (3rd Generation).\nApple Pencil is designed to be an even more comfortable, natural tool to use. The seamless design — no connectors or moving parts — makes it easy to store', 'Brand Apple\nBatteries 1 Lithium Polymer batteries required. (included)\nItem Weight 20.7 Grams\nItem Dimensions LxWxH 8.27 x 2.18 x 0.98 inches\nAre Batteries Included Yes\nBatteries Required? Yes', '124.99', '127.49', 'en', 124),
(123, 'Assassin’s Creed Valhalla PlayStation 4 Standard Edition with free upgrade to the digital PS5 version', 'Lead epic Viking raids against Saxon troops and fortresses\nRelive the visceral fighting style of the Vikings as you dual-wield powerful weapons\nChallenge yourself with the most varied collection of enemies ever in Assassin\'s Creed\nShape the growth of your character and your clan\'s settlement with every choice you make\nExplore a Dark Age open world, from the harsh shores of Norway to the beautiful kingdoms of England', '', '49.88', '50.88', 'en', 125),
(124, 'Apple Watch Series 3 (GPS, 38mm) - Space Gray Aluminium Case with Black Sport Band', 'Supported Application Heart Rate Monitor\nBrand Apple\nSize 38mm\nSupports Bluetooth 802.11b, 802.11g\nColor Space Gray Aluminum with Black Sport BandGPS\nRetina display\nSwimproof\nOptical heart sensor\nStores music, podcasts, and audiobooks\nElevation\nEmergency SOS', 'Supported Application Heart Rate Monitor\nBrand Apple\nSize 38mm\nSupports Bluetooth 802.11b, 802.11g\nColor Space Gray Aluminum with Black Sport Band', '179.0', '182.58', 'en', 126),
(125, 'Xbox Core Controller - Robot White', 'Experience the modernized design of the Xbox Wireless Controller in Robot White, featuring sculpted surfaces and refined geometry for enhanced comfort and effortless control during gameplay.\nStay on target with textured grip on the triggers, bumpers, and back case and with a new hybrid D-pad for accurate, yet familiar input.\nMake the controller your own by customizing button mapping with the Xbox Accessories app.*\nPlug in any compatible headset with the 3.5mm audio headset jack.\nIncludes Xbox Wireless and Bluetooth technology for wireless gaming on supported consoles, Windows 10 PCs, Android phones, and tablets.* iOS support coming in the future', '', '59.88', '61.08', 'en', 127),
(126, 'Fujifilm INSTAX Mini Instant Film 2 Pack = 20 Sheets (White) for Fujifilm Mini 8 & Mini 9 Cameras, Model:4332059078', 'Brand Quality Photo\nFilm Format Type 46 mm × 62 mm\nCompatible Devices\nInstax mini 9, Instax mini 25, Polaroid PIC 300… See more20 SHEETS INSTANT FILM Compatible with the Fujifilm Instax Mini 9 Instant Camera & The full line of the Fujifilm Instax Cameras Mini 8, Mini 90, Mini 70, Mini 50S, Mini 25, Mini HELLO KITTY, and the Polaroid PIC 300 Instant Film Cameras\nQuality this Fujifilm Instax Mini 8 instant films are high-speed is 800 - with superb grain quality, Instax Mini film ensure vibrant color and natural skin tones.\nIts your moment This films are credit-card size - 5. 4 x 8. 6 cm (film Size) - The unique credit-card sized film is easy to carry in your purse or wallet and has that classic White frame that you can leave blank or personalize with fun messages.\nDevelops instantly capture your moments and enjoy the picture right away. All you do is, press the shutter, capture the moment, and watch the photo slide out and the image develop in front of your eyes!', 'Brand Quality Photo\nFilm Format Type 46 mm × 62 mm\nCompatible Devices\nInstax mini 9, Instax mini 25, Polaroid PIC 300… See more', '15.99', '16.31', 'en', 128),
(127, 'Falcon Dust, Off Compressed Gas (152a) Disposable Cleaning Duster, 1, Count, 3.5 oz Can (DPSJB),Black', 'Falcon Dust-Off Aerosol Compressed Gas (152a) Disposable Cleaning Duster, 1-count, 3.5 oz can The Original Duster 100% Ozone Safe A Bitterant is added to the Compressed Gas to Discourage Inhalant Abuse The Versatile Cleaning Tool\nCompact\nIndispensable for places where space is tight\nSame efficient blasting power as larger models\n100% Ozone safe Bitterant added to help discourage inhalant abuse\nIndispensable for places where space is tight\nSame efficient blasting power as larger models', '', '7.79', '7.95', 'en', 129),
(128, 'HyperX Cloud Stinger - Gaming Headset – Comfortable HyperX Signature Memory Foam, Swivel to Mute Noise-Cancellation Microphone, Compatible with PC, Xbox One, PS4, Nintendo Switch, and Mobile Devices', 'Brand HyperX\nConnections Wired\nSeries Cloud Stinger\nColor Black\nHeadphones Form Factor Over Ear#1 selling PC gaming headset in the U.S. - Source: The NPD Group, Inc., U.S. retail tracking service, PC headsets, gaming designed, based on units, January-December 2019\nLightweight headset (275 gram) with 90-degree rotating ear cups provide a snug fit that conforms to your head\n50 millimeter directional drivers for audio precision — enjoy the full audioscape of your favorite games\nHyperX signature memory foam provides maximum comfort during extended use\nAdjustable steel slider for a solid and long lasting sturdy feel\nIntuitive volume control on headset ear cup\nSwivel-to-mute noise-cancellation microphone so you’ll always know when you’re muted', 'Brand HyperX\nConnections Wired\nSeries Cloud Stinger\nColor Black\nHeadphones Form Factor Over Ear', '29.99', '30.59', 'en', 130),
(129, 'Fitbit Charge 4 Fitness and Activity Tracker with Built-in GPS, Heart Rate, Sleep & Swim Tracking, Black/Black, One Size (S &L Bands Included)', 'Brand Fitbit\nColor Black/Black\nCompatible Devices Smartphones\nItem Dimensions LxWxH 9.72 x 1.13 x 0.49 inches\nItem Weight 30 GramsUse built-in GPS to see your pace and distance on screen during outdoor runs, rides, hikes and more and see a workout intensity map in the app that shows your heart rate changes along your route\nWith Active Zone Minutes, feel a buzz when you reach your target heart rate zones during exercise, and celebrate when you earn extra minutes outside of exercise\nGet a 90-day free trial of the Fitbit Premium to help you stay active, sleep well and manage stress. Unlock it all in the Fitbit app. (The valid payment method required. Cancel before free trial ends to avoid subscription fees. Offer valid for new Premium users only)\nUse 24/7 heart rate to track resting heart rate & better measure calorie burn\nPlay your favorite songs and playlists with Spotify app controls on your wrist. Also make secure purchases with Fitbit Pay and get called, text and smartphone app notifications\nTrack workouts in real-time with 20+ goal-based exercise modes. It’s also swimproof and water resistant to 50Meters, so you can track swims, we\'re in the shower and more\nMulti-day battery lasts up to 7 days and up to 5 hours when using built-in GPS (varies with use & other factors)\nTrack sleep stages & review your in-app Sleep Score for an easy way to see how well you slept', 'Brand Fitbit\nColor Black/Black\nCompatible Devices Smartphones\nItem Dimensions LxWxH 9.72 x 1.13 x 0.49 inches\nItem Weight 30 Grams', '119.95', '122.35', 'en', 131),
(130, 'NBA 2K21 - PlayStation 4', 'NBA 2K21 is the latest release in the world-renowned, best-selling NBA 2K series.\nWith exciting improvements upon its best-in-class gameplay, competitive and community online features, and deep, varied game modes, NBA 2K21 offers one-of-a-kind immersion into all facets of NBA basketball and culture - where Everything is Game.\nMyCAREER - Embark on your own personal, cinematic basketball journey to reach your ultimate destination: the National Basketball Association.\nMyTEAM - Assemble your G.O.A.T. NBA fantasy team of current players and historic legends and compete against the world.\nNEIGHBORHOOD - Live out your virtual, day-to-day basketball life in a neighborhood that doesn’t sleep and that always offers something to do.', '', '24.99', '25.49', 'en', 132),
(131, 'The Last of Us Part II - PlayStation 4', 'Pre-order & receive the following special in-game items: Ammo Capacity Upgrade: Unlock an ammo capacity upgrade for Ellie\'s pistol. Crafting Training Manual: Unlock the Crafting Training Manual, which provides access to new crafting recipes and upgrades.\nA Complex & Emotional Story-Experience the escalating moral conflicts created by Ellie\'s relentless pursuit of Vengeance. The cycle of violence left in her wake will challenge your notions of right versus wrong, good versus evil, and hero versus villain.\nA Beautiful Yet Dangerous World - Set out on Ellie\'s journey, taking her from the peaceful mountains and forests of Jackson to the lush, overgrown ruins of greater Seattle. Encounter new survivor groups, and terrifying evolutions of the infected.\nTense & Desperate Action-Survival Gameplay - New & evolved gameplay systems deliver upon the life-or-death stakes of Ellie\'s journey through the hostile world.', '', '28.49', '29.06', 'en', 133),
(132, 'Fitbit Inspire 2 Health & Fitness Tracker with a Free 1-Year Fitbit Premium Trial, 24/7 Heart Rate, Black/Black, One Size (S & L Bands Included)', 'Brand Fitbit\nMaterial Synthetic\nColor Black/Black\nCompatible Devices Smartphones\nItem Dimensions LxWxH 1.47 x 0.66 x 0.51 inchesFree 1-year Fitbit Premium trial for new Premium users with personalized guidance, insights and motivation to help you reach your goals (Free trial may only be activated with device activation. Valid payment method required. Free trial must be activated within 60 days of device activation. Cancel before free trial ends to avoid subscription fees. New Premium users only. Content and features may vary by language and are subject to change.)\nEarn Active Zone Minutes as you progress toward your weekly 150 minutes of heart-pumping activity and use 20+ exercise modes to track goals like distance, calories burned and more\nTrack all-day activity: your steps, distance, hourly activity and calories burned\nUse 24/7 heart rate to track resting heart rate & better measure calorie burn\nEnjoy 10 days of battery life for daily progress without constant charging. Varies with use and other factors\nTrack your time in light, deep and REM sleep, then get a Sleep Score to better understand your sleep quality each night\nStay inspired from the shower to the pool with this swimproof tracker (water resistant to 50 meters) and motivated by connecting with friends, competing in challenges, earning badges and celebrating goal milestones\nGet call, text, calendar and smartphone app notifications right on your wrist. Notifications and app alerts are available on-device when your phone is nearby', 'Brand Fitbit\nMaterial Synthetic\nColor Black/Black\nCompatible Devices Smartphones\nItem Dimensions LxWxH 1.47 x 0.66 x 0.51 inches', '69.95', '71.35', 'en', 134),
(133, 'Pikmin 3 Deluxe - Nintendo Switch', 'Grow a squad of adorable Pikmin and save your planet\nBefriend different types of Pikmin and strategically use them to overcome obstacles, defeat enemies and more\nMore difficulty options, lock-on targeting and optional hints make it easier for newcomers to learn and play\nPlay new side-story missions featuring Olimar and Louie exploring planet PNF-404\nWork cooperatively in Story or Mission mode with a friend, or go head-to-head in Bingo Battle', '', '59.99', '61.19', 'en', 135),
(134, 'Apple Lightning to USB Cable (1 m)', 'connector-type Lightning\nCable Type USB\nCompatible Devices Apple iphone 6s plus, Apple iphone 5s, Apple iphone 5c, Apple iphone 6 plus\nColor White\nBrand AppleThis USB 2.0 cable connects your iPhone, iPad, Mac, AirPods or iPod with Lightning Connector to your computer\'s USB port for syncing and charging.\nYou can connect to the Apple USB power adapter for convenient charging from a wall outlet.\n1 meter in length', 'connector-type Lightning\nCable Type USB\nCompatible Devices Apple iphone 6s plus, Apple iphone 5s, Apple iphone 5c, Apple iphone 6 plus\nColor White\nBrand Apple', '17.99', '18.35', 'en', 136),
(135, 'Bose QuietComfort 35 II Wireless Bluetooth Headphones, Noise-Cancelling, with Alexa voice control - Black', 'Brand Bose\nConnections Wireless\nModel Name Quietcomfort 35 II\nColor Black\nHeadphones Form Factor Over EarThree levels of world-class noise cancellation for better listening experience in any environment\nAlexa-enabled for voice access to music, information, and more\nNoise-rejecting dual-microphone system for clear sound and voice pick-up\nBalanced audio performance at any volume\nHassle-free Bluetooth pairing, personalized settings, access to future updates, and more through the Bose connect app. Usb cable: 12 inch', 'Brand Bose\nConnections Wireless\nModel Name Quietcomfort 35 II\nColor Black\nHeadphones Form Factor Over Ear', '149.95', '152.95', 'en', 137),
(136, 'Ghost of Tsushima - PlayStation 4', 'Available Now - Ghost of Tsushima: Legends, a new cooperative multiplayer* experience inspired by Japanese folk tales and mythology.\nBeyond war, ancient beauty endures: Uncover the hidden wonders of Tsushima in this open-world action adventure.\nThe rise of the Ghost: Forge a new path and wage an unconventional war for the freedom of Tsushima.', '', '39.99', '40.79', 'en', 138),
(137, 'FIFA 21 – PlayStation 4 & PlayStation 5', 'TWO FIFA GAMES FOR THE PRICE OF ONE\nGet FIFA 21 for both current and next generation game systems\nUp to $69.99 in value for free\nBased on MSRP. Conditions apply. See \"From the Manufacturer\" section below', '', '24.99', '25.49', 'en', 139),
(138, 'Apple Lightning to Digital AV Adapter', 'Compatible Devices Apple iPad 4/Apple iPad Mini/Apple iPhone 5/Apple iPhone 5S/iPod Touch 5\nBrand Apple\nColor White\nItem Weight 0.1 Pounds\nConnector Gender 888462323062Put your slides, movies, photos and everything else on your iPad with Retina display, iPad mini, iPhone 5, or iPod touch (5th generation) screen on an even bigger screen: your HDTV.\nThe Lightning to Digital AV Adapter mirrors exactly what you see on iPad with Retina display, iPad mini, or iPhone 5, so that everyone in the room can enjoy it on your widescreen TV, video projection screen, or other HDMI-compatible display.\nThe Lightning Digital AV Adapter also supports video out for iPad with Retina display, iPad mini, iPhone 5, or iPod touch (5th generation).', 'Compatible Devices Apple iPad 4/Apple iPad Mini/Apple iPhone 5/Apple iPhone 5S/iPod Touch 5\nBrand Apple\nColor White\nItem Weight 0.1 Pounds\nConnector Gender 888462323062', '44.96', '45.86', 'en', 140),
(139, 'Paper Mario: The Origami King - Nintendo Switch', 'A new paper-crafted Mario adventure unfolds on Nintendo Switch!\nThe kingdom has been ravaged by an origami menace! Join Mario and his new partner, Olivia, as they battle evil Folded Soldiers, repair the damaged landscape, and try to free Princess Peach’s castle from the clutches of King Olly in this comedy-filled adventure\nMaster strategic, ring-based battles - line up scattered enemies and plan your attack to maximize damage with the new, ring-based battle system that requires both puzzle-solving skills and a quick wit', '', '59.99', '61.19', 'en', 141),
(140, 'Super Mario Maker 2 - Nintendo Switch', 'Play a nearly limitless number of side scrolling Super Mario courses anytime, anywhere\nStart with the 100+ built in courses in the single player Story Mode, a new Mario adventure that unleashes the creative potential of Super Mario Maker 2\nBreak the rules as you use a wide range of parts, tools, and customization options to create the side scrolling Super Mario courses of your dreams alone or together by passing a Joy Con controller to a partner\nWith a Nintendo Switch Online membership, power up the fun, even further in Course World as part of the vibrant Super Mario Maker 2 community: share your courses, access a near endless supply made by others, enjoy online multiplayer, and more\nFree software updates to Super Mario Maker 2 have added new features like a World Maker mode, letting players create their own world map. Also added are Link from the Legend of Zelda series as a playable character, new cars parts, and more', '', '54.27', '55.36', 'en', 142),
(141, 'Apple USB-C Charge Cable (2m)', 'connector-type Usb Type C\nCable Type USB\nCompatible Devices Laptop\nColor White\nBrand AppleThis 2-meter charge cable with USB-C connectors on both ends\nIdeal for charging USB-C devices\nAlso supports USB 2 for syncing and data transfer between USB-C devices.', 'connector-type Usb Type C\nCable Type USB\nCompatible Devices Laptop\nColor White\nBrand Apple', '18.99', '19.37', 'en', 143),
(142, 'The Legend of Zelda: Breath of the Wild - Nintendo Switch', 'Discover Hyrule as never before: by making your own path, choices, and consequences\nIngenuity is the key to survival: find multiple solutions to tons of dynamic puzzles\nSurprises hide around every corner: scavenge weapons, armor, plants, animals, and more\nLive off the land: find weapons and armor, cook food, and brew elixirs\nUtilize special technology: the in-game Sheikah Slate controls objects and enemies in fun ways', '', '52.52', '53.57', 'en', 144),
(143, 'Marvel\'s Avengers for PlayStation 4', 'Available on September 4th, 2020 for PlayStation 4, plus PlayStation 5 owners can upgrade to the PS5 version of the game at no additional cost; Players can also enjoy cross-gen play between PlayStation 4 and PlayStation 5\nMarvel’s Avengers is a unique take on these iconic Super Heroes, including Captain America, Iron Man, the Hulk, Black Widow, and Thor; Unlock powerful skills and new gear to build your ideal version of Earth’s Mightiest Heroes\nUp to 4 players can assemble online to defend the Earth from escalating threats', '', '27.99', '28.55', 'en', 145),
(144, 'DualShock 4 Wireless Controller for PlayStation 4 - Midnight Blue', 'Precision control: The feel, shape, and sensitivity of the Dualshock 4\'s analog sticks and trigger buttons have been enhanced to offer players absolute control for all games on PlayStation 4\nSharing at your fingertips: The addition of the share button makes sharing your greatest gaming moments as easy as a push of a button\nNew ways to play: Revolutionary features like the touch pad, integrated light bar, and built in speaker offer exciting new ways to experience and interact with your games\nCharge Efficiently: The Dualshock 4 wireless controller can be easily be recharged by plugging it into your PS4 system, even when on standby, or with any standard charger with a micro USB port\nNote: Kindly refer to the user manual provided as a PDF manual in the product description section', '', '64.99', '66.29', 'en', 146),
(145, 'Apple TV (32GB, 4th generation)', 'Connections Ethernet\nBrand Apple\nSupported Internet Services Netflix, Hulu, Espn\nItem Weight 0.41 Kilograms\nMemory Storage Capacity 32 GB1080p HD for high-quality video\nDolby digital Plus 7.1 surround sound\nA8 chip\nVoice search by asking the Siri Remote\nView photos and videos from your iPhone and iPad on TV\nNetflix, HBO Now, Hulu, Amazon Prime video, ESPN, iTunes, and thousands more apps in the app store', 'Connections Ethernet\nBrand Apple\nSupported Internet Services Netflix, Hulu, Espn\nItem Weight 0.41 Kilograms\nMemory Storage Capacity 32 GB', '149.0', '151.98', 'en', 147),
(146, 'Apple Watch Magnetic Charging Cable (1m)', 'connector-type Other\nColor White\nBrand Apple\nConnector Gender MaleMake charging your Apple Watch utterly effortless.\nSimply hold the connector near the back of the watch, where magnets cause it to snap into place automatically.\nIt’s a completely sealed system free of exposed contacts. And it’s very forgiving, requiring no precise alignment.\n1m USB cable\nCompatible with Mac', 'connector-type Other\nColor White\nBrand Apple\nConnector Gender Male', '24.99', '25.49', 'en', 148),
(147, 'Logitech M525 Wireless Mouse – Long 3 Year Battery Life, Ergonomic Shape for Right or Left Hand Use, Micro-Precision Scroll Wheel, and USB Unifying Receiver for Computers and Laptops, Black/Gray', 'Connections Wireless\nColor Black/Grey\nMovement Detection Technology Optical\nBrand Logitech\nHand Orietation AmbidextrousERGONOMIC SHAPE - Ergonomically shaped design and soft rubber grips conform to your hand to be naturally comfortable and the compact size makes it easy to take with you wherever you use your computer at home, at work or anywhere else, USB receiver is stored inside the mouse where the batteries are located\nInterface: USB receiver. Mouse Dimensions (height x width x depth)-4.00 x 2.24 x 1.51 inches. Receiver Dimensions (height x width x depth)-0.57 x 0.74 x 0.24 inches\nCONVENIENT CONTROLS - Easy-to-reach Back/Forward buttons makes moving quickly between documents or browsing your favorite Web sites a breeze\nMICRO-PRECISE SCROLL WHEEL - With more grooves per millimeter, our new scroll wheel gives you the ultimate navigation experience\nLONG BATTERY LIFE - 3 year battery life and smart sleep mode help you go longer between battery changes\nPLUG\'N\'PLAY CONNECTION - Nano-sized Logitech wireless unifying receiver stays in your computer plug it in, forget it, even add compatible wireless devices without multiple USB receivers', 'Connections Wireless\nColor Black/Grey\nMovement Detection Technology Optical\nBrand Logitech\nHand Orietation Ambidextrous', '20.62', '21.03', 'en', 149),
(148, 'Apple Lightning to USB-C Cable (1 m)', 'connector-type Lightning\nCable Type USB\nCompatible Devices Laptop, Smartphone\nColor White\nBrand AppleConnect your iPhone, iPad, or iPod with Lightning connector to your USB-C or Thunderbolt 3 (USB-C) enabled Mac for syncing and charging.\nYou can also use this cable with your Apple 29W, 61W, or 87W USB-C Power Adapter to charge your iOS device, and even take advantage of the fast-charging feature on iPad Pro, iPhone 8, iPhone 8 Plus, and iPhone X. Reversible design\nCompatible with the following computers: 12-inch MacBook, 13-inch MacBook Pro - Thunderbolt 3 (USB-C), 15-inch MacBook Pro - Thunderbolt 3 (USB-C), 21.5-inch iMac - Thunderbolt 3 (USB-C), 27-inch iMac - Thunderbolt 3 (USB-C); iMac Pro', 'connector-type Lightning\nCable Type USB\nCompatible Devices Laptop, Smartphone\nColor White\nBrand Apple', '19.0', '19.38', 'en', 150),
(149, 'New Apple Watch Series 6 (GPS, 40mm) - Blue Aluminum Case with Deep Navy Sport Band', 'Supported Application Fitness Tracker, Voice Assistant, Elevation Tracker, GPS, Heart Rate Monitor\nBrand Apple\nSize 40mm\nSupports Bluetooth 5 GHz Radio Frequency\nColor Blue Aluminum Case with Deep Navy Sport BandGPS model lets you take calls and reply to texts from your wrist\nMeasure your blood oxygen with an all-new sensor and app\nCheck your heart rhythm with the ECG app\nThe Always-On Retina display is 2.5x brighter outdoors when your wrist is down\nS6 SiP is up to 20% faster than Series 5\n5GHz Wi-Fi and U1 Ultra Wideband chip\nTrack your daily activity on Apple Watch and see your trends in the Fitness app on iPhone', 'Supported Application Fitness Tracker, Voice Assistant, Elevation Tracker, GPS, Heart Rate Monitor\nBrand Apple\nSize 40mm\nSupports Bluetooth 5 GHz Radio Frequency\nColor Blue Aluminum Case with Deep Navy Sport Band', '384.98', '392.68', 'en', 151),
(150, 'Duracell - CopperTop D Alkaline Batteries with recloseable package - long lasting, all-purpose D battery for household and business - 8 count', 'Batteries 12 C batteries required. (included)\nBrand Duracell\nBattery Weight 139 Grams\nCompatible Devices Remotes, Toy, Torch\nItem Dimensions LxWxH 5.3 x 3.6 x 2.4 inchesDuracell - CopperTop D Alkaline Batteries with recloseable package - long lasting, all-purpose D battery for household and business - 8 count\nDuracell D Batteries: The Duracell CopperTop D alkaline battery is designed for use in household items like remotes, flashlights, toys and more.\nDuracell guarantees these batteries against defects in material and workmanship. Should any device be damaged due to a battery defect, we will repair or replace it at our option.\nLong Lasting Power: Duracell alkaline batteries are designed and developed for long lasting performance.\nGuaranteed for 10 years in Storage: Duracell D alkaline batteries are guaranteed for 10 years in storage.\n#1 Trusted Battery Brand: Duracell CopperTop batteries are available in Double A (AA), Triple A (AAA), C, D and 9V sizes.', 'Batteries 12 C batteries required. (included)\nBrand Duracell\nBattery Weight 139 Grams\nCompatible Devices Remotes, Toy, Torch\nItem Dimensions LxWxH 5.3 x 3.6 x 2.4 inches', '13.98', '14.26', 'en', 152),
(151, 'Apple TV 4K (32GB, Latest Model)', 'Connections Wireless\nBrand Apple\nSupported Internet Services Netflix, Hulu, Espn\nItem Weight 1.8 Pounds\nMemory Storage Capacity 32 GB4K High Dynamic Range (Dolby Vision and HDR10) for stunning picture quality Dolby Digital Plus 7.1 surround sound\nA10X Fusion chip for ultra-fast graphics and performance\nVoice search by asking the Siri Remote. Compatibility- Apple TV is compatible with HD and UHD TVs with HDMI. Apple TV is compatible with Bluetooth keyboards\nView photos and videos from your iPhone and iPad on TV\nNetflix, iTunes, Hulu, ESPN, and thousands more apps in the App Store*', 'Connections Wireless\nBrand Apple\nSupported Internet Services Netflix, Hulu, Espn\nItem Weight 1.8 Pounds\nMemory Storage Capacity 32 GB', '179.0', '182.58', 'en', 153),
(152, 'Sony WH-1000XM4 Wireless Industry Leading Noise Canceling Overhead Headphones with Mic for Phone-Call and Alexa Voice Control, Black', 'Brand Sony\nConnections Wireless\nModel Name WH1000XM4/B\nColor Black\nHeadphones Form Factor Over EarIndustry-leading noise canceling with Dual Noise Sensor technology\nNext-level music with Edge-AI, co-developed with Sony Music Studios Tokyo\nUp to 30-hour battery life with quick charging (10 min charge for 5 hours of playback)\nTouch Sensor controls to pause/play/skip tracks, control volume, activate your voice assistant, and answer phone calls\nSpeak-to-chat technology automatically reduces volume during conversations\nSuperior call quality with precise voice pickup\nWearing detection pauses playback when headphones are removed', 'Brand Sony\nConnections Wireless\nModel Name WH1000XM4/B\nColor Black\nHeadphones Form Factor Over Ear', '244.64', '249.53', 'en', 154),
(153, 'Sega Genesis Mini - Genesis', 'The iconic SEGA Genesis console that defined a generation of gaming returns in a slick, miniaturized unit.\nThe SEGA Genesis Mini console is loaded with 42 legendary games and is plug and play ready right out of the box!\nBox contents: Sega Genesis Mini console and 2 wired controllers, 40 games + 2 bonus games, power cable and USB adapter, and HDMI cable.', '', '57.54', '58.69', 'en', 155),
(154, 'Watch Dogs Legion - Xbox One Standard Edition', 'Recruit and play as anyone from London. Everyone you see has a unique backstory, personality, and skill set for unique situations\nHack armed drones, deploy spider-bots, and take down enemies using an Augmented Reality Cloak\nExplore a massive urban open world featuring London’s many iconic landmarks and fun side activities\nTeam up with your friends as you complete co-op missions and unique game modes\nUpgrade to the Gold Edition or Ultimate Edition for access to the season pass and more', '', '39.82', '40.62', 'en', 156),
(155, 'Elite Series 2 Controller - Black', 'Brand Microsoft\nModel Name Elite Series 2 Controller - Black\nOperating System Xbox One\nMax Printspeed Color 40\nMax Printspeed Monochrome 40Play like a pro with the all new Xbox elite wireless controller series 2\nTailor the controller with new interchangeable thumbstick and paddle shapes\nExperience limitless customization and exclusive configuration options with the Xbox Accessories app\nStay in the game for longer with upto 40 hours of rechargeable battery life. Use Xbox Wireless, Bluetooth, or the included USB C cable to play across your Xbox One and Windows 10 devices\nMSRP $179.99\nCompatible with Xbox Series X, Xbox One, Windows 10', 'Brand Microsoft\nModel Name Elite Series 2 Controller - Black\nOperating System Xbox One\nMax Printspeed Color 40\nMax Printspeed Monochrome 40', '153.97', '157.05', 'en', 157),
(156, 'HyperX Cloud II - Gaming Headset, 7.1 Surround Sound, Memory Foam Ear Pads, Durable Aluminum Frame, Detachable Microphone, Works with PC, PS4, Xbox One - Red', 'Brand HyperX\nConnections Wired\nSeries HyperX Cloud II\nColor Red\nHeadphones Form Factor Closed-backDesigned for comfort – Exceptionally comfortable memory foam ear cushions and padded leatherette headband help keep you focused on gaming\nSupreme audio quality – Large 53 millimeter drivers provide high-quality audio. Hear in-game details better and get the in-game advantage on your opponents\n7.1 virtual surround sound – Truly immerse yourself in your games with hardware-driven virtual 7.1 surround sound for precisely located audio\nPassive noise cancellation – The closed ear cup design blocks out outside distractions to keep you in the game\nBuilt to last – The solid, durable aluminum frame is built to withstand the blows of daily use\nDetachable, noise-cancelling microphone – TeamSpeak and Discord certified so you can chat with your friends and your callouts will be heard loud and clear\nCompatibility: 7.1 virtual surround sound on PC & Mac. Stereo on PS4, Xbox One, Nintendo Switch, and mobile devices\n#1 best-selling PC gaming headset brand in the US. source: The NPD group, inc., U.S. retail tracking service, PC headset / PC microphone, gaming designed, Jan. 2018-Dec. 2019', 'Brand HyperX\nConnections Wired\nSeries HyperX Cloud II\nColor Red\nHeadphones Form Factor Closed-back', '79.0', '80.58', 'en', 158),
(157, 'Bose Sport Earbuds - True Wireless Earphones - Bluetooth Headphones for Workouts and Running, Triple Black', 'Brand Bose\nConnections Wireless\nModel Name Sport Earbuds\nColor Triple Black\nHeadphones Form Factor In EarWireless Bluetooth earbuds engineered by Bose for your best workout yet.\nBose lifelike sound — makes your music sound like the performer is right there beside you, pushing you to go one more mile or do one more rep.\nSecure and comfortable earbuds — customize your fit with the included 3 sizes of StayHear Max tips that won’t hurt your ears and won’t fall out no matter tough your workout is.\nWeather and sweat resistant earbuds — IPX4 rated, with electronics wrapped in special materials to protect from moisture wherever you exercise\nClear calls — a beamforming microphone array separates your voice from surrounding noise so your callers can hear you better.\nSimple touch controls — Instead of buttons, the capacitive touch interface lets you swipe up and down for volume control (optional), tap to play or pause music, answer calls, and more\nLong battery life— up to 5 hours per charge with the included charging case, plus up to 2 more hours with a 15-minute quick charge on the go.', 'Brand Bose\nConnections Wireless\nModel Name Sport Earbuds\nColor Triple Black\nHeadphones Form Factor In Ear', '151.99', '155.03', 'en', 159),
(158, 'Logitech M570 Wireless Trackball Mouse – Ergonomic Design with Sculpted Right-Hand Shape, Compatible with Apple Mac and Microsoft Windows Computers, USB Unifying Receiver, Dark Gray', 'Connections Wireless\nColor Dark Grey\nMovement Detection Technology Trackball, Laser\nBrand Logitech\nHand Orietation RightStop chasing a mouse around. Your trackball stays in one place and puts control under your thumb, so you don\'t have to move your arm to move your cursor. And its sculpted shape supports your hand for comfortable control all day long.\nThis trackball includes the Logitech unifying receiver. The tiny wireless receiver stays in your laptop, so there\'s no need to unplug it when you move around. Plus, you can easily add a compatible keyboard, number pad or mouse-without the hassle of multiple USB receivers.\nYou can go for up to 18 months without changing batteries and the convenient battery indicator helps to ensure that you\'ll never be caught off guard. Battery life may vary based on user and computing conditions.\nYou get precise cursor control wherever you want to use your trackball. Hard tables, comfy sofas and lumpy beds are all no problem for the M570.\nThe integrated scroll wheel and easy-to-reach back/forward buttons make control simple, whether you\'re web surfing on a laptop or navigating a home-theater PC.\nStop chasing a mouse around. Your trackball stays in one place and puts control under your thumb, so you don\'t have to move your arm to move your cursor. And its sculpted shape supports your hand for comfortable control all day long.\nNote: In case of wireless mouse, the USB receiver will be provided inside or along with the mouse', 'Connections Wireless\nColor Dark Grey\nMovement Detection Technology Trackball, Laser\nBrand Logitech\nHand Orietation Right', '28.94', '29.52', 'en', 160),
(159, 'Bose Companion 2 Series III Multimedia Speakers - for PC (with 3.5mm AUX & PC Input)', 'Brand Bose\nSpeaker Type Multimedia\nMounting Type Table Top\nItem Weight 1800 Grams\nColor BlackHigh quality audio performance, with clear sound at any volume. Use the auxiliary input to bring Bose performance to another audio source such as your iPhone or iPad. Upgrade your sound and your experience with Bose Companion 2 Series III speakers\nHigh quality audio performance, with clear sound at any volume\nPlay an additional device just connect to the auxiliary input\nVolume control/headphone jack on front of right speaker\nOperating compatibility: Mac, Windows XP', 'Brand Bose\nSpeaker Type Multimedia\nMounting Type Table Top\nItem Weight 1800 Grams\nColor Black', '88.08', '89.84', 'en', 161),
(160, 'DualShock 4 Wireless Controller for PlayStation 4 - Glacier White', 'The feel, shape, and sensitivity of the dual analog sticks and trigger buttons have been improved to provide a greater sense of control, no matter what you play\nThe dualshock 4 wireless controller features a built-in speaker and stereo headset jack, putting several new audio options in the player\'s hands\nThe dualshock 4 wireless controller can be easily recharged by plugging it into your PlayStation 4 system, even when in rest mode, or with any standard charger using a USB cable.', '', '64.99', '66.29', 'en', 162),
(161, 'Super Mario Party', 'Outwit friends and family as you race across the board; whoever gets the most stars wins!\nThe original 4-player Mario Party series board game mode is back!\nCharacter-specific Dice Blocks with alternate numberings add another level to your strategy\nPair two Nintendo Switch systems, lay them flat, and creatively combine both screens to enjoy a new, interactive style of tabletop gaming in Toad’s Rec Room mode**\n80 new minigames packed with wildly different challenges and clever uses of Joy-Con controllers; Put your skills to the test in sets of five minigames online*—a series first!', '', '56.01', '57.13', 'en', 163),
(162, 'Fujifilm Instax Mini 11 Instant Camera - Lilac Purple', 'Brand Fujifilm\nFilm Format Type Instant\nModel Name Fujifilm 16654803 instax mini 11 (Lilac Purple)\nItem Dimensions LxWxH 4.24 x 4.77 x 2.65 inches\nItem Weight 1.01 PoundsSlim body size with transparent ring lens\nAutomatic exposure - The Mini 11 automatically selects the optimal shutter speed in any environment. Mini 11 captures bright backgrounds and bright subjects even in dark scenes.\nOne-touch selfie mode - The Mini 11 has a built-in macro mode and selfie mirror for the perfect selfie. You don’t need a close-up lens attachment. Just pull out the lens barrel until the “Selfie Mode” mark appears\nCustomize your camera - Two shutter button accessories are included - Jewel button and a glow button.\n2 - AA batteries', 'Brand Fujifilm\nFilm Format Type Instant\nModel Name Fujifilm 16654803 instax mini 11 (Lilac Purple)\nItem Dimensions LxWxH 4.24 x 4.77 x 2.65 inches\nItem Weight 1.01 Pounds', '69.0', '70.38', 'en', 164),
(163, 'Splatoon 2 - Nintendo Switch', 'New weapons - New dual wielding Splat Dualies join the action, complete with a new Dodge Roll move. Mainstays like the Splat Roller and Splat Charger have also been remixed to include new gameplay mechanics and brand new special weapons.\nLocal and Online Multiplayer - In a first for the series, compete in local multiplayer Turf War battles, whether in TV mode or on the go in handheld or tabletop modes. Online battles also make a return.\nNew ways to play - Play using the Joy Con controllers or the Nintendo Switch Pro Controller, both of which allow for gyro controls for better aiming and control.\nSmart Device Support - With the Nintendo Switch Online smartphone app***, you can use SplatNet to access enhanced matchmaking, voice chat options, battle statistics, and more!\nTurf War Iconic 4 vs. 4 Turf War battles return - The goal is to splat ink on as much territory as possible, while strategically submerging yourself in your team\'s colors and blasting your enemies.', '', '49.99', '50.99', 'en', 165),
(164, 'NHL 21 - Xbox One', 'Pre-order NHL 21 Standard Edition and receive:\nUp to 2 HUT Diamond Player Choice Packs (1 per month for 2 months)\n1 Unlocked Hockey Bag', '', '29.96', '30.56', 'en', 166),
(165, 'Madden NFL 21 – PlayStation 4 & PlayStation 5', 'TWO MADDEN GAMES FOR THE PRICE OF ONE\nGet MADDEN NFL 21 for both current and next generation game systems\nUp to $69.99 in value for free\nBased on MSRP. Conditions apply. See \"From the Manufacturer\" section below', '', '39.0', '39.78', 'en', 167);
