(166, 'Super Mario Odyssey - Nintendo Switch', 'Explore 3D kingdoms filled with secrets and surprises, including costumes for Mario and several ways to interact with environments\nMario\'s new friend, Cappy, lets you master new moves like cap throw, cap jump and capture\nVisit astonishing new locales, such as the skyscraper-packed New Donk City, and run into familiar friends and foes as you try to save Princess Peach from Bowser\'s clutches and foil his dastardly wedding plans\nHand a Joy-Con controller to a friend to enjoy simultaneous multiplayer: Player 1 controls Mario while Player 2 controls Mario’s new ally Cappy\nUnlock even more features with the exclusive new amiibo figures - Mario, Princess Peach and Bowser dressed in their wedding outfits', '', '54.69', '55.78', 'en', 168),
(167, 'Bose SoundSport Wireless, Sweat Resistant, In-Ear Headphones, Black', 'Brand Bose\nConnections Wired\nColor Black\nHeadphones Form Factor In Ear\nHeadphones Jack USBA high quality audio experience, consistently balanced at any volume, thanks to Bose active EQ. Connectivity technology: Wireless\nWireless convenience, with easy Bluetooth and NFC pairing aided by voice prompts\nExclusive stay hear and tips keep the headphones comfortably in place during workouts\nSweat and weather resistance for reliability while exercising\nUp to 6 hours battery life per charge. Please refer the user guide before use', 'Brand Bose\nConnections Wired\nColor Black\nHeadphones Form Factor In Ear\nHeadphones Jack USB', '99.0', '100.98', 'en', 169),
