(169, 'Apple 5W USB Power Adapter', 'Compatible Devices Tablets\nBrand Apple\nColor White\nPower Source AC\nItem Weight 0.09 PoundsFeaturing an ultracompact design, this power adapter offers fast, efficient charging at home, in the office, or on the go\nWorks with any iPhone, Apple Watch, iPad or iPod model\nImportant note: This USB Power Adapter has fixed prongs for use in the U.S., Canada, Japan, Taiwan, and parts of Latin America\nCharging cable sold separately\nModel Number A1385', 'Compatible Devices Tablets\nBrand Apple\nColor White\nPower Source AC\nItem Weight 0.09 Pounds', '16.99', '17.33', 'en', 171),
(170, 'Apple USB-C to USB Adapter', 'USB-C to USB Adapter\nConnections: USB 3.1 Gen 1, USB-C\nSome USB accessories are not supported.', '', '19.0', '19.38', 'en', 172),
(171, 'PNY 64GB Turbo Attaché 3 USB 3.0 Flash Drive - (P-FD64GTBOP-GE)', 'Color GREY\nMemory Storage Capacity 64\nBrand PNY\nHardware Interface USB 3.0\nRead Speed 95 Megabytes Per SecondTransfer speeds approximately 10 times faster than standard PNY USB 2.0 Flash Drives\nStore and transfer large files faster than ever with USB 3.0 technology\nAllows for quick and easy transfer of all content\nThe 64GB Turbo USB 3.0 Flash Drive can hold approximately 11,837 songs\nSliding collar, capless design with integrated loop makes it easy to attach to key chains, backpacks and etc\nBackwards compatible with USB 2.0 ports, so you can utilize any USB 2.0 or USB 3.0 port; compatible with most PC and Mac laptop and desktop computers\nFree technical support', 'Color GREY\nMemory Storage Capacity 64\nBrand PNY\nHardware Interface USB 3.0\nRead Speed 95 Megabytes Per Second', '10.93', '11.15', 'en', 173),
