(176, 'Wacom CTL4100 Intuos Graphics Drawing Tablet with Software, 7.9\" X 6.3\", Black, Small', 'Brand Wacom\nColor Black\nItem Weight 0.51 Pounds\nConnections USBGraphics tablet to use in any software for digital art, photo editing and animation 4096 levels of pressure sensitivity and 2540 lip\nConnect this digital drawing tablet to your computer via USB cable to your Mac or PC to easily write, edit or convey ideas to students or colleagues when web-conferencing\nSlim design and compact sized art tablet with a large drawing area (6.0 inches x 3.7 inches); Perfect for limited desktop areas and gives more room to create\nEasy setup, for both left and right handed use; The pen doesn\'t need to be charged so you can start creating immediately; 4 customizable express keys put your favorite shortcuts at your fingertips\nMULTI-FUNCTIONAL: Soft-lined laptop sleeve—holds up to 15\" MacBook Pro or similarly sized laptop. Top grab handle. D-Ring on front panel for additional attachment point for key chains. Perfect for school, work, gym and travel.\nSystem requirements: Windows 7, 8.1 or 10 (excluding Windows 10 S; Latest service pack/build), macOS X 10.11 or later (latest update)\nWacom Intuos comes with 3-month trials of EdTech software for teachers; Register your tablet to receive: Kami App, ExplainEverything, Pear Deck, Limnu & Collaboard', 'Brand Wacom\nColor Black\nItem Weight 0.51 Pounds\nConnections USB', '79.95', '81.55', 'en', 179),
(177, 'Kasa Smart HS220 Dimmer Switch by TP-Link, Single Pole, Needs Neutral Wire, Wi-Fi Light Switch for LED Lights, Works with Alexa and Google Assistant, UL Certified, 1-Pack', 'Brand Kasa Smart\nSwitch Style Dimmer\nPump type ON-OFF\nItem Dimensions LxWxH 5 x 3.4 x 1.8 inches\nSwitch Type 1-way\nPlug Profile Wall Mount\nActuator Type Push Button\nSee moreControl from anywhere - Turn electronics on or off from anywhere with your smartphone using the Kasa app (Compatible w/ Android & iOS)\nVoice Control - Works with Amazon Alexa, Google Assistant and Microsoft Cortana supported devices for a hands-free experience\nGentle off - Tailor your lighting to fade on with a click of the switch or a double-click to gently fade off the lights while your child drifts off to sleep\nScheduling - Use Schedules to set your smart switch to automatically turn on and off while you\'re home or away\nNote: Requires a neutral wire / Works in a single-pole setup only / Secured 2.4 GHz WiFi network connection\n› See more product details', 'Brand Kasa Smart\nSwitch Style Dimmer\nPump type ON-OFF\nItem Dimensions LxWxH 5 x 3.4 x 1.8 inches\nSwitch Type 1-way\nPlug Profile Wall Mount\nActuator Type Push Button\nSee more', '17.99', '18.35', 'en', 180),
(178, 'Motorola T100 Talkabout Radio, 2 Pack', 'Brand Motorola Solutions\nColor Blue\nnumber_of_channels 22\nBatteries 3 AAA batteries required.\nTuner Technology Communicates with other FRS/GMRS radios regardless of brand\nItem Dimensions LxWxH 1.1 x 1.91 x 5.22 inches\nItem Weight 0.25 PoundsIncluded Components: 2 Radios, 2 Belt Clips, 1 User Guide', 'Brand Motorola Solutions\nColor Blue\nnumber_of_channels 22\nBatteries 3 AAA batteries required.\nTuner Technology Communicates with other FRS/GMRS radios regardless of brand\nItem Dimensions LxWxH 1.1 x 1.91 x 5.22 inches\nItem Weight 0.25 Pounds', '28.74', '29.31', 'en', 181),
(179, 'Brother Genuine Standard Yield Toner Cartridge, TN730, Replacement Black Toner, Page Yield Up To 1,200 Pages, Amazon Dash Replenishment Cartridge', 'Make sure this fits by entering your model number.\nBrother genuine cartridge: Brother TN-730 is a Brother genuine cartridge: that produces mono laser prints in high quality you can depend on. ; Brother Genuine toner produces crisp, sharp prints that withstand the test of time.\nYields up to 1,200 Pages: This replacement standard-yield black toner cartridge can print approximately 1,200 pages(1). ; Intelligently engineered to work in seamless unison with your Brother printer.\nSeamless integration: This professional replacement black toner cartridge creates rich blacks and is engineered to work in seamless unison with your Brother laser printer\nAmazon dash replenishment cartridge: Upon activation with your Dash-eligible Brother printer, TN-730 replacement cartridges can be automatically ordered through Amazon Dash Replenishment and sent directly to your door.\nFor use with brother laser printers and all in ones DCP-L2550DW, HL-L2350DW, HL-L2370DW, HL-L2370DW XL, HL-L2390DW, HL-L2395DW, MFC-L2710DW, MFC-L2750DW, MFC-L2750DW XL.', '', '42.98', '43.84', 'en', 182),
(180, 'Canon ZINK Photo Paper Pack, 50 Sheets', 'Brand Canon\nItem Weight 0.15 Pounds\nPaper Finish Glossy\nSheet Size 2 x 3\nBrightness Rating 1 CandelaZink sticky backed photo paper\nFor Canon Ivy mini photo printers\n50 sheets', 'Brand Canon\nItem Weight 0.15 Pounds\nPaper Finish Glossy\nSheet Size 2 x 3\nBrightness Rating 1 Candela', '24.0', '24.48', 'en', 183),
(181, 'Nintendo Switch Lite - Yellow', 'Handheld Nintendo Switch gaming at a great price\nFor every member of your family, there’s a member of ours\nOptimized for personal, handheld play, Nintendo Switch Lite is a small and light Nintendo Switch system\nFeatures a sleek, unibody design with fully integrated controls and a built-in +Control Pad\nCompatible with all physical and digital Nintendo Switch games that support Handheld mode', '', '199.0', '202.98', 'en', 184),
(182, 'Sony Noise Cancelling Headphones WHCH710N: Wireless Bluetooth Over the Ear Headset with Mic for Phone-Call, Black', 'Brand Sony\nConnections Wireless\nModel Name WHCH710N/B\nColor Black\nHeadphones Form Factor Over EarCancel out the world with smart noise cancellation\nNoise cancellation automatically senses your environment with Dual Noise Sensor Technology\nLong-lasting listening with up to 35 hours of battery and quick charging\nSmartphone compatibility for hands-free calls and use with your voice assistant\nWireless Bluetooth streaming with NFC one-touch\nHear more detail with the 30 millimeter driver units\nUltra-comfortable headphones design with adjustable metal sliders', 'Brand Sony\nConnections Wireless\nModel Name WHCH710N/B\nColor Black\nHeadphones Form Factor Over Ear', '66.0', '67.32', 'en', 185),
(183, 'Apple USB-C to 3.5 mm Headphone Jack Adapter', 'The USB-C to 3.5 mm Headphone Jack Adapter lets you connect devices that use a standard 3.5 mm audio plug — like headphones or speakers — to your USB-C devices.\nWorks with all devices that have a USB-C connector', '', '8.99', '9.17', 'en', 186),
(184, 'Logitech Desktop MK120 Durable, Comfortable, USB Mouse and keyboard Combo', 'Connections USB\nBrand Logitech\nKeyboard Description QWERTYComfortable low-profile keys and standard keyboard layout with full-size F-keys and number pad\nSleek and sturdy spill-resistant design* (*Tested under limited conditions—maximum of 60 ml liquid spillage. Do not immerse keyboard in liquid.)\nHigh-definition optical mouse for smooth, accurate cursor control\nEasy-to-read keys with bold, bright white characters\nSimple wired USB connection—works with Windows-based PCs and Linux', 'Connections USB\nBrand Logitech\nKeyboard Description QWERTY', '14.85', '15.15', 'en', 187),
(185, 'Xbox Wireless Controller - Grey And Blue', 'Experience the enhanced comfort and feel of the Xbox wireless controller\nFeatures a dark grey design with light grey and blue accents\nPlug in any compatible headset with the 3.5 millimeter stereo headset jack\nStay on target with textured grip\nIncludes Bluetooth technology for gaming on Windows 10 PCs and tablets', '', '57.95', '59.11', 'en', 188),
(186, 'Nintendo Switch Lite - Coral - Switch', 'Handheld Nintendo Switch gaming at a great price\nFor every member of your family, there’s a member of ours\nOptimized for personal, handheld play, Nintendo Switch Lite is a small and light Nintendo Switch system\nFeatures a sleek, unibody design with fully integrated controls and a built-in +Control Pad\nCompatible with all physical and digital Nintendo Switch games that support Handheld mode', '', '233.99', '238.67', 'en', 189),
(187, 'Fitbit Ace 2 Activity Tracker for Kids, 1 Count', 'Brand Fitbit\nColor Night Sky + Neon Yellow\nCompatible Devices Smartphones\nItem Dimensions LxWxH 1.18 x 3.94 x 8.94 inches\nItem Weight 0.02 KilogramsSteps & active minutes tracking lets kids skip, jump & move their way to a healthier life. The syncing range is up to 6 meters\nKids earn virtual badges and fun on screen celebrations when they reach their goals\nBring on the pool party cannonballs or lunchtime spills Ace 2 is swim proof (water resistant to 50 meters)\nKids spend less time charging & more time moving with up to 5 days of battery (varies with use and other factors; animated clock faces require more frequent charging)\nPair ace 2 to a child account to access a limited kid view. Kids can also challenge their friends to step competitions & send each other messages or cheers in app\nHelp kids get the sizes they need with sleep tracking, bedtime reminders and silent alarms', 'Brand Fitbit\nColor Night Sky + Neon Yellow\nCompatible Devices Smartphones\nItem Dimensions LxWxH 1.18 x 3.94 x 8.94 inches\nItem Weight 0.02 Kilograms', '66.93', '68.27', 'en', 190),
(188, 'NHL 21 - PlayStation 4', 'Pre-order NHL 21 Standard Edition and receive:\nUp to 2 HUT Diamond Player Choice Packs (1 per month for 2 months)\n1 Unlocked Hockey Bag', '', '29.96', '30.56', 'en', 191),
(189, 'Apple Pencil Tips (4 pack)', 'Color White\nBrand Apple\nItem Weight 0.3 Grams\nItem Dimensions LxWxH 3.12 x 2.57 x 0.59 inches\nAre Batteries Included No\nBatteries Required? NoKeep extra tips for your Apple Pencil at the ready.\nMade by Apple.\nCompatible with 1st generation Apple Pencil.', 'Color White\nBrand Apple\nItem Weight 0.3 Grams\nItem Dimensions LxWxH 3.12 x 2.57 x 0.59 inches\nAre Batteries Included No\nBatteries Required? No', '19.0', '19.38', 'en', 192),
(190, 'Canon PGI-280XL/CLI-281 5 Color Pack Compatible to TR8520, TR7520, TS9120 Series,TS8120 Series, TS6120 Series', 'Brand Canon\nColor Multicolor\nCompatibility Options OEMMake sure this fits by entering your model number.\n[Compatible Printers]: Canon PIXMA TR8520, Canon PIXMA, TR7520, Canon PIXMA, TS9120, Canon PIXMA, TS8120, Canon TS6120\nCombined with Genuine Canon photo paper this ink protects your photos from fading for longer, thanks to the ChromaLife100 System.\nGenuine Canon inks provide optimal performance and offer exclusive access to Creative Park Premium content.\ndepartment name: Mens', 'Brand Canon\nColor Multicolor\nCompatibility Options OEM', '61.99', '63.23', 'en', 193),
(191, 'DYMO Label Maker LabelManager 160 Portable Label Maker, Easy-to-Use, One-Touch Smart Keys, QWERTY Keyboard, Large Display, For Home & Office Organization', 'Printer Output Type Monochrome\nColor Black/White\nPrinting Technology Thermal\nBrand DYMO\nPrinting Media Type LabelsPORTABLE LABEL MAKER: Compact and lightweight for portability, making it easy to label just about anything, anywhere\nTYPE QUICKLY AND EASILY: Label maker lets you quickly type text on the familiar computer style QWERTY keyboard, edit with one touch fast formatting keys and print perfect, professional labels every time\nPRINTS CUSTOM LABELS: Customize your label with 20 plus ways to format text and 200 plus symbols and clip art\nEXTENDED BATTERY LIFE: Enjoy extended battery life with automatic switch off\nUSE WITH AUTHENTIC DYMO LABELS: For best performance, use authentic DYMO Label Tapes in 1/4 Inches, 3/8 Inches and 1/2 Inches (6 millimeter, 9 millimeter, 12 millimeter) widths available in a variety of colors', 'Printer Output Type Monochrome\nColor Black/White\nPrinting Technology Thermal\nBrand DYMO\nPrinting Media Type Labels', '24.99', '25.49', 'en', 194),
(192, 'Logitech B100 Corded Mouse – Wired USB Mouse for Computers and laptops, for Right or Left Hand Use, Black', 'Connections Wired\nColor Black\nMovement Detection Technology Optical, Laser\nBrand Logitech\nHand Orietation AmbidextrousFULL-SIZE COMFORT - A comfortable, ambidextrous shape feels good in either hand, so you feel more comfortable as you work - even at the end of the day\nCONVENIENT CONTROLS - Side-to-side scrolling plus zoom lets you instantly zoom in or out and scroll horizontally and vertically. Perfect for working with spreadsheets and presentations.\nZERO SETUP REQUIRED - Flexible wired connectivity means you just plug the cable into your USB or PS/2 port - it works right out of the box.\nPRECISE CURSOR CONTROL - With 800 dpi sensitivity, you\'ll get precise cursor control so you can edit documents and navigate the Web more efficiently.\nBUILT BY LOGITECH - This mouse comes with the quality and design we’ve built into more than a billion mice, more than any other manufacturer', 'Connections Wired\nColor Black\nMovement Detection Technology Optical, Laser\nBrand Logitech\nHand Orietation Ambidextrous', '7.29', '7.44', 'en', 195),
(193, 'Xbox Wireless Controller - Red', 'Experience the enhanced comfort and feel of the Xbox wireless controller red\nGet upto twice the wireless range than previous controllers\nStay on target with textured grip\nIncludes Bluetooth technology for gaming on Windows 10 PCs and tablets', '', '32.46', '33.11', 'en', 196),
(194, 'Apple USB-C Digital AV Multiport Adapter', 'connector-type USB Type C, HDMI\nBrand Apple\nNumber of Ports 1The USB-C digital AV multiport adapter lets you connect your USB-C enabled Mac or iPad Pro to an HDMI display, while also connecting a standard USB device and a USB-C charging cable.\nThis adapter allows you to mirror your Mac Display to your HDMI-enabled TV or display.\nSimply connect the adapter to a USB-C or Thunderbolt 3 (USB-C) port on your Mac or iPad Pro and then to your TV or projector via an HDMI cable (sold separately).\nUse the standard USB port to connect devices such as your flash drive or camera or a USB cable for syncing and charging your iOS devices.\nYou can also connect a charging cable to the USB-C port to charge your Mac or iPad Pro.', 'connector-type USB Type C, HDMI\nBrand Apple\nNumber of Ports 1', '61.95', '63.19', 'en', 197),
(195, 'New Super Mario Bros. U Deluxe - Nintendo Switch', 'A variety of playable characters are available, some with unique attributes that affect gameplay and platforming physics.\nYounger and less-experienced players will love playing as Toadette, who is brand new to both games, and Nabbit, who was formerly only playable in New Super Luigi U. Both characters offer extra assistance during play.\nMultiplayer sessions are even more fun, frantic, and exciting thanks to entertaining character interactions. Need a boost? Try jumping off a teammate’s head or getting a teammate to throw you!\nFeatures a wealth of help features, like a Hints gallery, reference videos**, and a Super Guide in New Super Mario Bros. U that can complete levels for you if they’re giving you trouble.\nThree additional modes—Boost Rush, Challenges, and Coin Battle—mix up gameplay and add replayability, while also upping the difficulty for players who want to try something harder. Players can use their Mii characters in these modes!', '', '48.99', '49.97', 'en', 198),
(196, 'Focusrite Scarlett Solo (3rd Gen) USB Audio Interface with Pro Tools | First', 'One of the best performing mic preamps the Scarlett range has ever seen, now with switchable air Mode to give your recordings a brighter and more open sound. One high-headroom instrument input to plug in your guitar or bass. Two hum-free balanced outputs provide clean audio playback.\nHigh-performance converters enable you to record and mix at up to 24-bit/ 192kHz.\nQuick start tool to get up and running easier than ever.\nIncludes Pro Tools | First Focusrite Creative Pack, Ableton Live Lite, Softube Time and Tone Bundle, Focusrite’s Red Plug-in Suite, 3-month Splice subscription, and your choice of one free XLN Addictive Keys virtual instrument, all available via download upon purchase and registration\nLIMITED TIME OFFER: FREE D16 Devastator 2 upon registration and download.', '', '109.99', '112.19', 'en', 199),
(197, 'Etekcity Smart Body Fat Scale, Digital Bathroom Scales for Body Weight, BMI, and Weight Loss,Sync 13 Key Body Compositions with Other Fitness Apps,11.8 x 11.8 inches, Black', 'Brand Etekcity\nConnections Bluetooth\nModel Name ESF24\nColor Black\nHeadphones Form Factor Over EarFull body composition analysis- Get 13 essential measurements including Weight, BMI, Body Fat, Visceral Fat, Muscle Mass, Bone Mass, Body Water, and more! You can weigh yourself anytime, even without your phone on hand. The data will sync to the app once your phone and scale connect again\nSyncs with Fitness Apps-Works with Bluetooth on iOS and Android. Free VeSyncFit app syncs data with Apple Health, Google Fit, Fitbit & Samsung Health, so you can store all your data in one convenient, centralized location for viewing trends and tracking progress\nHigh accuracy -4 sensors with the latest technology deliver accurate weight measurements up to 400 lbs/180kg in 0.2 lb/0.05kg increments. Enjoy step-on technology and auto-calibration, 3 x AAA batteries and one tape measure included\nLarge platform, more stable-The 6mm tempered glass and 11.8 × 11.8 inches surface are thicker and larger than most products on the market, which makes it more comfortable and safe to stand on, and more clear to see the numbers on the LED display. Easily change weight units through the app (lb/kg/st)\nOne scale, unlimited users-This smart body fat scale allows you to create unlimited member profiles to seamlessly track multiple users; a family can share one scale together. It\'s convenient when every member knows their body metrics and knows specifically what to work on. Especially helpful for body builders and those working on weight loss', 'Brand Etekcity\nConnections Bluetooth\nModel Name ESF24\nColor Black\nHeadphones Form Factor Over Ear', '18.38', '18.75', 'en', 200),
(198, 'DualShock 4 Wireless Controller for PlayStation 4 - Gold', 'Brand PlayStation\nBattery Description Lithium\nBatteries 1 Lithium ion batteries required. (included)The DualShock 4 Wireless Controller for PlayStation 4 defines this generation of play, combining revolutionary features and comfort with intuitive, precision controls\nEnhanced analog sticks and trigger buttons offer unrivaled control across all titles\nInnovative features like the touch pad, integrated light bar, built in speaker enable exciting ways to experience your games\nNote: Kindly refer to the user manual provided as a PDF manual in the product description section', 'Brand PlayStation\nBattery Description Lithium\nBatteries 1 Lithium ion batteries required. (included)', '64.99', '66.29', 'en', 201),
(199, 'Fujifilm Instax Mini Instant Film (3 Twin Packs, 60 Total Pictures) for Instax Cameras', 'Brand Fujifilm\nModel Name Instax Twin Mini - 60 Sheets\nFilm Format Type Instant\nCompatible Devices Fujifilm instax mini\nIso Equivalent 800Produces credit card-sized prints\nFeatures daylight-balanced film\nCreates vibrant colors and natural skin tones\nExcellent sharpness and grain structure\nGlossy surface type', 'Brand Fujifilm\nModel Name Instax Twin Mini - 60 Sheets\nFilm Format Type Instant\nCompatible Devices Fujifilm instax mini\nIso Equivalent 800', '44.9', '45.8', 'en', 202),
(200, 'New Apple Watch SE (GPS, 44mm) - Space Gray Aluminum Case with Black Sport Band', 'Supported Application Fitness Tracker, Voice Assistant, Elevation Tracker, GPS, Heart Rate Monitor\nBrand Apple\nSize 44mm\nColor Space Gray Aluminum Case with Black Sport Band\nConnections GPSGPS model lets you take calls and reply to texts from your wrist\nLarge Retina OLED display\nUp to 2x faster processor than Series 3\nTrack your daily activity on Apple Watch and see your trends in the Fitness app on iPhone\nMeasure workouts like running, walking, cycling, yoga, swimming, and dance\nSwimproof design\nHigh and low heart rate notifications and irregular heart rhythm notification', 'Supported Application Fitness Tracker, Voice Assistant, Elevation Tracker, GPS, Heart Rate Monitor\nBrand Apple\nSize 44mm\nColor Space Gray Aluminum Case with Black Sport Band\nConnections GPS', '269.98', '275.38', 'en', 203),
(201, 'Apple Wireless Charging Case for AirPods', 'Brand Apple\nConnections Wireless\nModel Name Apple Wireless Charging Case for AirPods\nColor White\nHeadphones Form Factor In EarAirPods charge quickly inside the case\nCase can be charged either wirelessly using a Qi-compatible charging mat or with the Lightning connector\nWorks with AirPods (1st generation or later)', 'Brand Apple\nConnections Wireless\nModel Name Apple Wireless Charging Case for AirPods\nColor White\nHeadphones Form Factor In Ear', '69.0', '70.38', 'en', 204),
(202, 'Xbox One Play and Charge Kit', 'Compatible Devices Game Consoles\nBrand Microsoft\nColor Play and Charge Kit\nPower Source Corded Electric\nItem Weight 6.4 OuncesCompatible with the original Xbox one wireless controller and the new white Xbox wireless controller\nRechargeable Lithium Ion battery pack. Compatible with Xbox One X, Xbox One S, Xbox One, Windows 10\nCharging cable. Fully charges in under 4 hours\nBattery chargers: Automatic Shut-Off, Mini-USB connector\nSay goodbye to AA disposable batteries', 'Compatible Devices Game Consoles\nBrand Microsoft\nColor Play and Charge Kit\nPower Source Corded Electric\nItem Weight 6.4 Ounces', '24.99', '25.49', 'en', 205),
(203, 'Fender Frontman 10G Electric Guitar Amplifier', '10 Watts\n1-6\" Fender Special Design Speaker\nOne Channel\nControls: Gain, Over-Drive Select Switch, Volume, Treble, Bass\nOther Features: 1/4\" Instrument Input, 2-Band EQ, 1/8\" Auxiliary Input Jack for Jam-Along with Media Player or CD, 1/8\" Headphone Output Jack for Silent Practice, Closed-Back Design for Heavier Bass Response', '', '69.99', '71.39', 'en', 206),
(204, 'Bose QuietComfort Noise Cancelling Earbuds - True Wireless Earphones, Triple Black. The world\'s Most Effective Noise Cancelling Earbuds.', 'Brand Bose\nConnections Wireless\nModel Name QuietComfort Earbuds\nColor Triple Black\nHeadphones Form Factor In EarThe world\'s most effective noise cancelling earbuds\nNoise cancelling earbuds — 11 levels of active noise cancelling let you enjoy music, podcasts, & videos without distractions. Transparency mode lets the outside world in for quick conversations.\nAcclaimed Bose sound — Crisp, clear details. Deep, full bass. The innovations in these noise cancelling earphones produce exciting, lifelike sound that’s full and balanced at every volume level.\nComfortable earbuds — Easy to wear all day long because every surface that touches your ear is made of soft silicone. Includes 3 eartip sizes to help you get the best fit.\nSweat & weather resistant — These IPX4-rated wireless noise cancelling earbuds are proven to pump out great-sounding music, even when they’re subjected to rain, sleet, hail, snow, or sweat.\nPowerful battery — These wireless earbuds play for up to 6 hours on a single charge. The wireless charging case provides up to 12 more hours battery life — and it’s compatible with any Qi-certified charging mat.\nSimple touch controls — Controlling your wireless noise cancelling earbuds is as easy as tapping and pressing the surface — similar to how you control your phone.\nBuilt with Bluetooth 5.1 — Bluetooth earbuds work within 30 ft. of your device. When you’re on calls, the microphone system rejects most of the noise around you. Compatible with iOS and Android.', 'Brand Bose\nConnections Wireless\nModel Name QuietComfort Earbuds\nColor Triple Black\nHeadphones Form Factor In Ear', '279.0', '284.58', 'en', 207),
(205, 'Minecraft Dungeons Hero Edition - Nintendo Switch', 'Multiplayer! Up to four players can team up and fight together in co-op mode.\nPower Up! Unlock dozens of unique items and weapon enchantments for devastating special attacks.\nOptions! Personalize your character, then fight up-close and personal with melee swings, hang back with ranged attacks, or tank your way through swarms of mobs, shielded by heavy armour!\nEpicness! Explore treasure-stuffed levels in a quest to take down the evil Arch-Illager!', '', '29.99', '30.59', 'en', 208),
(206, 'Apple iPod Touch (32GB) - Pink (Latest Model)', 'Brand Apple\nConnections Bluetooth, Wi-Fi\nColor Pink\nComponent Type Display\nSupported Standards MP4, MP3\nMemory Card Slot SDHC\nSee more4-inch Retina display\nYour favorite music, gaming, and AR apps in your pocket\nA10 Fusion chip for up to 2x faster performance, up to 3x faster graphics\nGroup FaceTime with family and friends\nConnect using Wi-Fi and Bluetooth', 'Brand Apple\nConnections Bluetooth, Wi-Fi\nColor Pink\nComponent Type Display\nSupported Standards MP4, MP3\nMemory Card Slot SDHC\nSee more', '195.0', '198.9', 'en', 209),
(207, 'Logitech K350 Wireless Wave Keyboard with Unifying Wireless Technology - Black', 'Connections Wireless\nBrand Logitech\nNumber of Buttons 120\nKeyboard Description QWERTYWave design with Constant Curve layout: Curved layout guides hands into just the right position\nEase and comfort: Cushioned palm rest makes work easier and fun more fun\nLonger battery time: This feature gives you up to three years of battery life. (Battery life based on a calculation of an estimated 2 million keystrokes per year in an office environment. User experience may vary.)\nLogitech Unifying receiver: The tiny Unifying receiver stays in your notebook, so there\'s no need to unplug it when you move around. And you can easily add compatible wireless mice and keyboards to the same wireless receiver', 'Connections Wireless\nBrand Logitech\nNumber of Buttons 120\nKeyboard Description QWERTY', '36.99', '37.73', 'en', 210),
(208, 'Apple 85W MagSafe 2 Power Adapter (for MacBook Pro with Retina display)', 'Compatible Devices Laptops\nBrand Apple\nColor White\nPower Source Corded Electric\nItem Weight 1.1 PoundsThe Apple 85W MagSafe 2 Power Adapter is made specifically for your MacBook Pro with Retina display.\nIt’s held in place magnetically, so if someone should trip over it, the cord disconnects harmlessly and your notebook stays put safely.\nUse an extra adapter for home or work.', 'Compatible Devices Laptops\nBrand Apple\nColor White\nPower Source Corded Electric\nItem Weight 1.1 Pounds', '59.99', '61.19', 'en', 211),
(209, 'Apple Magic Keyboard (Wireless, Rechargable) (US English) - Silver', 'Connections Wireless\nBrand Apple\nKeyboard Description QWERTYMagic Keyboard combines a sleek design with a built-in rechargeable battery and enhanced key features.\nWith a stable scissor mechanism beneath each key, as well as optimized key travel and a low profile, Magic Keyboard provides a remarkably comfortable and precise typing experience.\nIt pairs automatically with your Mac, so you can get to work right away.', 'Connections Wireless\nBrand Apple\nKeyboard Description QWERTY', '94.0', '95.88', 'en', 212),
(210, 'Sonos One (Gen 2) - Voice Controlled Smart Speaker With Amazon Alexa Built-In - White', 'Brand Sonos\nConnections Bluetooth\nModel Name Sonos One (Gen 2)\nColor White\nItem Weight 4.08 PoundsSonos One - The powerful smart speaker with voice control built in\nBrilliant sound - Get rich, room-filling sound with Sonos One, and control it with your voice, the Sonos app, Apple AirPlay2, and more.\nVoice control - Amazon Alexa is built right in so you can play music, check news, set alarms, get your questions answered, and more, completely hands free.\nFor every room - The compact design fits just about any space. Put it on your kitchen countertop or tuck it away on your office bookshelf. It\'s humidity resistant so you can even put it in the bathroom.\nStereo sound with two - Pair two Sonos Ones together in the same room for stereo separation and more detailed sound. Use a pair as rear home theater surrounds with Playbar, Playbase, or Beam.\nBuild your system - Connect wirelessly to other Sonos speakers to enjoy brilliant sound in any or every room.', 'Brand Sonos\nConnections Bluetooth\nModel Name Sonos One (Gen 2)\nColor White\nItem Weight 4.08 Pounds', '146.28', '149.21', 'en', 213),
(211, 'Apple 12W USB Power Adapter', 'Compatible Devices Smartphones, Headphones, IPad, Laptops, IPhone\nBrand Apple\nColor White\nPower Source Corded Electric\nInput Voltage 15 VoltsUse this USB-based power adapter to charge your iPhone, iPad, or iPod with Lightning connector at home, on the road, or whenever it\'s not connected to a computer.\nYou can connect the adapter directly to your device via the Lightning connector.\nFeaturing a compact design, this power adapter offers fast, efficient charging.\nCharging cable sold separately.', 'Compatible Devices Smartphones, Headphones, IPad, Laptops, IPhone\nBrand Apple\nColor White\nPower Source Corded Electric\nInput Voltage 15 Volts', '19.0', '19.38', 'en', 214),
(212, 'DualShock 4 Back Button Attachment - PlayStation 4', 'Two rear-buttons map-able to any digital button of the controller a dedicated button for remapping back Buttons\nAn digital screen that shows the currently assigned Buttons ability to save and choose from different pre-sets\nHeadset pass-through for connecting any 3.5 mm wired headset to the Controller (headset not included)', '', '29.99', '30.59', 'en', 215),
(213, 'Bose SoundLink Micro, Portable Outdoor Speaker, (Wireless Bluetooth Connectivity), Black', 'Model Name SoundLink Micro\nBrand Bose\nSpeaker Type Outdoor\nSpeakers Maximum Output Power 5 Watts\nItem Weight 0.64 PoundsCrisp, balanced sound and unmatched bass for a bluetooth speaker its size, plays loud and clear outdoors for beach days or camping trips\nBuilt-in mic for speakerphone to take clear conference or personal calls out loud with a wireless range of approximately 30 feet.\nWaterproof speaker from the inside out (Ipx7 rating), with soft, rugged exterior, resists dents, cracks and scratches\nEasily portable with a tear resistant strap to bring it wherever you go, strap to your backpack, cooler or handlebars\nUp to 6 Hours of play time from a rechargeable battery and wireless Bluetooth pairing.\nWireless Bluetooth pairing with voice prompts allows you to easily take calls and access your phone’s virtual assistant — hands free\nPair two SoundLink speakers together for party mode or stereo mode or use Bose SimpleSync technology to pair with a member of the Bose Smart Home Family to play in sync', 'Model Name SoundLink Micro\nBrand Bose\nSpeaker Type Outdoor\nSpeakers Maximum Output Power 5 Watts\nItem Weight 0.64 Pounds', '99.0', '100.98', 'en', 216),
(214, 'Kasa Smart KL110 Light Bulb, LED Smart Wi-Fi Alexa Bulbs works with Alexa and Google Home, A19 Dimmable, 2.4Ghz, No Hub Required, 800LM Soft White (2700K), 10W (60W Equivalent)', 'Brand Kasa Smart\nLight Source Wattage 10 Watts\nItem Dimensions LxWxH 2.36 x 2.36 x 4.65 inches\nVoltage 120 Volts\nBulb base E27Dimmable Kasa Smart’s dimmable light bulb has a dimming range from 1 percent to 100 percent; Set the right brightness for any mood or activity; Turn your bulb to full brightness to get your Kids up in the morning or dim it enough for them to fall asleep at night\nNo hub required: The Kasa smart Wi-Fi light bulb, dimmable connects to your home’s secure Wi-Fi network; No need for a hub or extra equipment; All you need is your smartphone, the Kasa Smart app and a Wi-Fi connection to start controlling your bulb from anywhere\nControl from anywhere: Control your smart light bulb from anywhere with your smartphone using the Kasa smart app (iOS, Android); Smoothly dim the brightness of your light bulb from anywhere with the app\nVoice control: Use simple voice commands to control your Kasa smart dimmable light bulb with any Amazon Alexa, Google Assistant or Microsoft Cortana; Just tell your voice assistant to dim your lights and set the perfect mood for movie night\nNote: Requires a secured 2.4 gigahertz Wi-Fi network connection. Typical Lumen output - 800lm\n› See more product details', 'Brand Kasa Smart\nLight Source Wattage 10 Watts\nItem Dimensions LxWxH 2.36 x 2.36 x 4.65 inches\nVoltage 120 Volts\nBulb base E27', '11.99', '12.23', 'en', 217),
(215, 'SanDisk 16GB Cruzer Glide USB 2.0 Flash Drive - SDCZ60-016G-B35', 'Memory Storage Capacity 16 GB\nBrand SanDisk\nHardware Interface USB 2.0Reliable storage for photos, videos, music and other files\nAvailable in capacities from 8GB to 256GB (1GB = 1,000,000,000 bytes - Actual user storage less)\nTransfer with confidence when moving images and other content\nRetractable design keeps the connector safe\nSanDisk SecureAcces software with 128-bit AES encryption and password protection(1)\nBacked by a 2-year limited manufacturer warranty(2)', 'Memory Storage Capacity 16 GB\nBrand SanDisk\nHardware Interface USB 2.0', '5.49', '5.6', 'en', 218),
