(217, 'Fitbit Versa 3 Health & Fitness Smartwatch with GPS, 24/7 Heart Rate, Alexa Built-in, 6+ Days Battery, Pink/Gold, One Size (S & L Bands Included)', 'Supported Application Weather, Sleep Monitor, Reminders, Voice Assistant, Alexa, Phone, GPS, Heart Rate Monitor\nBrand Fitbit\nSize 1 Count (Pack of 1)\nSupports Bluetooth Bluetooth\nColor Pink/GoldRun, bike, hike and more phone-free—and see your real-time pace & distance—with built-in GPS. Then check out your workout intensity map in the Fitbit app\nActive Zone Minutes uses your resting heart rate to gauge exercise effort and gives you a buzz when you step up the intensity so you can make the most of your workouts\nBetter track heart rate 24/7 with PurePulse 2.0, Fitbit’s enhanced heart rate technology\nUse your voice with Amazon Alexa Built-in to check the weather, set reminders, control smart home appliances and more from your watch (Voice assistant availability and features may vary)\nFree 90-day Fitbit Premium trial for new Premium users with personalized guidance, insights and motivation to help you reach your goals (Valid payment method required. Cancel before free trial ends to avoid subscription fees. New Premium users only. Content and features may vary by language and are subject to change.)\nGet 6+ days of battery on a full charge plus one day of battery in just 12 minutes with fast charging (Battery life varies with use and other factors; up to 12 hours with continuous GPS)\nTrack your time in light, deep and REM sleep, then receive your Sleep Score to better understand your sleep quality each night\nStore and play music & podcasts on Deezer or Pandora, plus control Spotify—all from your wrist. Subscriptions required for use of music services; not available in all countries', 'Supported Application Weather, Sleep Monitor, Reminders, Voice Assistant, Alexa, Phone, GPS, Heart Rate Monitor\nBrand Fitbit\nSize 1 Count (Pack of 1)\nSupports Bluetooth Bluetooth\nColor Pink/Gold', '199.95', '203.95', 'en', 220),
(218, 'Apple 18W USB-C Power Adapter', 'Compatible Devices Tablets\nBrand Apple\nPower Source USB\nItem Weight 0.2 Pounds\nInput Voltage 15 VoltsThe Apple 18W USB‑C power adapter offers fast, efficient charging at home, in the office, or on the go\nWhile the power adapter is compatible with any Usb‑c-enabled device, Apple recommends pairing it with the 11-inch iPad Pro and 12. 9-Inch iPad Pro (3rd Generation) for optimal charging Performance\nCharging cable sold separately', 'Compatible Devices Tablets\nBrand Apple\nPower Source USB\nItem Weight 0.2 Pounds\nInput Voltage 15 Volts', '34.75', '35.45', 'en', 221),
(219, 'Apple TV Siri Remote', 'Brand Apple\nCompatible Devices Streaming Players\nConnections Bluetooth, Wi-Fi, Infrared\nBattery Description Nickel-Metal Hydride\nBatteries 1 Lithium ion batteries required. (included)The Siri Remote puts you in complete control of your Apple TV 4K and Apple TV (4th generation)\nUse Siri to find what you want to watch with just your voice\nThe Touch surface lets you interact with your Apple TV quickly and easily\nOperating altitude: tested up to 10, 000 feet (3000 M)\nWireless: Bluetooth 4.0 wireless technology', 'Brand Apple\nCompatible Devices Streaming Players\nConnections Bluetooth, Wi-Fi, Infrared\nBattery Description Nickel-Metal Hydride\nBatteries 1 Lithium ion batteries required. (included)', '52.99', '54.05', 'en', 222),
