(221, 'HP ENVY Pro 6455 Wireless All-in-One Printer, Mobile Print, Scan & Copy, Auto Document Feeder, Works with Alexa (5SE45A)', 'Printer Output Type Color\nColor White/Grey\nPrinting Technology Inkjet\nBrand HP\nPrinting Media Type Paper (plain), Glossy photo paperSimple multitasking for home: Print, scan, and copy versatility, automatic two-sided printing, borderless photos, a hands-free 35-page automatic document feeder, and mobile fax with a printer made with 20% recycled plastic\nInk delivered to your home: get your first 2 months free when you enroll in HP Instant Ink (optional) during printer set up; plans starting at $0.99 per month after the trial period, shipping and recycling included\nMobile setup with required HP Smart app: Fast and easy printer setup that guides you, step by step; simply download the HP Smart app, connect to Wi-Fi, and share the inkjet printer across all your devices\nBetter-than-ever connectivity: Ensure your family stays connected with self-healing Wi-Fi\nPrint and scan from virtually anywhere: With the HP Smart app, everyone in the family can print, scan, and copy with their smartphone, and share documents to third-party software like Dropbox and Google Drive\nSend mobile faxes with the HP Smart app: This wireless printer lets you fax on-the-go, right from your smartphone, tablet, or PC for 24 months using the HP Smart app\nAutomatic document feeder:This all-in-one printer\'s 35-page automatic document feeder helps you breeze through scan and copy jobs quickly', 'Printer Output Type Color\nColor White/Grey\nPrinting Technology Inkjet\nBrand HP\nPrinting Media Type Paper (plain), Glossy photo paper', '149.99', '152.99', 'en', 224),
(222, 'GoPro Hero8 Black Official Holiday Bundle - Includes Hero8 Black Camera Plus Shorty, Head Strap, 32GB SD Card, and 2 Rechargeable Batteries', 'Model Name HERO8 Black\nBrand GoPro\nVideo Capture Resolution 2160p\nLens Fisheye\nDisplay Size 1.95 InchesStreamlined design: The reimagined shape is more pocketable, and folding fingers at the base let you swap mounts quickly. A new side door makes changing batteries even faster, and the lens is now 2x more impact resistant.\nHyperSmooth 2. 0: Smooth just got smoother. Now Hero8 Black has three levels of stabilization—On, High and Boost—so you can pick the best option for whatever you do. Get the widest views possible, or boost it up to the smoothest video ever offered in a Hero camera. Plus, HyperSmooth 2. 0 works with all resolutions and frame rates, and features in-app horizon leveling.\nTimeWarp 2.0: Capture super stabilized time lapse videos while you move through an activity. And now, TimeWarp 2.0 automatically adjusts speed based on motion, scene detection and lighting. You can even slow down the effect to real time—savoring interesting moments—and then tap to speed it back up.\nLiveBurst: Record the moments 1.5 seconds before and after your shot, so you can choose the best single frame for the perfect photo—or an awesome shareable video.\nWhat\'s in the bundle: GoPro HERO8 camera, Shorty, head strap, 32GB SD card, and 2 rechargeable batteries.\nVideo Capture Resolution: 4K UHD 2160P\nLens type: Fisheye', 'Model Name HERO8 Black\nBrand GoPro\nVideo Capture Resolution 2160p\nLens Fisheye\nDisplay Size 1.95 Inches', '299.0', '304.98', 'en', 225),
(223, 'Western Digital 1TB WD Blue PC Hard Drive - 7200 RPM Class, SATA 6 Gb/s, , 64 MB Cache, 3.5\" - WD10EZEX', 'Compatible Devices Windows 7, Windows 8, Mac OS\nBrand Western Digital\nDigital Storage Capacity 1 TB\nHardware Interface SATA 6.0 Gb/s\nType of product 3.5-InchReliable everyday computing\nWD quality and reliability\nFree Acronis True Image WD Edition cloning software\nMassive capacities up to 6 TB available\n2-year manufacturer\'s limited warranty', 'Compatible Devices Windows 7, Windows 8, Mac OS\nBrand Western Digital\nDigital Storage Capacity 1 TB\nHardware Interface SATA 6.0 Gb/s\nType of product 3.5-Inch', '39.99', '40.79', 'en', 226),
(224, 'Emerson Sensi Wi-Fi Smart Thermostat for Smart Home, DIY, Works With Alexa, Energy Star Certified, ST55', 'Brand Sensi\nItem Dimensions LxWxH 3.75 x 5.88 x 1 inches\nItem Weight 0.85 Pounds\nPower Source Corded Electric\nConnectivity Protocol Wi-FiEDITORS CHOICE BEST VALUE SMART THERMOSTAT by USA Today’s Reviewed.com\nSAVE ABOUT 23% ON HVAC ENERGY*: The ENERGY STAR certified Sensi thermostat helps you save on your HVAC energy costs, with features like geofencing, 7-day flexible scheduling, remote access and in-app system usage.\nMOST INSTALL IN 30 MINUTES OR LESS**: Use the built-in level and step-by-step app instructions for a quick installation. Skip any extra work painting or patching the wall thanks to the standard thermostat size.\nEXTENSIVE COMPATIBILITY***: Works with the HVAC equipment found in most homes - a c-wire is required for heat-only, cool-only and heat pump systems. Check system and router compatibility at sensi.emerson.com/compatibility\nSMART HOME COMPATIBLE: Works with Amazon Alexa, Google Assistant, Apple HomeKit (c-wire required), and Samsung SmartThings smart home platforms.\nUSAGE REPORTS: Monitor current day and historical heating, cooling and fan runtimes right in the app.\nGET REBATES: Find utility rebates in your area through the rebate finder at sensi.emerson.com/rebates.', 'Brand Sensi\nItem Dimensions LxWxH 3.75 x 5.88 x 1 inches\nItem Weight 0.85 Pounds\nPower Source Corded Electric\nConnectivity Protocol Wi-Fi', '79.0', '80.58', 'en', 227);
