(225, 'Apple Thunderbolt 3 (USB-C) to Thunderbolt 2 Adapter', 'connector-type USB Type C\nBrand Apple\nNumber of Ports 1The Thunderbolt 3 (USB-C) to Thunderbolt 2 Adapter lets you connect Thunderbolt and Thunderbolt 2 devices — external hard drives and Thunderbolt displays, for example — to any of the Thunderbolt 3 (USB-C) ports on your MacBook Pro.\nAs a bidirectional adapter, it can also connect new Thunderbolt 3 devices to a Mac with a Thunderbolt or Thunderbolt 2 port.\nRequires macOS Sierra.\nCompatibility- 13-inch MacBook Air with Retina display, 13-inch MacBook Pro - Thunderbolt 3 (USB-C), 15-inch MacBook Pro - Thunderbolt 3 (USB-C), 21.5-inch iMac - Thunderbolt 3 (USB-C), 27-inch iMac - Thunderbolt 3 (USB-C), iMac Pro, Mac mini - Thunderbolt 3 (USB-C)', 'connector-type USB Type C\nBrand Apple\nNumber of Ports 1', '44.99', '45.89', 'en', 228),
(226, 'Apple Magic Keyboard with Numeric Keypad (Wireless, Rechargable) (US English) - Silver', 'Connections Wireless\nBrand Apple\nKeyboard Description QWERTYMagic Keyboard with Numeric Keypad features an extended layout, with document navigation controls for quick scrolling and full size arrow keys for gaming\nA scissor mechanism beneath each key allows for increased stability, while optimized key travel and a low profile provide a comfortable and precise typing experience.\nThe numeric keypad is also great for spreadsheets and finance applications.', 'Connections Wireless\nBrand Apple\nKeyboard Description QWERTY', '119.0', '121.38', 'en', 229),
