(228, 'Apple Magic Keyboard for iPad Pro 12.9-inch (4th Generation) - US English', 'Connections USB-C\nBrand Apple\nKeyboard Description QWERTYThe all-new Magic Keyboard is an amazing companion for iPad Pro.\nIt features the best typing experience ever on iPad, a trackpad that opens up new ways to work with iPadOS, a USB-C port for charging, backlit keys, and front and back protection.\nWith a new floating cantilever design, iPad Pro attaches magnetically and allows you to smoothly adjust to the perfect viewing angle for you.\nCompatibility: iPad Pro 12.9-inch (3rd and 4th generation)', 'Connections USB-C\nBrand Apple\nKeyboard Description QWERTY', '329.0', '335.58', 'en', 231),
