(233, 'StarTech.com SATA to USB Cable - USB 3.0 to 2.5” SATA III Hard Drive Adapter - External Converter for SSD/HDD Data Transfer (USB3S2SAT3CB)', 'connector-type Usb 3.0\nCable Type USB\nCompatible Devices Laptop, Computer, Mac\nColor Black\nBrand StarTechQuickly access a SATA SSD OR HDD: Add drive space to your laptop by connecting to a SATA 2.5\" SATA SSD or HDD using this SATA to USB cable--you can connect to an external drive to add storage, perform backups, create disk images, implement data recoveries, and transfer content to your laptop\nFast transfer speeds with UASP: The SATA to USB adapter supports USB 3.0 data transfer speeds of 5Gbps, plus you can experience transfer speeds up to 70% faster than conventional USB 3.0 when connected to a computer that also supports UASP\nConnect from anywhere: The hard drive, USB adapter is a portable solution that tucks away nicely in a laptop bag with no external power required\nSave time: The hard drive transfer cable lets you easily swap between drives with no need to install the drive inside an enclosure--just plug and play\nReliability guaranteed: StarTech.com offers a competitive 2-year warranty plus lifetime support on this SATA to USB converter. Max power of the attached drive is 900 mA', 'connector-type Usb 3.0\nCable Type USB\nCompatible Devices Laptop, Computer, Mac\nColor Black\nBrand StarTech', '12.8', '13.06', 'en', 236),
(234, 'Call of Duty: Black Ops Cold War', 'As Elite operatives, you will Follow the trail of a shadowy Figure named perseus who is on a mission to destabilize the global balance of power and change the course of history.\nDescend into the dark center of this global conspiracy alongside iconic characters woods, Mason and hudson and a new cast of operatives attempting to stop a plot decades in the making.\nBeyond the campaign, players will bring a cold war arsenal of weapons and equipment into the next generation of multiplayer and Zombies experiences.\nIncludes PS5 version on disc. Not playable on PS4 system or disc less PS5 system.', '', '59.93', '61.13', 'en', 237),
