(260, 'Crucial P2 500GB 3D NAND NVMe PCIe M.2 SSD Up to 2400MB/s - CT500P2SSD8', 'Brand Crucial\nDigital Storage Capacity 500 GB\nHardware Interface SATA 6.0 Gb/s\nWrite Speed 2300 Megabytes Per Second\nRead Speed 2400 Megabytes Per SecondCapacity: Up to 2TB with sequential reads/writes up to 2400MB/s/1900MB/s\nNVMe PCIe interface, marking the next step in storage innovation\nIncludes SSD management software for performance optimization, data security, and firmware updates\n5-year limited warranty', 'Brand Crucial\nDigital Storage Capacity 500 GB\nHardware Interface SATA 6.0 Gb/s\nWrite Speed 2300 Megabytes Per Second\nRead Speed 2400 Megabytes Per Second', '50.99', '52.01', 'en', 263),
(261, 'Bose TV Speaker- Small Soundbar with Bluetooth and HDMI-ARC connectivity, Black. Includes Remote Control', 'Model Name TV Speaker\nBrand Bose\nSpeaker Type Soundbar\nMounting Type Wall Mount\nItem Weight 3000 GramsHear your TV better — Designed with simplicity in mind, the Bose TV Speaker is a small soundbar that clarifies speech and is a simple fix for better TV sound.\nWide, natural sound — Two angled full-range drivers deliver a more realistic, spatial audio experience for overall better TV sound from a small soundbar.\nEnhanced dialogue — This TV speaker is designed to specifically focus on clarifying and elevating vocals and pronunciation.\nBluetooth TV speaker — Pair your device to this Bluetooth soundbar to wirelessly stream your favorite music and podcasts.\nSimple setup — A single connection from this compact soundbar to the TV via an optical audio cable (included) or an HDMI cable (sold separately) has you up and running in minutes.\nCompact soundbar — This small soundbar is just over 2\" tall for easy placement in front of your TV or mounted to a wall (wall brackets sold separately). Overall TV speaker dimensions are 2.21\" H x 23.38\" W x 4.02\" D.\nRemote control — Compact TV speaker comes with remote control that enables dialogue mode to further enhance speech or add a bass boost for more depth.\nBuild and expand — The Bose TV Speaker is compatible with the Bose Bass Module 500 or 700 and requires the Bose Bass Module Connection Cable or a standard 3.5 millimeter audio cable, sold separately.\n› See more product details', 'Model Name TV Speaker\nBrand Bose\nSpeaker Type Soundbar\nMounting Type Wall Mount\nItem Weight 3000 Grams', '249.0', '253.98', 'en', 264),
(262, 'Bose SoundLink Around Ear Wireless Headphones II - Black', 'Brand Bose\nConnections Wireless\nModel Name SOUNDLINK AE WIRELESS HP II B\nColor Black\nHeadphones Form Factor Over EarDeep, immersive sound, improved EQ best in class performance for wireless headphones. Connectivity technology: Wired/Wireless\nLatest Bluetooth technology for easy connectivity and seamless audio/video syncs\nAdvanced microphone system, HD voice for clear calls in windy or noisy environments\nUp to 15 hours play time with rechargeable lithium ion battery\nSwitch between two Bluetooth devices so you can watch a video while staying connected to your smartphone. Wireless range up to 30 feet (9 meter)', 'Brand Bose\nConnections Wireless\nModel Name SOUNDLINK AE WIRELESS HP II B\nColor Black\nHeadphones Form Factor Over Ear', '229.0', '233.58', 'en', 265),
(263, 'Bounty Hunter Gold Digger Metal Detector', 'Brand Bounty Hunter\nColor Gold\nBatteries Required? Yes\nPower Source Battery Powered\nItem Weight 3 PoundsThe Gold Digger can be used anywhere to search for all kinds of valuable metal from gold coins to iron relics\nMotion all-metal mode and trash elimination control help you find only the treasure you want\nIdentifies coin-size objects up to 6 inches deep underground, and senses larger items up to 2 feet deep\nIncludes headphones for private searches in crowded places\nCertified Frustration-Free Packaging\nSearch the backyard, beach, or park for all kinds of valuable metal from iron relics to gold coins\nMotion all-metal mode and trash elimination control help you find only the treasure you want', 'Brand Bounty Hunter\nColor Gold\nBatteries Required? Yes\nPower Source Battery Powered\nItem Weight 3 Pounds', '55.04', '56.14', 'en', 266),
(264, 'Dell Wired Keyboard - Black KB216 (580-ADMT)', 'Connections Wired\nBrand Dell\nKeyboard Description GamingThe Dell Wired Keyboard provides a convenient keyboard solution for everyday home or office computing uses.\nDevice Type: Keyboard. Keys Style: Chiclet. Color: Black. Interface: USB.\nDimensions (WxDxH): 17.4 x 5 x 1 inches. Weight: 17.74 oz.\nDesigned For: Alienware 13 R2, 15 R2, 17 R3; Inspiron 3252, 3459; Latitude 31XX, 33XX, 34XX, 35XX, E5270, E5450, E5470, E5550, E5570, E6540, E7250, E7450\nDesigned For: OptiPlex 30XX, 3240, 50XX, 70XX, 7440, 90XX; Precision Mobile Workstation 5510, 7710; Precision Tower 3420, 3620; Vostro 14 5480, 3250, 39XX; XPS 8700, 8900', 'Connections Wired\nBrand Dell\nKeyboard Description Gaming', '15.99', '16.31', 'en', 267),
(265, 'GoPro HERO9 Black - Waterproof Action Camera with Front LCD and Touch Rear Screens, 5K Ultra HD Video, 20MP Photos, 1080p Live Streaming, Webcam, Stabilization', 'Model Name HERO9 Black\nBrand GoPro\nVideo Capture Resolution 5K UHD 2880p\nLens Fisheye\nDisplay Size 2.27 Inches5K Video - Shoot stunning video with up to 5K resolution, perfect for maintaining detail even when zooming in\n20MP Photo with SuperPhoto - Capture crisp, pro-quality photos with 20MP clarity. And with SuperPhoto, HERO 9 Black can automatically pick all the best image processing for you\nFront Display + Rear Touch Screen - A new, larger rear touch screen with touch zoom on HERO9 Black and a dazzling new front display makes for easy framing and intuitive camera control\nLive Streaming + Webcam - Live stream in 1080p on social, get HyperSmooth stabilization as you broadcast\nHyperSmooth 3.0 - Experience ultimate smoothness with our most advanced video stabilization ever.\nTimeWarp 3.0 - Record mesmerizing time lapse scenes as you move on the road, on foot or anywhere else\nRugged + Waterproof - Shoot in the gnarliest conditions imaginable. HERO9 Black can take it. It’s tough as nails, and waterproof down to 33ft right out of the box', 'Model Name HERO9 Black\nBrand GoPro\nVideo Capture Resolution 5K UHD 2880p\nLens Fisheye\nDisplay Size 2.27 Inches', '399.0', '406.98', 'en', 268),
(266, 'Crucial MX500 500GB 3D NAND SATA 2.5 Inch Internal SSD, up to 560MB/s - CT500MX500SSD1', 'Compatible Devices This drive is compatible with desktops and laptops that accept 2.5\" 7mm SATA drives\nBrand Crucial\nDigital Storage Capacity 500 GB\nHardware Interface SATA 6.0 Gb/s\nType of product 2.5 InchesMake sure this fits by entering your model number.\nSequential reads/writes up to 560/510 MB/s and random reads/writes up to 95k/90k on all file types\nAccelerated by micron 3D NAND technology\nIntegrated power loss Immunity preserves all your saved work if the power unexpectedly gets cut\nAES 256 bit hardware based encryption keeps data safe and secure from hackers and thieves\nCrucial 5 year limited warranty', 'Compatible Devices This drive is compatible with desktops and laptops that accept 2.5\" 7mm SATA drives\nBrand Crucial\nDigital Storage Capacity 500 GB\nHardware Interface SATA 6.0 Gb/s\nType of product 2.5 Inches', '53.99', '55.07', 'en', 269),
(267, 'SteelSeries Arctis Pro Wireless Gaming Headset - Lossless High Fidelity Wireless + Bluetooth for PS5/PS4 and PC - Black', 'Brand SteelSeries\nConnections Wireless\nSeries SteelSeries\nColor Black\nHeadphones Form Factor On EarDual-Wireless technology provides rock solid, 2.4G wireless lossless audio for gaming, combined with Bluetooth connectivity for mobile devices\nPremium Hi-Res speakers with high-density neodymium magnets reproduce a full, expansive frequency range from 10 – 40,000 Hz with stunning realism and clarity\nLuxurious lightweight steel and aluminum alloy construction offers maximum durability and a consistent fit\nTwo included swappable batteries allow you to charge a battery in the base station, while using the other for more than 20 hours of gaming\nWidely recognized as the best mic in gaming, the ClearCast microphone delivers studio-quality voice clarity and background noise cancellation\nOptional firmware update from SteelSeries Engine will add PS5 input mode.', 'Brand SteelSeries\nConnections Wireless\nSeries SteelSeries\nColor Black\nHeadphones Form Factor On Ear', '329.99', '336.59', 'en', 270),
(268, 'NBA 2K21 Mamba Forever Edition - PlayStation 4', 'Order the NBA 2K21 Mamba Forever Edition for PlayStation 4 and you will also receive NBA 2K21 and 100,000 Virtual Currency for PlayStation 5 upon release.\nPhysical copies of NBA 2K21 Mamba Forever Edition for PlayStation 4 will include a digital copy of NBA 2K21 Standard Edition for PlayStation 5 in box.\nThis edition includes 100,000 Virtual Currency, 10,000 MyTEAM points, MyTEAM packs, digital items for your MyPLAYER, and more\nNote: There will be two inserts in PS4 Mamba edition physical product. One code is for the Mamba edition content (VC, MyTeam packs, etc.), this slip is titled Damian Liliard & Zion Williams Digital Collection. The second code is for the NG game code and VC, this slip is titled PS4 Digital Items 2K21 for PS5. Both codes can be redeemed through the normal console process\nFirst party codes are provided and redeemed through their storefronts. PlayStation codes are 12 digits', '', '82.26', '83.91', 'en', 271),
(269, 'Belkin 8-Outlet Power Strip Surge Protector, Flat Plug, 6ft Cord - 3,550 Joules', 'Brand Belkin\nColor Gray\nVoltage 125 Volts\nItem Weight 1.75 Pounds\nItem Dimensions LxWxH 14.5 x 6.15 x 2.25 inches8 outlet surge protector power strip with 6 feet/1.8 meter cord\nFlat AC plug fits easily in tight spaces\nSafeguards computers, appliances, home theater and office equipment from potentially damaging power surges\nSpecs: 3550 joule energy rating 6,000v maximum spike voltage AC 15A, 125V, 1875W\nSafe usage: Correct operation is important - see product description section below for useful safety information', 'Brand Belkin\nColor Gray\nVoltage 125 Volts\nItem Weight 1.75 Pounds\nItem Dimensions LxWxH 14.5 x 6.15 x 2.25 inches', '16.67', '17.0', 'en', 272),
(270, 'DeoxIT 5% Spray Contact Cleaner, 5 oz.', 'Cleans, protects, lubricates, and improves conductivity\nReduces intermittent connections, arcing, and RFI as well as wear and abrasion\nSafe for use on all metal connectors and contacts and will not harm plastics\nDispensing Type: Spray\nVolume: 5 oz', '', '14.95', '15.25', 'en', 273),
(271, 'Lexar Professional 633x 32GB SDHC UHS-I Card, 2-Pack (LSD32GCB1NL6332)', 'Brand Lexar\nMemory Type SDHC\nColor Red\nHardware Interface SDHC\nSpeed Class Class 10High-speed, Class 10 performance—leverages UHS-I (U1 or U3 depending on capacity) technology for a read transfer speed up to 95MB/s (633x).\nCapture high quality images of stunning 1080p full-HD, 3D, and 4K video\nEnjoy shooting longer without changing cards—large capacity options up to 1TB\nHigh-speed file transfer from card to computer to dramatically accelerate workflow\nLimited lifetime product support', 'Brand Lexar\nMemory Type SDHC\nColor Red\nHardware Interface SDHC\nSpeed Class Class 10', '12.99', '13.25', 'en', 274),
(272, 'APC UPS, 1500VA UPS Battery Backup & Surge Protector, BX1500M Backup Battery, AVR, Dataline Protection and LCD Display, Back-UPS Pro Uninterruptible Power Supply', '1500VA / 900W Backup Battery power supply\n10 Outlets (NEMA 5-15R): 5 UPS Battery Backup with Surge Protection Outlets, and 5 Surge Protector Only Outlets\nAutomatic Voltage Regulation (AVR) instantly corrects low/high voltage fluctuations, and is Active PFC compatible\n3-5 Year Battery Life. UPS Replacement Battery for BX1500M sold separately (part # APCRBC124)\n1 GB network dataline protection, 6\' Power Cord, right-angle 3-prong wall plug (NEMA 5-15P), and FREE Windows PC power-management software (Mac OS uses native \"Energy Saver\" Settings)\nBacked by APC\'s 3-YEAR WARRANTY, plus a $250,000 connected-equipment policy', '', '164.99', '168.29', 'en', 275),
(273, 'Logitech USB Headset H390 with Noise Cancelling Mic', 'Brand Logitech\nConnections Wired\nModel Name ClearChat\nColor Black, Silver\nHeadphones Form Factor Over EarPadded headband and ear pads. Frequency response (Microphone): 100 hertz - 10 kilohertz\nRotating, noise canceling microphone. Sensitivity (headphone) 94 dBV/Pa +/ 3 dB. Sensitivity (microphone) 17 dBV/Pa +/ 4 dB\nConvenient inline volume and mute controls\nAdvanced digital USB, connections: USB compatible (1.1 and 2.0)\nCompatible with Windows Vista, Windows 7, Windows 8, Windows 10 or later and Mac OS X(10.2.8 or later)\n2 Year Limited warranty', 'Brand Logitech\nConnections Wired\nModel Name ClearChat\nColor Black, Silver\nHeadphones Form Factor Over Ear', '24.99', '25.49', 'en', 276),
(274, 'Apple Magic Trackpad 2 (Wireless, Rechargable) - Silver', 'Connections Bluetooth\nBrand Apple\nNumber of Buttons 1Redesigned and rechargeable, Magic Trackpad 2 includes a built-in battery and brings Force Touch to the desktop for the first time.\nFour force sensors underneath the trackpad surface allow you to click anywhere, and detect subtle differences in the amount of pressure you apply, bringing increased functionality to your fingertips and enabling a deeper connection to your content.\nMagic Trackpad 2 also features an edge-to-edge glass surface area that is nearly 30 per cent larger than the previous trackpad. This design, along with a lower profile, makes scrolling and swiping through your favorite content more productive and comfortable than ever.\nMagic Trackpad 2 pairs automatically with your Mac, so you can get to work right away.\nSystem Requirements- Bluetooth 4.0-enabled Mac computer with OS X v10.11 or later', 'Connections Bluetooth\nBrand Apple\nNumber of Buttons 1', '123.99', '126.47', 'en', 277),
(275, 'Dell USB 3.0 Ultra HD/4K Triple Display Docking Station (D3100), Black', 'Brand Dell\nColor Black\nHardware Interface USB 3.0\nTotal USB Ports 5\nItem Dimensions LxWxH 20.7 x 15 x 11.2 inchesMake sure this fits by entering your model number.\n2 x USB 2.0 to 4 pin USB Type A, 1 x headphone input and output 3.5 millimetre\n3 x superspeed USB 3.0 - 9 pin USB type A, 1 x network - RJ-45. Designed for Inspiron 15 7567 Gaming, 5459; Latitude 13 7350, 3350, E5270, E5460, E5470, E5570, E7270, E7470; XPS 13 (9343)\n1 x display / video: DisplayPort output : 20 pin DisplayPort, super speed cable\n2 x display / video: HDMI: 19 pin HDMI type A, 1x HDMI DVI adapter included\nAllow for a triple monitor setup, see compatible Dell models in the description', 'Brand Dell\nColor Black\nHardware Interface USB 3.0\nTotal USB Ports 5\nItem Dimensions LxWxH 20.7 x 15 x 11.2 inches', '135.28', '137.99', 'en', 278),
(276, 'Canon PG-240 Black Ink Cartridge Compatible to MG2120, MG3120, MG4120, MX392, MG2220, MG3220, MG4220, MG3520, MG3620, MX472, MX532, TS5120', 'Brand Canon\nColor Pigment Black\nCompatibility Options OEM\nPage Yield 180Make sure this fits by entering your model number.\nAlso compatible to MG4120, MG3120 and MG2120\nGenuine Canon Ink Cartridges allow free access to exciting exclusive content via creative park premium\nFINE (Full Photolithography Inkjet Nozzle Engineering) Technology\nGenuine Canon ink is recommended for the best experience with Canon Printers', 'Brand Canon\nColor Pigment Black\nCompatibility Options OEM\nPage Yield 180', '19.48', '19.87', 'en', 279),
(277, 'Maglite Mini PRO LED 2-Cell AA Flashlight with Holster Black - SP2P01H', 'Hardside/Aluminum\nMade in the USA\nThis product adds a great value\nProduct is highly durable and very easy to use\nSuperior Quality Craftsmanship with Weather-Resistant Seals, Aluminum Body, & Diamond Knurled Design\nOffers a powerful projecting beam that adjust from spot to flood with the turn of the head\nRenowned for its quality, durability, and reliability', '', '18.19', '18.55', 'en', 280);
