(278, 'Vortex Optics Binocular Harness Strap', 'Model Name VTHARNESS\nBrand Vortex\nColor Black\nMaterial Lycra, Nylon\nItem Weight 0.3 PoundsHere\'s the most comfortable way to carry your binoculars for hours. This binocular harness strap spreads the weight of your binoculars across your shoulders for more relaxed viewing.\nThis ingenious strap keeps your binoculars and rangefinders, even cameras, from jostling around as you walk—freeing up the use of your hands. Also helps keep your binoculars close to your chest and out of the way.\nNylon/Lycra straps are durable and allow for easy sliding of binoculars into viewing position.\nOne-size-fits-all harness is easy to attach and completely adjustable.', 'Model Name VTHARNESS\nBrand Vortex\nColor Black\nMaterial Lycra, Nylon\nItem Weight 0.3 Pounds', '21.0', '21.42', 'en', 281),
(279, 'Dell 27 LED backlit LCD Monitor SE2719H IPS Full HD 1080p 1920 x 1080 at 60 Hz HDMI VGA,Black', 'Display Size 27 Inches\nBrand Dell\nSeries SE2719h\nResolution FHD 1080p\nHardware Interface VGA, HDMIDevice Type - LED-backlit LCD monitor - 27\", Aspect Ratio -16:9, Contrast Ratio - 1000:1\nPanel Type - IPS, Full HD (1080p) 1920 x 1080 at 60 Hz, Response Time - 8 ms (grey-to-grey normal); 5 ms (grey-to-grey fast)\nInput Connectors - HDMI, VGA\nDoes NOT have VESA Mount', 'Display Size 27 Inches\nBrand Dell\nSeries SE2719h\nResolution FHD 1080p\nHardware Interface VGA, HDMI', '174.99', '178.49', 'en', 282),
(280, 'Elgato Video Capture - Digitize Video for Mac, PC or iPad (USB 2.0)', 'Transfer video from a VCR or other analog video source to your Mac or PC\nPut family memories and family videos on your computer\nEasy-to-use software guides you through every step and turns your analog into digital\nCaptures video in the universal H.264 digital format – ready for iPad, iMovie, Windows Live Movie Maker, and YouTube\nWorld-ready; handles NTSC, SECAM, PAL and PAL/60 video\nComes with Elgato Video Capture, Composite-to-SCART adapter, Composite video/RCA stereo cable\nVideo resolution: 640×480 (4:3) or 640×360 (16:9)', '', '87.99', '89.75', 'en', 283),
(281, 'Fujifilm instax Mini 9 Instant Camera (Smokey White) and instax Film Twin Pack (20 Exposures) Bundle', 'Brand Fujifilm\nFilm Format Type Instant\nModel Name BHBUSWA1116\nItem Dimensions LxWxH 8.2 x 6.2 x 4.8 inches\nItem Weight 1.15 PoundsBUNDLE INCLUDES: Fujifilm instax Mini 9 Instant Camera (Smokey White) and one Mini Film Twin Pack (20 Sheets)\nCOMPACT AND LIGHTWEIGHT DESIGN: Snaps and prints pictures that fit in your wallet. Compact and lightweight design\nMACRO LENS AND SELFIE MIRROR: Macro Lens for close-ups from 35-50cm away, adjustable brightness and selfie mirror\nINSTAX FILM: 2.13 x 3.4-Inch image size can fit in a purse, wallet or mini photo frame\nFUJIFILM AUTHORIZED DEALER: Includes USA Manufacturer Guarantee', 'Brand Fujifilm\nFilm Format Type Instant\nModel Name BHBUSWA1116\nItem Dimensions LxWxH 8.2 x 6.2 x 4.8 inches\nItem Weight 1.15 Pounds', '75.99', '77.51', 'en', 284),
(282, 'Fitbit Sense Advanced Smartwatch with Tools for Heart Health, Stress Management & Skin Temperature Trends, White/Gold, One Size (S & L Bands Included)', 'Supported Application Weather, Sleep Monitor, Reminders, Voice Assistant, Alexa, Phone, GPS, Heart Rate Monitor\nBrand Fitbit\nSize 1 Count (Pack of 1)\nSupports Bluetooth Bluetooth\nColor White/GoldEDA Scan app detects electrodermal activity which may indicate your body\'s response to stress and a built-in skin temperature sensor logs yours each night so you can see when it varies\nFDA review of compatible ECG app pending; Only available in the U.S. upon clearance. Availability outside the U.S. pending applicable regulatory clearances including approval under Directive 93/42/EEC (the Medical Device Directive). The ECG app has not yet received a CE mark and will not be marketed, put into service or otherwise made available in the EU until it has obtained regulatory approval. Not intended for use by people under 22 years old. See fitbit.com/ecg for more details\nAn on-wrist skin temperature sensor tracks yours each night so you can see how it varies\nPersonalized health & fitness guidance with a free 6-month trial of Fitbit Premium for new Premium users (New Premium users only. Must activate with device. Valid payment method required. Free trial must be activated within 60 days of device activation. Cancel before free trial ends to avoid subscription fees)\nHigh & low heart rate notifications alert you if yours seems above or below your average\nBattery lasts 6+ days—plus, fast charging gives you a full day’s charge in just 12 minutes (Varies with use and other factors; up to 12 hours with continuous GPS)\nUse built-in GPS during runs, hikes, rides and more to see pace & distance without your phone\nUse your voice with Amazon Alexa Built-in to check the weather, set reminders, control smart home appliances and more from your watch (Voice assistant availability and features may vary)', 'Supported Application Weather, Sleep Monitor, Reminders, Voice Assistant, Alexa, Phone, GPS, Heart Rate Monitor\nBrand Fitbit\nSize 1 Count (Pack of 1)\nSupports Bluetooth Bluetooth\nColor White/Gold', '279.95', '285.55', 'en', 285),
(283, 'Panasonic K-KJ17MCA4BA Advanced Individual Cell Battery Charger Pack with 4 AA eneloop 2100 Cycle Rechargeable Batteries', 'Batteries 4 AA batteries required. (included)\nBrand Eneloop\nVoltage 1.2 Volts\nBattery Weight 113.39 Grams\nItem Dimensions LxWxH 6 x 7 x 1 inchesRecharge up to 2100 times\nMaintain up to 70% of their charge after 10 years (when not it use)\n2000mAh type, 1900mAh min, Ni-MH pre-charged rechargeable battery\n4 position charger with advanced, individual battery charging, AA and AAA cells\nBattery detection technology - automatically shuts off when charging is complete', 'Batteries 4 AA batteries required. (included)\nBrand Eneloop\nVoltage 1.2 Volts\nBattery Weight 113.39 Grams\nItem Dimensions LxWxH 6 x 7 x 1 inches', '17.99', '18.35', 'en', 286),
(284, 'Belkin WaveRest Gel Mouse Pad, Black (F8E262-BLK)', 'Brand Belkin\nSize 1 Pack\nColor Black\nMaterial RubberErgonomic mouse pad with wrist rest offers added comfort and support\nReduces wrist stress that can lead to repetitive motion disorders\nDurable polyurethane surface provides exceptional tracking\nNonslip rubber base keeps mouse pad firmly in place\nLightweight, durable design endures years of use', 'Brand Belkin\nSize 1 Pack\nColor Black\nMaterial Rubber', '8.0', '8.16', 'en', 287),
(285, 'PGA TOUR 2K21 - PlayStation 4', 'ALL-NEW PGA TOUR CAREER MODE Prove you’ve got what it takes to become FedExCup Champion. Take on PGA TOUR Pros during your very own career, earning rewards and gear along the way\nPGA TOUR PROS AND NEW COURSES Play against Justin Thomas and 11 top pros on stunning, real-life courses including TPC Sawgrass, East Lake Golf Club, and more\nBUILD YOUR MYPLAYER & DREAM COURSE Create and personalize your MyPLAYER with equipment and apparel from brands you love. Design your ultimate course with 1,000s of custom options\nDOMINATE THE GREEN AT ANY SKILL LEVEL Rookies can take advantage of real-time tutorials, tips and shot suggestions. Already a pro? Master your game with Pro Vision, Distance Control, Putt Preview, and other innovations', '', '25.64', '26.15', 'en', 288),
(286, 'Tony Hawk\'s Pro Skater 1 + 2 - PlayStation 4', 'Drop back in with the most iconic skateboarding games ever made.\nPlay Tony Hawk\'s Pro Skater & Tony Hawk\'s Pro Skater 2 in one epic collection, rebuilt from the ground up in incredible HD.\nAll the Pro skaters, levels and tricks are back and fully-remastered, plus more.', '', '42.19', '43.03', 'en', 289),
(287, 'Grand Theft Auto V Premium Edition Playstation 4', 'Rock star\nGames\nRelease', '', '19.93', '20.33', 'en', 290),
(288, 'Canon PGI-250XL Pigment Black Ink Tank Compatible to MG6320 , IP7220 & MG5420, MX922, MG5520, MG6420, MG7120, iX6820, iP8720, MG7520, MG6620, MG5620', 'Brand Canon\nColor Black\nCompatibility Options OEMGenuine Canon ink is recommended for the best experience with Canon\nGenuine Canon Ink tanks allow free access to exciting exclusive content via Creative Park Premium\nCompatible to: MG5520, MG6620, MG7120, MG7520, MG5420, MG5422, MG5520, MG5522, MG5620, MG6320, MG6420, MG6620, MG7120, MG7520, MX722, MX922, iP7220, iP8720, and iX6820', 'Brand Canon\nColor Black\nCompatibility Options OEM', '24.0', '24.48', 'en', 291),
(289, 'Logitech Ergo K860 Wireless Ergonomic Keyboard with Wrist Rest - Split Keyboard Layout for Windows/Mac, Bluetooth or USB Connectivity', 'Connections Bluetooth, USB\nBrand Logitech\nKeyboard Description ErgonomicImproved typing posture: Type more naturally with a curved, split KeyFrame. The sloping keyboard reduces strain on your wrists and forearms.\nPillowed wrist rest: the curved wrist rest offers 54% more wrist support and reduces wrist bending by 25% compared to a standard keyboard without Palm rest.\nPerfect stroke keys: scooped keys match the shape of your fingertips. Type with confidence on a wireless keyboard crafted for comfort, Precision, and fluidity.\nAdjustable Palm lift: seated or standing, keep your wrists in a comfortable, natural posture—with tilt legs of 0°, -4°, and -7°.\nErgonomist Approved: Ergo K860 is certified to improve posture and lower muscle strain.\nFamiliar features: conveniently connect with USB receiver or Bluetooth wireless technology from up to 10 meters*, customize FN key functions, enjoy quiet keys, full-size layout and caps lock indicator.', 'Connections Bluetooth, USB\nBrand Logitech\nKeyboard Description Ergonomic', '119.99', '122.39', 'en', 292),
