(325, 'ChromaCast Folding A-Frame Stand for Acoustic and Electric Guitars with Secure Lock (CC-MINIGS)', 'A-Framed Universal guitar stand with Secure Lock, great for acoustic or electric guitars\nLightweight, durable, metal construction with Rubber feet\nFolds flat in seconds for easy storage and travel\nStepped yoke Securely fits electric and acoustic guitars\nSoft foam arms and rubber back rest to protect your guitar', '', '9.84', '10.04', 'en', 328),
