(327, 'HP Color LaserJet Pro M283fdw Wireless All-in-One Laser Printer, Remote Mobile Print, Scan & Copy, Duplex Printing, Works with Alexa (7KW75A)', 'Printer Output Type Color\nColor White\nPrinting Technology Laser\nBrand HP\nPrinting Media Type Envelopes, Paper (plain)Big multifunction performance with high-quality color: This wireless all-in-one printer features print, copy, scan, and fax versatility, fast print speeds––up to 22 ppm, automatic two-sided printing, and a 50-page automatic document feeder\nPrint remotely with the HP Smart app: Set up your LaserJet printer, manage print jobs, receive notifications, and print and scan on the go with HP Smart––HP\'s best-in-class mobile print app\nSave time with customizable shortcuts: Eliminate steps in repetitive tasks and organize documents 50% faster directly from your mobile device using exclusive office features in the HP Smart app\nStrong security: Help protect your HP office printer and sensitive business data with built-in security essentials that help detect and stop attacks\nWireless connectivity you can count on: Have confidence in your printer\'s connection with steady performance from dual band Wi-Fi\nJetIntelligence value: Count on Original HP Toner cartridges with JetIntelligence to enable professional-quality pages, peak printing performance every time, and protection against counterfeits with innovative anti-fraud technology\nWide range of paper support: This color laser printer works with letter, legal, executive, Oficio, 4x6 in, 5x8 in, A4, A5, A5-R, A6, B5, B6, 16K, Postcard, Double Postcard, Envelopes (No. 10,B5, C5, DL, Monarch)\nOne-year limited hardware warranty: Get one-year commercial hardware warranty, plus 24-hour, 7 days a week Web support', 'Printer Output Type Color\nColor White\nPrinting Technology Laser\nBrand HP\nPrinting Media Type Envelopes, Paper (plain)', '449.0', '457.98', 'en', 330),
