(335, 'Canon PIXMA TR4520 Wireless All in One Photo Printer with Mobile Printing, Black, Works with Alexa', 'Printer Output Type Color\nColor Black\nPrinting Technology Inkjet\nBrand Canon\nPrinting Media Type Glossy photo paperWith wireless connect and the Canon Print app, use your smartphone to quickly and easily set up your printer and print right from your smartphone or tablet\nWith features like AirPrint, Mopria Print Service, auto power On/Off, a built in ADF, and Wi-Fi it\'s easy to see why Pixma printers are so simple to use\nConnectivity technology: USB. Printer technology: Inkjet\nSave 10 percentage on all ink reorders with Dash Replenishment; Upon activation your printer measures ink levels and places smart reorders when you are running low; No subscription fees; Cancel anytime\nWORKS WITH ALEXA: Ask Alexa to print your shopping list, to-do list, crosswords, coloring pages, and more; To set up, say “Alexa, discover my printer;” Alexa can also detect when ink or toner is running low and orders more when you need it. Save 10 percentage on all ink or toner smart reorders; Restrictions may apply', 'Printer Output Type Color\nColor Black\nPrinting Technology Inkjet\nBrand Canon\nPrinting Media Type Glossy photo paper', '89.0', '90.78', 'en', 338),
(336, 'Microsoft FMM-00001 Type Cover for Surface Pro - Black', 'Surface Pro Type cover has a new improved design with slightly spread out keys for a more familiar and efficient typing experience that feels like a traditional laptop\nThe two button trackpad is now larger for precision control and navigation\nThe keyboard is sturdy with enhanced magnetic stability along the fold so you can adjust it to the right angle and work on your lap, on the plane, or at your desk. Since it\'s designed just for Surface\nProtects and shields the screen from Bumps and Scratches\nCompatible with Surface Pro 3, Surface Pro 4 and Surface Pro. Folds back to prevent unwanted typing', '', '89.0', '90.78', 'en', 339),
(337, 'Apple 60W MagSafe 2 Power Adapter (for MacBook Pro with 13-inch Retina display)', 'Compatible Devices Laptops\nBrand Apple\nColor White\nPower Source Corded Electric\nItem Weight 1.2 PoundsUse an extra adapter for home or work.\nThe Apple 60W MagSafe 2 Power Adapter is made specifically for your MacBook Pro with 13-inch Retina display.\nIt’s held in place magnetically, so if someone should trip over it, the cord disconnects harmlessly and your notebook stays put safely.\nPower adapter for Apple MacBook Pro with 13-inch Retina display\nMagnetic connection to computer breaks cleanly when tripped over to prevent accidents\nLED light provides status information\nCompatible with MacBook Pro with 13-inch Retina display', 'Compatible Devices Laptops\nBrand Apple\nColor White\nPower Source Corded Electric\nItem Weight 1.2 Pounds', '53.99', '55.07', 'en', 340),
(338, 'Crucial P5 1TB 3D NAND NVMe Internal SSD, up to 3400MB/s - CT1000P5SSD8', 'Brand Crucial\nDigital Storage Capacity 1 TB\nHardware Interface Solid State Drive\nWrite Speed 3000\nRead Speed 3400 Megabytes Per SecondInnovative 3D NAND and cutting-edge controller technology, with read and write performance up to 3400/3000MB/s, pushing the limits of PCIe Gen 3 NVMe for tech enthusiasts, professional designers, and serious gamers\nCapable of enhancing data security and management with rapid, full-drive encryption, helping protect your data without performance degradation\nOptimize performance and durability with dynamic write acceleration, error correction, and adaptive thermal protection\nOperating systems open almost instantly, apps launch in seconds, and games load before you’re ready to spawn\nBacked by a 5-year limited warranty', 'Brand Crucial\nDigital Storage Capacity 1 TB\nHardware Interface Solid State Drive\nWrite Speed 3000\nRead Speed 3400 Megabytes Per Second', '119.99', '122.39', 'en', 341),
(339, 'Kasa Smart Dimmer Switch by TP-Link, Single Pole, Needs Neutral Wire, WiFi Light Switch for LED Lights, Works with Alexa and Google Assistant, UL Certified, 3-Pack(HS220P3)', 'Brand Kasa Smart\nSwitch Style Rocker Switch\nPump type ON-OFF\nItem Dimensions LxWxH 4.65 x 2.56 x 6.73 inches\nSwitch Type 1-way\nPlug Profile Wall Mount\nActuator Type Push Button\nSee moreEasy Guided Install: Neutral Wire is required, standard wall plate size. No need to understand complex switch wiring or master vs auxiliary switch configurations; The Kasa app guides you through easy step by step installation. Need 2.4GHz Wi-Fi connection.\n0%-100% Dimming with Scheduling: Adjust desired brightness with the button or Kasa app. Tailor your lighting to fade on with a click of the switch or a double click to gently fade off the lights while your child drifts off to sleep. Set light schedules for waking up with a soft glow in the morning.\nVoice Control: Enjoy the hands-free convenience of controlling the lights in your home with your voice via Amazon Alexa or Google Assistant.\nControl from Anywhere: Monitor and control your lights status from anywhere with your smartphone using the Kasa app, whether you are at home, in the office or on vacation.\nTrusted and Reliable: Designed and developed in Silicon Valley, Kasa is trusted by over 4 Million users. UL certified for safety use. 2-year warranty.\n› See more product details', 'Brand Kasa Smart\nSwitch Style Rocker Switch\nPump type ON-OFF\nItem Dimensions LxWxH 4.65 x 2.56 x 6.73 inches\nSwitch Type 1-way\nPlug Profile Wall Mount\nActuator Type Push Button\nSee more', '59.99', '61.19', 'en', 342),
(340, 'Plustek Photo Scanner - ephoto Z300, Scan 4x6 Photo in 2sec, Auto Crop and Deskew with CCD Sensor. Support Mac and PC', 'Memory Card Slot Receipt, Paper, Photo\nScanner Type Receipt, Photo, Document\nBrand Plustek\nConnections USB\nItem Dimensions LxWxH 1.14 x 0.63 x 0.62 inchesThe easiest way to scan photos and documents. Supports 3x5, 4x6, 5x7, and 8x10 in sizes photo scanning but also letter and A4 size paper. Optical Resolution is up to 600 dpi ( PS: two setting: 300dpi/ 600dpi).\nFast and easy, 2 seconds for one 4x6 photo and 5 seconds for one 8x10 size photo@300dpi. You can easily convert about 1000 photos to digitize files in one afternoon and share with your family or friends.\nMore efficient than a flatbed scanner. Just insert the photos one by one and then scan. This makes ePhoto much more efficient than a flatbed scanner.\nPowerful Image Enhancement functions included. Quickly enhance and restore old faded images with a click of the mouse. Advanced editing functions are also available when needed. (restore function need download V2 version)\nePhoto Z300 works with both Mac and PC : Supports Windows 7/8/10 , Mac OS X 10.8.x to 10.15.x . User can download the latest version on Plustek website.', 'Memory Card Slot Receipt, Paper, Photo\nScanner Type Receipt, Photo, Document\nBrand Plustek\nConnections USB\nItem Dimensions LxWxH 1.14 x 0.63 x 0.62 inches', '190.0', '193.8', 'en', 343),
