(393, 'SteelSeries Nimbus+ Bluetooth Mobile Gaming Controller with iPhone Mount, 50+ Hour Battery Life, Apple Licensed, Made for iOS, iPadOS, tvOS', 'Official Apple-licensed Wireless Connectivity – works with all Apple products including iOS, iPads and tvs devices\nBuilt-in Rechargeable Battery – Rechargeable battery allows for 50+ hours of play on a single charge\nPlay Thousands of Games – Compatible with thousands of titles across the App Store and Apple Arcade\nTactile D-Pad Buttons – The arrow buttons have been upgraded with a tactile click for fast and responsive feedback\nClickable Joysticks – Clickable L3/R3 buttons allow for more input options across a variety of games\nSteelSeries cannot guarantee the quality or authenticity of products sold by non-authorized resellers on Amazon, and they are not eligible for warranty. Authorized retailers: Amazon.com, Adorama Inc, Encore Technology, Spacebound\nFor optimizing compatibility with all iOS devices we strongly suggest that you update the controller by downloading SteelSeries Engine from the SteelSeries website', '', '59.99', '61.19', 'en', 396),
(394, 'StarTech.com USB 3.0 to Dual HDMI Adapter - 4K 30Hz - External Video & Graphics Card - Dual Monitor Display Adapter - Supports Windows (USB32HD2), Black', 'connector-type HDMI\nBrand StarTech\nWarranty Type Limited\nNumber of Ports 2THE STARTECH.COM ADVANTAGE: StarTech.com offers a 2-year warranty and free lifetime technical support on this adapter and has been the choice of IT professionals and businesses for over 30 years.\nINCREASED PRODUCTIVITY: The USB 3.0 to Dual HDMI Adapter lets you mirror or extend your display, using multiple apps at the same time by adding two independent HDMI monitors to your laptop using a single USB 3.0 port\nHIGH RESOLUTION SUPPORT: Add astonishing picture quality through the USB 3.0 port of your computer by adding support for video resolutions of up to 4K at 30Hz\nNO POWER SUPPLY NEEDED: Connect the 4K UHD dual monitor adapter directly to your computer without the need for an additional power supply. Memory - 64MB\nWINDOWS ONLY: This USB 3.0 to Dual HDMI Adapter is only compatible with Windows operating systems and does not support MacBook devices. Operating Temperature: 0°C to 40°C (32°F to 104°F)', 'connector-type HDMI\nBrand StarTech\nWarranty Type Limited\nNumber of Ports 2', '66.58', '67.91', 'en', 397),
