(396, 'Motorola Talkabout T402 Rechargeable Two-Way Radios (2-Pack)', 'Brand Motorola Solutions\nColor Yellow\nnumber_of_channels 22\nBatteries 2 AA batteries required. (included)\nItem Dimensions LxWxH 7.54 x 2.26 x 1.37 inches\nItem Weight 0.43 Pounds\nBattery Average Life 26 Hours\nSee moreWith 22 channels and 121 privacy codes, totaling 2,662 combinations, it’s easy to find an available channel\nUp to 35-mile communication range, depending on terrain and conditions\nKeep updated with real-time weather conditions via 11 weather channels with alert feature (including 7 NOAA channels)\nWeatherproof IP54 rated with built-in flashlight gives you peace of mind during evening adventures, unexpected emergencies, or power outages\niVOX/VOX feature permits use of an audio accessory headset for easy hands-free operation', 'Brand Motorola Solutions\nColor Yellow\nnumber_of_channels 22\nBatteries 2 AA batteries required. (included)\nItem Dimensions LxWxH 7.54 x 2.26 x 1.37 inches\nItem Weight 0.43 Pounds\nBattery Average Life 26 Hours\nSee more', '49.99', '50.99', 'en', 399),
(397, 'Wacom DTC133W0A One Digital Drawing Tablet with Screen, 13.3 Inch Graphics Display for Art and Animation Beginners', 'Brand Wacom\nColor Black and white\nItem Weight 2070 GramsSee your imagination come to life in full color on a 13.3” display with a natural surface friction that makes for intuitive drawing on screen. When working from home use the Wacom One as an extended display to efficiently annotate documents or convey ideas to students or colleagues over web-conference\nFeels like a real pen – No need for batteries, the pen feels and looks right. Plus, this one pen uses software to act as multiple pens and brushes in a full range of colors, with superb accuracy\nDigital freedom – Sketch or paint directly on screen, draw diagrams, annotate documents, enhance photos and videos, plus you can delete, edit and share your creations with ease\nIncludes creative software: Purchase and register your Wacom One and receive Bamboo Paper Pro, Clip Studio Paint Pro (3-month license), Adobe Photoshop & Lightroom (2-month license), and Adobe Fresco (6-month license)\nSoftware offerings only available for customers located in the Americas\nWacom One comes with 3-month trials of EdTech software for teachers; Register your display to receive: Kami App, ExplainEverything, Pear Deck, Limnu & Collaboard', 'Brand Wacom\nColor Black and white\nItem Weight 2070 Grams', '399.95', '407.95', 'en', 400),
(398, 'ASUS ROG Strix Z490-E Gaming Z490 (WiFi 6) LGA 1200 (Intel 10th Gen) ATX Gaming Motherboard (14+2 Power Stages, DDR4 4600, Intel 2.5 Gb Ethernet, Bluetooth v5.1, Dual M.2 and Aura Sync)', 'Brand ASUS\nProcessor Socket LGA 1155\nRAM Memory Size DDR4\nChipset Type Intel Z490\nMemory Speed 4600 MHzIntel LGA 1200 socket: Designed to unleash the maximum performance of 10th Gen Intel Core processors\nRobust Power Solution: 14+2 power stages with ProCool II power connector, high-quality alloy chokes and durable capacitors to provide reliable power even when push the CPU performance to the limit\nOptimized Thermal Design: Except comprehensive heatsink, heatpipe and fan headers, features low-noise AI cooling to balance thermals and acoustics by reducing fan speeds and maintaining a 5 Celsius delta\nHigh-performance Gaming Networking: On-board Intel WiFi 6 AX201 (802. 11 ax) and Intel 2. 5 Gb Ethernet with ASUS LANGuard\nBest Gaming Connectivity: Supports HDMI 1. 4 and DisplayPort 1. 4 output, and featuring dual M. 2 , front panel USB 3. 2 Gen 2 Type-C connector\nIndustry-leading Gaming Audio: High fidelity audio with the SupremeFX S1220A codec, DTS Sound Unbound and Sonic Studio III draws you deeper into the game action\nUnmatched Personalization: ASUS-exclusive Aura Sync RGB lighting, including RGB headers and Gen 2 addressable headers', 'Brand ASUS\nProcessor Socket LGA 1155\nRAM Memory Size DDR4\nChipset Type Intel Z490\nMemory Speed 4600 MHz', '285.99', '291.71', 'en', 401),
(399, 'Canon PGI-280 XL Pigment Black Ink, Compatible to TR8520, TR7520, TS9120 Series,TS8120 Series, TS6120 Series, TS9521C, TS9520, TS8220 Series, TS6220 Series', 'Brand Canon\nColor Black\nCompatibility Options OEMMake sure this fits by entering your model number.\nXL pigment black ink is used for printing documents on plain paper and ensures crisp, Sharp text.\nXL ink tanks can help you save money, Print more when you need to, and extend the time between replacing ink tanks.\nGenuine Canon inks provide optimal performance and offer exclusive access to creative park Premium content.', 'Brand Canon\nColor Black\nCompatibility Options OEM', '26.19', '26.71', 'en', 402),
