(401, 'Apple Silicone Case (for iPhone 11) - White', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor White\nCompatible Phone Models IPhoneA soft microfiber lining on the inside helps protect your iPhone.\nOn the outside, the silky, soft-touch finish of the silicone exterior feels great in your hand.\nAnd you can keep it on all the time, even when you’re charging wirelessly.\nJust like every Apple-designed case, it’s put through thousands of hours of testing throughout the design and manufacturing process.\nSo not only does it look great, it’s built to protect your iPhone from scratches and drops.\nCompatibility: iPhone 11', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor White\nCompatible Phone Models IPhone', '21.06', '21.48', 'en', 404),
(402, 'CanonInk Glossy Photo Paper 8.5\" x 11\" 100 Sheets (1433C004),Value not found', 'Brand Canon\nColor Value not found\nItem Weight 1 Pounds\nPaper Finish Glossy\nSheet Size 8.5-x-11-InchThis vibrant, glossy photo paper gives you crisp, clear photos that are High quality without the High cost - an Economical choice for great prints.\nan Economical choice for great prints.\nThis vibrant, glossy photo paper gives you crisp, clear photos', 'Brand Canon\nColor Value not found\nItem Weight 1 Pounds\nPaper Finish Glossy\nSheet Size 8.5-x-11-Inch', '14.99', '15.29', 'en', 405),
(403, 'Brother Compact Monochrome Laser Printer, HLL2395DW, Flatbed Copy & Scan, Wireless Printing, NFC, Cloud-Based Printing & Scanning, Amazon Dash Replenishment Ready - BLACK', 'Printer Output Type Monochrome\nColor BLACK\nPrinting Technology Laser\nBrand Brother\nPrinting Media Type Paper (plain)Engineered for convenience – This new Brother Monochrome Laser Printer is conveniently equipped with a flatbed scan glass for quick copying and scanning. Mobile Device Compatibility AirPrint, Google Cloud Print 2.0, Brother iPrint and Scan, Mopria, Cortado Workplace\nOptimized for efficiency – Engineered with new features, the HL L2395DW laser printer (replacement for the HLL2380DW) and has been optimized for efficiency, allowing you to print up to 36 pages per minute(1)\nFaster, high quality prints: This monochrome laser printer is built with a 250 sheet paper capacity that helps improve efficiency due to less time spent refilling trays. It also handles both letter and legal sized paper. Power Source AC 120V 50/60Hz.Machine Noise (Ready/Printing): 30dB / 50dB\nCloud based print & scan – Print from and scan to popular Cloud services directly from the 2.7\" color touchscreen, including Dropbox, Google Drive, Evernote, OneNote, and more(4)\nWireless printing & exceptional support – This printer’s simple to connect wireless technology allows you to submit print jobs from your laptop, smartphone, desktop, and tablets(2). The \"Touch to connect\" printing with NFC delivers added convenience(3). We provide free online, call, or live chat support for the life of your printer\nAmazon dash replenishment enabled: Upon activation, Amazon Dash Replenishment measures the toner level and orders more from Amazon when it’s low\nOperating Environment: Temperature 50 91°F', 'Printer Output Type Monochrome\nColor BLACK\nPrinting Technology Laser\nBrand Brother\nPrinting Media Type Paper (plain)', '169.99', '173.39', 'en', 406),
(404, 'Apple Clear Case (for iPhone 12 | 12 Pro)', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor Clear\nCompatible Phone Models IPhone 12, iPhone 12 ProCrafted with a blend of optically clear polycarbonate and flexible materials, the case fits right over the buttons for easy use. On the surface, a scratch-resistant coating has been applied to both the interior and exterior.\nAnd all materials and coatings are optimized to prevent yellowing over time\nWith built-in magnets that align perfectly with iPhone 12 and iPhone 12 Pro, the case offers a magical attach and detach experience, every time.\nThe perfectly aligned magnets make wireless charging faster and easier than ever before. And when it’s time to charge, just leave the case on your iPhone and snap on your MagSafe charger, or set it on your Qi-certified charger.\nLike every Apple-designed case, it undergoes thousands of hours of testing throughout the design and manufacturing process. So not only does it look great, it’s built to protect your iPhone from scratches and drops.\nCompatibility: iPhone 12, iPhone 12 Pro', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor Clear\nCompatible Phone Models IPhone 12, iPhone 12 Pro', '49.0', '49.98', 'en', 407),
(405, 'SanDisk SSD PLUS 1TB Internal SSD - SATA III 6 Gb/s, 2.5\"/7mm, Up to 535 MB/s - SDSSDA-1T00-G26', 'Compatible Devices Desktop\nBrand SanDisk\nDigital Storage Capacity 1 TB\nHardware Interface SATA 6.0 Gb/s\nType of product 2.5 inchesEasy upgrade for faster boot up, shutdown, application load and response (As compared to 5400 RPM SATA 2.5” hard drive; Based on published specifications and internal benchmarking tests using PCMrark vantage scores)\nBoosts burst write performance, making it ideal for typical PC workloads\nThe perfect balance of performance and reliability\nRead/write speeds of up to 535MB/s/450MB/s (Based on internal testing; Performance may vary depending upon drive capacity, host device, OS and application.)\nShock resistant for proven durability: Even if you drop your computer (Shock resistant (up to 1500G) and vibration resistant (5gRMS, 10 2000 HZ/4.9 gRMS, 7 800 HZ), temperature (from 0 degrees Celsius to 70 degrees Celsius))\n3 year limited manufacturer warranty\nOrder with your Alexa enabled device; Just ask \'Alexa, order SanDisk microSD\'\nCompatible Devices: Desktop', 'Compatible Devices Desktop\nBrand SanDisk\nDigital Storage Capacity 1 TB\nHardware Interface SATA 6.0 Gb/s\nType of product 2.5 inches', '105.98', '108.1', 'en', 408),
(406, 'Apple Silicone Case with MagSafe (for iPhone 12 | 12 Pro) - Black', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor Black\nCompatible Phone Models IPhone 12, iPhone 12 ProThe silky, soft-touch finish of the silicone exterior feels great in your hand. And on the inside, there’s a soft microfiber lining for even more protection.\nWith built-in magnets that align perfectly with iPhone 12 | 12 Pro, the case offers a magical attach and detach experience, every time.\nThe perfectly aligned magnets make wireless charging faster and easier than ever before. And when it’s time to charge, just leave the case on your iPhone and snap on your MagSafe charger, or set it on your Qi-certified charger.\nLike every Apple-designed case, it undergoes thousands of hours of testing throughout the design and manufacturing process. So not only does it look great, it’s built to protect your iPhone from scratches and drops.\nCompatibility: iPhone 12, iPhone 12 Pro', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor Black\nCompatible Phone Models IPhone 12, iPhone 12 Pro', '49.0', '49.98', 'en', 409),
