(409, 'VIOFO A119 V3 2K Dash Cam 2560x1600P Quad HD+ Car Dash Camera, Ultra Clear Night Vision, 140-Degree Wide Angle, GPS Included, Buffered Parking Mode, True HDR, Motion Detection, G-Sensor, Time Lapse', 'Are Batteries Included No\nBrand VIOFO\nDisplay Size 2 Inches\nItem Dimensions LxWxH 2 x 4 x 3.5 inches\nVideo Capture Resolution 1440pQUAD HD+ RECORDING: Featuring an entirely new chipset design & Sony sensor to support Quad HD+ recording in 2560 x 1600P / 2560 x 1440P at 30fps to create high quality, vivid and detailed images in various lighting environments.\nSONY 5MP STARVIS SENSOR: Experience the new Sony Starvis 5MP technology with detailed, brighter and crystal-clear images captured in day-or-night time lighting for super clear and consistent night vision.\nMOTION & COLLISION DETECTION: Using the camera\'s G-Sensor and State-of-the-Art motion detection technology, video footage is now intelligently captured in parking mode when moving objects and/or impacts are detected while the vehicle is parked. Files are flagged as important and protected onto the SD card for review.\nPRE & POST BUFFERED RECORDING: Capture the whole story of the events leading up to and after events or collisions with intelligent recording technology that automatically saves footage both 15-seconds before and 30-seconds after a detected collision and/or event.\nTRUE PARKING MODE: Forget the old and conventional style of parking mode \'frame-by-frame\' recording. This camera\'s video segments are captured in full-continuous clips while the vehicle is parked, rather than strung together \'frame-by-frame\'.\n› See more product details', 'Are Batteries Included No\nBrand VIOFO\nDisplay Size 2 Inches\nItem Dimensions LxWxH 2 x 4 x 3.5 inches\nVideo Capture Resolution 1440p', '119.9', '122.3', 'en', 412),
