(452, 'Logitech M510 Wireless Computer Mouse – Comfortable Shape with USB Unifying Receiver, with Back/Forward Buttons and Side-to-Side Scrolling, Dark Gray', 'Connections USB\nColor Dark Gray\nMovement Detection Technology Laser\nBrand Logitech\nHand Orientation AmbidextrousNote: In case of wireless mouse, the USB receiver will be provided inside or along with the mouse\nErgonomic shape: Ergonomically sculpted design and soft rubber grips conform to your right or left hand to be naturally comfortable and the compact size makes it easy to take with you wherever you use your computer at home, at work, or anywhere else\nConvenient controls: Back/forward buttons and side to side scrolling plus zoom let you do more, faster (requires free Logitech options software).Wireless technology: Advanced 2.4 GHz wireless connectivity (Unifying supported)\nLong battery life: You might forget this mouse runs on batteries with 2 years of power from 2 AA batteries\nProgrammable controls: Configure the buttons to do exactly what you want like switching applications, opening browser windows or jump to full screen while watching videos\nPlug\'n\'play connection: Nano sized Logitech wireless unifying receiver stays in your computer plug it in, forget it, even add compatible wireless devices without multiple USB receivers USB connector is located underneath the item inside where the batteries are stored\n3-year limited hardware warranty', 'Connections USB\nColor Dark Gray\nMovement Detection Technology Laser\nBrand Logitech\nHand Orientation Ambidextrous', '24.97', '25.47', 'en', 455),
(453, 'DYMO Authentic LW Large Shipping Labels | DYMO Labels for LabelWriter Label Printers, (2-5/16\" x 4), Print Up to 6-Line Addresses, 1 Roll of 300', 'Color White\nSize 200 labels\nMaterial Plastic\nBrand DYMO\nFinish Type LaminatedCONVENIENT AND COST EFFECTIVE: Peel and stick large shipping labels with strong self adhesive backing; print with direct thermal printing technology no ink or toner required\nNO WASTED LABELS: Packed in rolls so you can print as many labels as needed\nFIND LABELS FOR YOUR NEEDS: Available in a variety of sizes for mailing, shipping, barcode, and specialty applications\nALWAYS USE AUTHENTIC DYMO LABELS: For use with most DYMO label printers, including DYMO LabelWriter 4XL, LabelWriter 450, LabelWriter Wireless, LabelWriter 450 Duo, LabelWriter 450 Turbo, LabelWriter 450 Twin Turbo, and Desktop Mailing Solution\nINCLUDES 300 LABELS: One roll (2 5/16 inches x 4 inches)', 'Color White\nSize 200 labels\nMaterial Plastic\nBrand DYMO\nFinish Type Laminated', '12.99', '13.25', 'en', 456),
