(471, 'Canon PG-260 Black Ink Cartridge, Compatible to TR7020, TS6420, and TS5320', 'Brand Canon\nColor Black\nCompatibility Options OEMMake sure this fits by entering your model number.\nThe pg-260 XL Black ink cartridge produces crisp, sharp Black text for all your documents.\nXl capacity ink cartridges can help you save money, Print more when you need to and extend the time between replacing ink cartridges.\nCombined with the genuine cl-261 color ink cartridge and Canon photo paper this ink protects your photos from fading for longer, thanks to the ChromaLife100 system.\nGenuine Canon inks provide peak performance that is specifically designed for compatible Canon Printers.', 'Brand Canon\nColor Black\nCompatibility Options OEM', '31.0', '31.62', 'en', 474),
(472, 'Numark HF125 | Ultra-Portable Professional DJ Headphones With 6ft Cable, 40mm Drivers for Extended Response & Closed Back Design for Superior Isolation', 'Brand Numark\nColor Silver\nConnections Wired\nModel Name HF 125\nHeadphones Form Factor Over EarMonitoring Essential - Ultra light DJ headphones with 7 different independently-adjustable position settings caters for any mixing preference\nSuperior Comfort – Lightweight design fused with a padded headband and ear cushions keep you focussed on what’s important – your mix\nSuperior Isolation – closed back design reduces ambient noise so you hear only what you need to\nConnect to Anything - 6-foot hard wired cord with a moulded 1/8” TRS connector, plus a 1/8” to ¼” TRS adapter included, connects to virtually any DJ mixer\nHassle Free Setup - Single sided cord to minimise tangles and get you DJ-ing from the get-go', 'Brand Numark\nColor Silver\nConnections Wired\nModel Name HF 125\nHeadphones Form Factor Over Ear', '14.99', '15.29', 'en', 475),
