(477, 'GoPro Suction Cup Mount (GoPro Official Mount)', 'Color Black\nBrand GoPro\nItem Dimensions LxWxH 6 x 1.7 x 9 inches\nItem Weight 59 GramsAttach your GoPro to cars, boats, motorcycles and more\nIndustrial strength suction cup proven at speeds of 150+ mph\nEngineered to provide a broad range of motion and stability\nQuick release base makes moving between shots and locations quick and convenient', 'Color Black\nBrand GoPro\nItem Dimensions LxWxH 6 x 1.7 x 9 inches\nItem Weight 59 Grams', '39.0', '39.78', 'en', 480),
(478, 'Bose Smart Soundbar 300 Bluetooth connectivity with Alexa Voice Control Built-in, Black', 'Brand Bose\nColor Black\nSpeaker Type Soundbar\nModel Name Soundbar 300\nControl Method VoiceLike no other — This elegant soundbar for TV, movies, music, and games delivers spacious sound, exceptional clarity, and rich bass, while finished in matte-Black with seamless metal grille.\nAcoustic performance — Five full-range drivers deliver wide, clear sound, which makes it the perfect soundbar for TV, movies, games, and more.\nBuilt-in Alexa — Amazon Alexa and Google Assistant are built into this smart soundbar for hands-free voice control. And a noise-rejecting mic system listens in every direction for your voice.\nTV voice control — Exclusive Bose Voice4Video technology expands your Alexa capabilities, allowing you to control this smart soundbar, your TV, and your cable/satellite box with one voice command.\nConnectivity — Pair your device to this wireless soundbar to stream your favorite music and more via a Bluetooth connection, your home Wi-Fi network, Apple AirPlay 2, or Spotify Connect.\nSimple setup — Connect this smart soundbar to your TV via an optical audio cable (included) or an HDMI cable (sold separately) and download the Bose Music app for step-by-step setup.\nSleek design — This wireless soundbar is just over 2\" tall for low placement in front of your TV or wall mounting (wall brackets sold separately). Overall dimensions are 2.21\" H x 26.58\" W x 4.02\" D.\nBuild and expand — This Bluetooth soundbar is compatible with other Bose products for multiroom listening or add the Bose Bass Module 500 or 700 or the Bose Surround Speakers 700.\n› See more product details', 'Brand Bose\nColor Black\nSpeaker Type Soundbar\nModel Name Soundbar 300\nControl Method Voice', '399.0', '406.98', 'en', 481),
(479, 'FiiO E10K USB DAC and Headphone Amplifier (Black)', 'Brand FiiO\nConnections Usb\nColor Black\nItem Dimensions LxWxH 0.83 x 1.93 x 3.11 inches\nOutput Wattage 10 WattsDAC Chip¡ªThe Internal DAC chip is a PCM102 and can handle PCM files up to 24-bit/96 kHz while improving audio quality via a linear filter, reduced delay and internal silence on changing tracks, and no phase shifts.\nLOW NOISE FLOOR ¡ª The unit has an optimized low-pass filter and selectable bass boost circuit that are designed for a low noise floor in all states.\nCONNECTION VARIETY ¡ª The variety of connections include a front-panel 1/8¡± headphone jack, a rear-panel 1/8¡± line output, and a rear-panel coaxial digital output, which allows you to send your digital audio to another destination.\nUSB CONNECTION ¡ª Connects to your laptop via its micro USB connection, which also provides it with power.\nPORTABLE DESIGN ¡ª A sleek, brushed aluminum shell and chassis allow for durable, portable use.', 'Brand FiiO\nConnections Usb\nColor Black\nItem Dimensions LxWxH 0.83 x 1.93 x 3.11 inches\nOutput Wattage 10 Watts', '75.99', '77.51', 'en', 482),
(480, 'Yamaha Audio YAS-209BL Sound Bar with Wireless Subwoofer, Bluetooth, and Alexa Voice Control Built-In', 'Brand Yamaha Audio\nColor Black\nConnections Bluetooth, Wi-Fi, HDMI\nModel Name YAS-209BL\nconnector-type Optical, HDMIEasy setup with HDMI or Optical cable and automatic subwoofer connection\nWireless subwoofer for deep bass and flexible placement. Center unit-36-5/8 × 2-1/2 × 4-1/4 inches, Subwoofer-7-1/2 × 16-1/2 × 16 inches\nClear voice for enhanced dialogue clarity\nAlexa built-in for voice control of your sound bar, playing music, listening to news, setting alarms and timers, asking questions, controlling smart home devices, and more\nWith Alexa, playing music is as simple as asking for a song, artist, or genre from Amazon music and more\nDTS Virtual: X virtual 3D surround sound\nPlay music and podcasts through Spotify Connect, Wi-Fi, or Bluetooth', 'Brand Yamaha Audio\nColor Black\nConnections Bluetooth, Wi-Fi, HDMI\nModel Name YAS-209BL\nconnector-type Optical, HDMI', '349.95', '356.95', 'en', 483),
