(482, 'Apple Silicone Case (for iPhone 11 Pro) - Pink Sand', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor Pink Sand\nCompatible Phone Models IPhoneA soft microfiber lining on the inside helps protect your iPhone.\nOn the outside, the silky, soft-touch finish of the silicone exterior feels great in your hand.\nAnd you can keep it on all the time, even when you’re charging wirelessly.\nJust like every Apple-designed case, it’s put through thousands of hours of testing throughout the design and manufacturing process.\nSo not only does it look great, it’s built to protect your iPhone from scratches and drops.\nCompatibility: iPhone 11 Pro', 'Material Silicone\nBrand Apple\nType of product Basic Case\nColor Pink Sand\nCompatible Phone Models IPhone', '21.99', '22.43', 'en', 485),
(483, 'Focusrite Scarlett 4i4 (3rd Gen) USB Audio Interface with Pro Tools | First', 'Two of the best performing mic preamps the Scarlett range has ever seen, now with switchable Air mode to give your vocal recordings a brighter and more open sound. Two high-headroom instrument inputs to plug in your guitar or bass. Two balanced line inputs for connecting synthesizers, drum machines and other line-level sources. Four balanced outputs for clean monitoring and sending audio out to effects pedals\nHigh-performance converters enable you to record and mix at up to 24-bit/ 192kHz.\nQuick start tool to get up and running easier than ever.\nIncludes Pro Tools | First Focusrite Creative Pack, Ableton Live Lite, Softube Time and Tone Bundle, Focusrite’s Red Plug-in Suite, 3-month Splice subscription, and your choice of one free XLN Addictive Keys virtual instrument, all available via download upon purchase and registration\nLIMITED TIME OFFER: FREE D16 Devastator 2 upon registration and download.', '', '229.99', '234.59', 'en', 486),
