(485, 'Cloud Microphones Cloudlifter CL-1 Mic Activator', 'Brand Cloud Microphones\nColor Blue\nnumber_of_channels 1\nItem Weight 0.32 Kilograms\nPower Source BatteryUses Phantom power to give passive mics (mainly used for dynamic and ribbon mics) up to +25dB without passing Phantom power on to mic\nEasy to use self contained design requires only Phantom power to work. **Does not use Phantom power to power mics\nRecommended for use with all passive dynamic microphones\nCompatible with tube, battery, or power supply driven microphones – safe for all passive ribbons with no transfer of Phantom\nDoes not power the mics themselves using Phantom power (that is not what this is designed for). instead, place the cloudlifter at the front of your dynamic mic, then hit it with Phantom Power and your basic mic (even an SM58 style mic) will shine like never before', 'Brand Cloud Microphones\nColor Blue\nnumber_of_channels 1\nItem Weight 0.32 Kilograms\nPower Source Battery', '149.0', '151.98', 'en', 488),
(486, 'Emerson Sensi Touch Wi-Fi Smart Thermostat with Touchscreen Color Display, Works with Alexa, Energy Star Certified, C-wire Required, ST75W', 'Brand Emerson Thermostats\nColor White\nItem Dimensions LxWxH 3.4 x 5.6 x 1.2 inches\nItem Weight 0.65 Pounds\nPower Source Corded ElectricEDITORS CHOICE BEST OVERALL SMART THERMOSTAT by USA Today’s reviewed.com\nSAVE ABOUT 23% ON HVAC ENERGY*: By adjusting the temperature using flexible scheduling, remote access, and geofencing, Sensi customers saved about 23% on HVAC energy usage\nMOST INSTALL IN 30 MINUTES OR LESS**: Use the built-in level, illuminated easy-click terminals and step-by-step app instructions for a quick installation. Skip any extra work painting or patching the wall thanks to the standard thermostat size.\nSMART HOME COMPATIBLE: Works with Amazon Alexa, Google Assistant, Apple HomeKit, and Samsung SmartThings smart home platforms.\nUSAGE REPORTS: Monitor current day and historical heating, cooling and fan runtimes right in the app.\nCONTROL FROM ANYWHERE: Remotely control your home comfort from your smartphone or tablet using the Sensi mobile app for Android and iOS devices.\nSMART ALERTS: Sensi features smart alerts to help detect extreme temperature and humidity levels in your home.\nCIRCULATING FAN: Air circulation may improve indoor air quality by helping to regulate temperature and prevent buildup of particles and mold.\n› See more product details', 'Brand Emerson Thermostats\nColor White\nItem Dimensions LxWxH 3.4 x 5.6 x 1.2 inches\nItem Weight 0.65 Pounds\nPower Source Corded Electric', '135.99', '138.71', 'en', 489),
