(488, 'Digital Innovations CleanDr for Blu-Ray Laser Lens Cleaner for Blu-Ray / DVD / PS3 / PS4 / XBOX / XBOX 360 / XBOX ONE (4190300)', 'Laser lens cleaner for Blu-Ray players and Blu-Ray video game systems having issues with discs that load slowly, skip, or freeze during playback\nPatent-pending Zero-Clearance Technology and 10-Brush Cyclone Clean process removes dirt and dust build-up that causes audio and video dropout and distortion\nCleaning the laser lens can extend the life of the Blu-Ray player while improving sound and image quality\nIncludes Image & Sound Calibration Tools and instructions in English, French or Spanish\nWorks with Blu-Ray Players, DVD Players, XBOX/XBOX 360/XBOX ONE, PS/2/3/4. Not compatible with CD only players', '', '14.74', '15.03', 'en', 491),
(489, 'Brother Genuine P-touch TZE-221 Tape, 3/8\" (0.35\") Standard Laminated P-touch Tape, Black on White, Laminated for Indoor or Outdoor Use, Water Resistant, 26.2 Feet (8M), Single-Pack', 'Color Black on White\nSize 3/8\"\nMaterial Paper\nBrand Brother\nFinish Type LaminatedDURABLE P-TOUCH REPLACEMENT LABELS - TZe221 label tape is a Brother Genuine P-touch standard laminated replacement tape for P-touch label printers.\nBUSINESS AND HOME USE - Brother Genuine P-touch tape is incredibly versatile and can be used for home, industrial, and business applications.\nEASY TO APPLY - Removing the laminated tape is easy thanks to the split-back design. It can be applied to wood, steel, plastic and more.\nFEATURES - Laminated, water resistant, grease resistant, grime resistant, temperature resistant.\nCOMPATIBLE WITH BROTHER LABEL MAKERS - PTD200, PTD210, PTD215E, PTD400, PTD400AD, PTD600, PTD600VP, PTH100, PTH110, PTP300BT, PTP700 and more.', 'Color Black on White\nSize 3/8\"\nMaterial Paper\nBrand Brother\nFinish Type Laminated', '9.49', '9.68', 'en', 492),
