(542, 'Bose Frames, Audio Sunglasses with Open Ear Headphones, Alto M/L , Black with Bluetooth Connectivity', 'Brand Bose\nColor Black\nConnections Bluetooth\nModel Name Alto\nItem Weight 0.7 PoundsSunglasses with built-in Bose speakers that produce rich, immersive sound for you, while others hear practically nothing\nOpen-ear audio allows you to stay aware of your surroundings, while enjoying your music\nBose Frames Alto feature a classic angular shape and commanding lenses. Lens width: 54 millimeter | Bridge width: 21 millimeter | Temple length: 136 millimeter\nIntegrated microphone for clear calls and access to your phone\'s virtual assistant\nPersonalized settings, access to future updates, and more available through the Bose Connect app. Bluetooth connectivity for easy pairing\nBlocks up to 99% of UVA/UVB rays\nBattery life: 3.5 hours streaming; 12 hours on standby. Charge time: 2 hours\nBluetooth Range: 30 feet or 9 meter; Compatible operating systems: iOS: 9.0 or newer/ Android: 5.0 or newer', 'Brand Bose\nColor Black\nConnections Bluetooth\nModel Name Alto\nItem Weight 0.7 Pounds', '179.0', '182.58', 'en', 545),
