(548, 'FLIR ONE Pro - iOS - Professional Grade Thermal Camera for Smartphones - with VividIR and MSX Image Enhancement Technology', 'Powerful Infrared camera mobile accessary with adjustable one fit connector lets you find hidden electrical problems, energy loss, water damage, and other heat related issues\nImage Capture – Up to 500 radiometric images. 4800 pixels capable of capturing thermal measurements from 14°F to 302°F. Spectral Range : 7.5–14 Image Capture – Up to 500 Radiometric Images. 4800 Pixels Capable of Capturing Thermal Measurements from 14°F to 302°F. Spectral Range: 7.5–14 µm\nTemperature range: 4 degree F and 752 Degree F (20 degree to 400 Degree C). Measure temperature accurately and from a safe distance\nImage enhancement MSX and VividIR enhanced image processing and video capabilities give you the sharpest mobile thermal imaging performance\nThis product is for commercial purposes only and is export controlled under US Regulations for non us military end users and military end uses. Battery life Approximately 1 hour. Battery charge time 40 min', '', '345.63', '352.54', 'en', 551),
(549, 'Wacom PTH660 Intuos Pro Digital Graphic Drawing Tablet for Mac or PC, Medium, New Model, Black', 'Brand Wacom\nColor Black\nItem Weight 1.54 Pounds\nSeries Wacom Intuos Pro, Medium, Black (PTH660)\nConnections Bluetooth, USBWacom’s trusted professional Pro Pen 2 technology in a precision graphics tablet, optimized for hours of image editing, illustration or design work\nSlim tablet design in our most popular size (13.2” x 8.5”) with an active area of (8.7” x 5.8”) for anyone with a serious creative passion\nThe Pro Pen 2 features 8,192 levels of pressure sensitivity, tilt-response and virtually lag-free tracking for ultimate precision and control – and because it’s battery free it never needs charging\nSpeed your workflow with the multi-touch surface, programmable express keys, radial menus and pen side-switches; Customize your experience with pro pen slim or pro pen 3D (sold separately)\nSystem requirements: USB port, Windows 7 or later (64bit), Mac OS 10.12 or later, Bluetooth Classic for included wireless connection to PC or Mac\nWarning: Manufacturer\'s warranty is only valid when purchased from an authorized reseller or Amazon.com', 'Brand Wacom\nColor Black\nItem Weight 1.54 Pounds\nSeries Wacom Intuos Pro, Medium, Black (PTH660)\nConnections Bluetooth, USB', '329.95', '336.55', 'en', 552),
(550, 'StarTech.com 8 Outlet Horizontal 1U Rack Mount PDU Power Strip for Network Server Racks - Surge Protection - 120V/15A - with 6 Ft Power Cord (RKPW081915), Black', 'Brand StarTech\nColor Black\nMaterial Alloy Steel\nVoltage 120 Volts\nItem Weight 2200 GramsThe Horizontal Rack Mount PDU delivers a cost-effective power distribution solution for your server rack or cabinet with 8-outlet (120V/15A). Hassle-Free Equipment Installation the 1U switched PDU strip can be mounted horizontally in any server rack 4 inches deep or greater, to supply eight 120V/15A power ports/outlets, and features a rugged steel casing to ensure maximum durability. Protects your equipment the front of the surge protector features two LEDs to indicate proper ground and surge detection while enabling you to control the power state with an illuminated power/reset switch. To prevent costly breakdowns of connected devices, the rackmount PDU features a built-in circuit breaker and reset switch, ensuring dependable performance of vital data center equipment. This unit is backed by a lifetime StarTech.com warranty with free technical support.\nThe STARTECH.COM advantage: StarTech.com offers a 2-year warranty and free lifetime technical support on this rack PDU and has been the choice of IT professionals and businesses for over 30 years\nPower and charge: This rack mount power strip provides an additional 8 NEMA 5-15 outlets (120V/15A) and features a 6 feet long cord so you can plug your devices in while leaving the rack mobile\n1U Rack design: Compatible with all 19” server racks 4 inches or deeper, this horizontal-mount power distribution unit fits many network racks and has an integrated 6 feet/1.8 meter power cord\nFor the IT professional: This IT-grade rackmount PDU features a rugged steel chassis, LED indicators for ground and surge protection, and lets you control the power state with power and reset switches\nProtects your equipment: This rack mountable 8-outlet (120V) power strip features a built-in circuit breaker and reset switch, ensuring a dependable performance of your networking equipment', 'Brand StarTech\nColor Black\nMaterial Alloy Steel\nVoltage 120 Volts\nItem Weight 2200 Grams', '44.99', '45.89', 'en', 553),
