(558, 'HP OfficeJet Pro 8210 Wireless Color Printer, HP Instant Ink or Amazon Dash replenishment ready (D9L64A)', 'Printer Output Type Color\nColor Black\nPrinting Technology Inkjet\nBrand HP\nPrinting Media Type Envelopes, Paper (plain), Card stock, Labels, Glossy photo paper, High-resolution paperEverything you need for impressive prints – From borderless, two-sided color prints to the built-in Wi-Fi Direct for easy mobile printing, this HP color inkjet printer delivers exceptional productivity for your small business\nOur most powerful printing app ever – The HP Smart app allows you to set up your HP wireless printer, scan documents with your camera, and print from your smartphone\nAffordable, professional color - Manage your budget with professional-quality color at up to 50% less cost per page than lasers\nRedefine expectations - Use the HP JetAdvantage Management Solution set to control your fleet: add new devices and solutions, update features, and apply corporate policies with ease\nChoose an ink replenishment service - Save up to 50% with HP Instant Ink or Save 10% on all reorders with Amazon Dash replenishment. Upon activation your printer measures ink levels and places smart reorders when you are running low. No subscription fees. Cancel anytime.\nOriginal HP ink – This HP office printer uses Original HP 952 cartridges. Get up to 2X the pages with HP 952XL high yield ink\nWide range of paper size support – Legal; 8.5 x 13 in; Letter; A4; Executive; B5; A5; Statement; Envelope (#10, Monarch); Index card (3x5, 4x6); Photo Media\nOne-year limited hardware warranty – 24-hour, 7 days a week Web support', 'Printer Output Type Color\nColor Black\nPrinting Technology Inkjet\nBrand HP\nPrinting Media Type Envelopes, Paper (plain), Card stock, Labels, Glossy photo paper, High-resolution paper', '149.89', '152.89', 'en', 561),
