(560, 'Canon PowerShot ELPH 180 Digital Camera w/ Image Stabilization and Smart AUTO Mode (Silver), 0.90in. x 3.70in. x 2.10in. - 1093C001', 'Brand Canon\nModel Name Canon PowerShot ELPH 180\nShooting Modes Automatic\nColor Silver\nType of product Compact8x Optical Zoom with Optical Image Stabilizer helps you capture images with flexibility and ease\n20.0 Megapixel CCD sensor combines with the DIGIC 4+ Image Processor to help deliver stunning image quality\n720p HD video capabilities. Focusing range: Normal: 2.0 inch - infinity (W), 4.3 feet (1.3 meter) - infinity (T)\nSmart auto intelligently selects the proper settings based on predefined shooting situations\nDigital IS helps reduce the effect of camera shake and subject movement. Operating temperature:32-104°F / 0-40°C. Compatible with Android devices version 4.0 or later\nScene modes such as Fisheye Effect, Toy Camera Effect and Monochrome provide creative freedom to capture your photos', 'Brand Canon\nModel Name Canon PowerShot ELPH 180\nShooting Modes Automatic\nColor Silver\nType of product Compact', '129.0', '131.58', 'en', 563),
(561, 'Canon Color Image CLASS MF644Cdw - All in One, Wireless, Mobile Ready, Duplex Laser Printer', 'Printer Output Type Color\nColor White/Black\nPrinting Technology Laser\nBrand Canon\nPrinting Media Type Paper (plain)Standard Dimensions (Desktop): 16.9\" W x 16.5\" D x 16.5\" H | Standard Installation Space (Desktop): 23.4\" x 23.0\" x 21.3\"\nUSABILITY: A unique, customized device experience with Application Library. Print, scan, copy and fax capabilities help you accomplish necessary tasks with just one machine. 5 inches intuitive color touchscreen with smartphone like usability. Create Wi Fi Direct hotspot from the printer to establish direct connection to mobile device(s) without the need for external router\nQUALITY AND RELIABILITY: Canon\'s signature reliability and engine technologies help keep productivity high and minimize the impact on support resources. Intuitive maintenance videos for common tasks like consumables replacement\nWORKFLOW EFFICIENCY: Supports mobile solutions for printing and scanning. Scan and convert documents to searchable digital files through a one pass scan / duplex document feeder. Designed for small print jobs with first print time as fast as 10. 3 seconds\nCOST EFFICIENCY: High capacity, all in one cartridge helps reduce overall supply costs. Out of the box, standard two sided printing plus the ability to print multiple pages onto one sheet helps to reduce paper consumption\nSECURITY FEATURES: Helps mitigate risk of confidential information loss as documents are only stored in short term memory.\nSave 10% on all ink reorders with Dash Replenishment. Upon activation your printer measures ink levels and places smart reorders when you are running low. No subscription fees. Cancel anytime.', 'Printer Output Type Color\nColor White/Black\nPrinting Technology Laser\nBrand Canon\nPrinting Media Type Paper (plain)', '319.0', '325.38', 'en', 564),
