(596, 'Bose Home Speaker 300, with Amazon Alexa built-in, Silver', 'Brand Bose\nColor Silver\nSpeaker Type Multi-Room\nModel Name Home Speaker 300\nControl Method VoiceRoom-rocking bass and 360-degree, lifelike sound in a compact size\nBuilt-in voice assistants, like Alexa and the Google Assistant, with superior voice pickup from a noise-rejecting six-microphone Array\nWith Wi-Fi, Bluetooth, and Apple airplay 2 compatibility, play your favorite music services or anything from your phone or tablet\nControl comes easy with three different ways to manage what you hear: your voice, the Bose music app, or 6 one-touch presets on top of the speaker\nUse the Bose music app for simple setup with detailed prompts\nWorks with other Bose smart speakers and soundbars for a multi-room listening experience\nUse Bose SimpleSync technology to pair a member of the Bose Smart Home Family with a Bose SoundLink speaker for synchronized music playback\nAlexa speaks English and Spanish', 'Brand Bose\nColor Silver\nSpeaker Type Multi-Room\nModel Name Home Speaker 300\nControl Method Voice', '199.0', '202.98', 'en', 599),
