(609, 'ASUS Chromebook C523 Laptop- 15.6\" HD NanoEdge Display with 180 Degree Hinge, Intel Dual Core Celeron N3350 Processor, 4GB RAM, 32GB eMMC Storage, Chrome OS- C523NA-DH02 Silver Color', 'Brand ASUS\nOperating System Chrome OS\nCPU Manufacturer Intel\nStanding screen display size 15.6 Inches\nRAM 4 GBLasts up to 10 hours creating a perfect balance between entertainment and productivity\nThe 15. 6-inch NanoEdge HD display has an ultra-narrow 6mm bezel with anti-glare coating making it perfect for entertainment and productivity.\nThe HD display has a durable 180 degree hinge that can be laid flat to share content easily.\nPowered by the Intel Dual-Core Celeron N3350 Processor (2M Cache, up to 2. 4 GHz) for fast and snappy performance.\n4GB DDR3 RAM; 32GB eMMC storage and USB Type-C (Gen 1) and Type-A ports. HD Webcam\nChromebook runs on Chrome OS - an operating system by Google that is built for the way we live today. It comes with built-in virus protection, updates automatically, boots up in seconds and continues to stay fast over time.\nAll the Google apps you know and love come standard on every Chromebook, which means you can edit, download, and convert Microsoft Office files in Google Docs, Sheets and Slides.', 'Brand ASUS\nOperating System Chrome OS\nCPU Manufacturer Intel\nStanding screen display size 15.6 Inches\nRAM 4 GB', '229.99', '234.59', 'en', 612),
(610, 'Brother Genuine LC3033BK, Single Pack Super High-Yield Black INKvestment Tank Ink Cartridge, Page Yield Upto 3,000 Pages, LC3033, Amazon Dash Replenishment Cartridge', 'Brand Brother\nColor Black\nCompatibility Options OEM\nPage Yield 3000Make sure this fits by entering your model number.\nDelivers superior inkjet quality: Brother Genuine LC-3033BK delivers superior inkjet print quality you can rely on for upto 3,000 pages(1)\nIntelligent engineering: Intelligently engineered to work in seamless unison with your Brother INKvestment tank inkjet printer\nSharp prints that last: Brother Genuine ink produces sharp prints that withstand the test of time\nFor use with: Brother INKvestment Tank, inkjet all-in-one printer models MFC-J995DW and MFC-J995DW XL that feature Brother tank technology\nAmazon dash replenishment cartridge - Upon activation with your Dash-eligible Brother printer, LC3033BK replacement cartridges can be automatically ordered through Amazon Dash Replenishment and sent directly to your door\nSave 10% on all ink reorders with dash replenishment. Upon activation, your printer measures ink levels and places smart reorders when you are running low. No subscription fees. Cancel anytime', 'Brand Brother\nColor Black\nCompatibility Options OEM\nPage Yield 3000', '32.98', '33.64', 'en', 613),
