(612, 'Brother LC71 3-Pack Innobella Standard Yield Ink Cartridges - Retail Packaging - Cyan/Yellow/Magenta', 'Brand Brother\nColor Yellow/cyan/magenta\nCompatibility Options OEM\nCompatible Devices Brother MFC-J280W, MFC-J425W, MFC-J430W, MFC-J435W, MFC-J625DW, MFC-J825DW, MFC-J835DWMake sure this fits by entering your model number.\nCyan Ink, Magenata Ink, & Yellow Ink, Standard Yield\nApprox. 300 page yield per cartridge (in accordance with ISO/IEC 24711). OEM Genuine Brother Ink\nThis particular consumable series (LC71, LC75 and LC79) do not have a spring in them. Older series such as the LC61 series do have a spring in them so the front cover could move back when installed into the machine.\n(MFCJ5910DW, MFCJ6510DW, MFCJ6710DW, MFCJ6910DW) takes LC75 and LC79 series inks.\nLC71 series ink wont fit in model number (MFCJ5910DW, MFCJ6510DW, MFCJ6710DW, MFCJ6910DW) as the cartridge will not lock in place and just spring back.', 'Brand Brother\nColor Yellow/cyan/magenta\nCompatibility Options OEM\nCompatible Devices Brother MFC-J280W, MFC-J425W, MFC-J430W, MFC-J435W, MFC-J625DW, MFC-J825DW, MFC-J835DW', '25.49', '26.0', 'en', 615),
(613, 'Fender 351 Shape Graphic Picks (12 Pack) for electric guitar, acoustic guitar, mandolin, and bass, 351 - Medium, Multicolor (Rainbow)', 'Comfortable and familiar feel provided by the traditional 351 shape\nCelluloid picks give the traditional feel, with a smooth striking surface and a warm, round musical tone\nMedium gauge picks are ideal for the player looking for a warmer tone of a heavy pick, but the flexibility of a thin pick.\nFender picks provide comfort and high-performance flexibility for every performer\nSold as a convenient 12-pack', '', '3.79', '3.87', 'en', 616),
(614, 'StarTech.com 6ft HDMI to DVI D Adapter Cable - Bi-Directional - HDMI to DVI or DVI to HDMI Adapter for Your Computer Monitor (HDMIDVIMM6),Black', 'connector-type DVI, HDMI\nBrand StarTech\nWarranty Type LifetimeTWO-WAY FUNCTIONALITY: This high speed 6ft HDMI to DVI D adapter cable lets you connect an HDMI enabled output device to a DVI D display or a DVI D output device to an HDMI capable display.\nHIGH QUALITY CONNECTORS: This digital video computer monitor cable is designed with molded nickel connectors (male to male) with strain relief to provide a high quality and consistent connection between your DVI and HDMI devices.\nCABLE AND ADAPTER IN ONE: Connect a DVI D monitor or display to an HDMI equipped computer (or an HDMI monitor to a DVI D device) over a 6 ft distance, helping to reduce cord clutter and keep your cable installation tidy.\nULTIMATE CAPABILITIES: This unique and premium adapter cable ensures compatibility between two distinct digital video interfaces, delivering a complete digital video solution for your HDMI and DVI D inputs and outputs (computer / monitor).\nLIFETIME WARRANTY: Constructed of high quality materials, this HDMI to DVI D adapter cable is backed by a StarTech.com lifetime warranty and free lifetime support.', 'connector-type DVI, HDMI\nBrand StarTech\nWarranty Type Lifetime', '8.49', '8.66', 'en', 617),
