(616, 'Datacolor SpyderX Pro – Monitor Calibration Designed for Serious Photographers and Designers SXP100', 'THE FASTEST SPYDER EVER: Calibrating your monitor to achieve color precision now takes just a minute or two – several times faster than previous models.\nTHE MOST ACCURATE SPYDER EVER: Groundbreaking lens-based color engine provides a higher level of color accuracy for multiple monitors. SpyderX Pro features room-light monitoring, automatic profile changing and significantly more precise screen color, shadow detail and white balance.\n.THE EASIEST-TO-USE SPYDER EVER: SpyderX Pro is so intuitive, you don’t have to be a color expert. It features quick and easy single-click calibration and wizard workflow with 12 predefined calibration targets for advanced color accuracy.\nSEE THE DIFFERENCE INSTANTLY: SpyderProof functionality provides before-and-after evaluation of your display and allows you to see the difference using your own images.\nMONITOR TECHNOLOGIES CHANGE AND IMPROVE OVER TIME: SpyderX Pro assures you support for the latest screen types, recent resolutions and gamuts.', '', '169.99', '173.39', 'en', 619),
(617, 'NEW Microsoft Surface Go Type Cover - Black', 'Features a full keyset, backlit keys, and large trackpad.\nSlim and compact, yet performs like a traditional, full-size keyboard.\nClicks in place instantly — use with Surface Go 2 or Surface Go with built-in Kickstand for a full laptop anywhere.\nClose to protect screen and conserve battery, or fold back for a tablet.\nEnhanced magnetic stability — adjusts to virtually any angle.', '', '69.0', '70.38', 'en', 620),
