(625, 'Motorola T605 Talkabout, 2 Pack Bundle', 'Brand Motorola Solutions\nColor Green\nnumber_of_channels 22\nItem Dimensions LxWxH 7.78 x 2.4 x 1.5 inches\nItem Weight 0.54 Pounds\nWater Resistance Level Waterproof\nWaterproof IP67IP67 Waterproof: Count on the T605 H2O two-way waterproof radio to keep you connected whether on land or at sea. With its IP67 standard, the T605 H2O withstands constant submersion of up to 1m for 30 minutes and repels the heaviest rain.\nAdvanced Built-in Flashlight with White and Red LEDs: Select the white LED setting on the built-in flashlight to light your way during evening activities, unexpected emergencies or power outages.\nKnow the Weather In Advance: Keep updated with real-time weather conditions by turning on one of 11 weather channels or initiating weather alerts. NOAA radio service may not be available in all areas.\n23 Channels Each with 121 Privacy Codes: With 22 channels and 121 privacy codes, totaling 2,662 combinations, it’s easy to find an available channel.\nCompatible with Any Radio: You can communicate with other FRS/GMRS radios regardless of brand by being on the same channel and privacy codes.\nThe range in real-life conditions can be reduced from maximum range. Mountain to Valley: Up to 35 mile. Open Water: Up to 6 miles. Neighborhood: Up to 2 miles', 'Brand Motorola Solutions\nColor Green\nnumber_of_channels 22\nItem Dimensions LxWxH 7.78 x 2.4 x 1.5 inches\nItem Weight 0.54 Pounds\nWater Resistance Level Waterproof\nWaterproof IP67', '79.99', '81.59', 'en', 628),
