(665, 'VIOFO A129 Pro Duo 4K Dual Dash Cam 3840 x 2160P Ultra HD 4K Front and 1080P Rear Car WiFi Dash Camera Sony 8MP Sensor GPS, Buffered Parking Mode, G-Sensor, Motion Detection, WDR, Loop Recording', 'Are Batteries Included Yes\nBrand VIOFO\nStanding screen display size 2 Inches\nVideo Capture Resolution 1080p\nDisplay LCD【Ultra HD Real 4K Dual Channel Dash Cam】 Adopt top quality Sony 8MP IMX317 Sensor on front camera and Sony IMX 291 sensor on rear camera, this dual dash cam captures super clear view at Ultra HD 4K 3840 * 2160 @30fps + 1920 * 1080P @30fps at the same time. 4K resolution offer amazing video quality, four time higher than a regular Full HD recording. Help you read most details from street signs, license plate etc. Give you peace of mind when you\'re driving.\n【Upgraded Super Night Vision & WDR】Come with 8 Megapixel image sensor, provide a much clearer image than most dash cameras at night, combine with upgraded 7-Glass F1.8 aperture lens and WDR (Wide Dynamic Range) technology, maintain sharp image and automatically balance the lighting at over bright and over dark area. Help capture clear details that other cameras cannot read, like road signs, license plates.\n【Buffered Parking Mode】Buffered parking mode will be able to record events leading up to an impact / motion that has been detected. Car camera will save 15 seconds video before the event and 30 seconds after the event. This is an excellent feature and completes a true parking mode as there can be a lot of vital information in the lead-up to whatever triggered recording. To use parking mode, it is better to buy VIOFO HK3 hardwire cable separately.\n【Built-in Wi-Fi & GPS】 2.4GHz & 5GHz dual-band Wi-Fi could transmit in two different standard frequency ranges to avoid wireless interference. A more stable Wi-Fi signal and faster Wi-Fi speed bring blazing speed for file transfer. With GPS logger, dash camera can log the current speed and GPS location, also automatically correct the time by synchronizing with the satellite. Timestamp can be embedded in the video. Real-time speed would display on car camera screen in KM/H or MP/H.\n【Premium Functions】 Loop recording, emergency recording, motion detection, time lapse and so on. All your daily driving needs will be satisfied by this one dash cam.\n› See more product details', 'Are Batteries Included Yes\nBrand VIOFO\nStanding screen display size 2 Inches\nVideo Capture Resolution 1080p\nDisplay LCD', '249.9', '254.9', 'en', 668),
