(779, 'HP OfficeJet 200 Portable Printer with Wireless & Mobile Printing (CZ993A)', 'Printer Output Type Color\nColor Black\nPrinting Technology Inkjet\nBrand HP\nPrinting Media Type Envelopes, Paper (plain), Card stock, Labels, Glossy photo paper, High-resolution paperMain functions of this HP color portable printer: easy portable printing wherever you need it, wireless print from your laptop or mobile devices, 2\" display and more\nMobile printing: print from anywhere using your smartphone or tablet with the free HP ePrint app, print even without a network using Wireless Direct printing. Standard input capacity (envelopes)- Up to 5.Standard input capacity (legal)- Up to 50 . Standard input capacity (cards) - Up to 20. Maximum input capacity (sheets) - Up to 50. Maximum input capacity (transparencies) - Up to 5. Maximum input capacity (cards) - Up to 20. Maximum input capacity (photo paper) - Up to 20. Maximum input capacity (4x6 photo) - Up to 20. Maximum input capacity (labels) - Up to 5\nEasy portable printing wherever you need it. This durable, compact printer fits in your car, backpack, and more, for convenient printing anywhere. Start printing in minutes - HP Auto Wireless Connect makes setup easy\nReduce charging interruptions with a long-lasting battery. Charge from home, in your car or office, and more. Plug in your AC power source to charge within 90 minutes while the printer is off\nUse Original HP 62 ink & HP 62XL cartridges for great results print after print. Original HP ink prints up to 2x the pages as refilled cartridges\nStay productive with a large and easy-to-use control panel. Ideal for mobile professionals and telecommuters who need a high-quality, reliable, portable printer they can take virtually anywhere\nPaper sizes supported: Letter, legal, statement, executive, envelopes (No. 10, Monarch, 6 3/4 in), cards (3x5 in, 4x6 in, 5x8 in), photo (8x10 in, 5x7 in, 4x6 in, 3.5x5 in)\nOne-year limited hardware warranty backed by HP Customer Care, service and support; one-year technical phone support', 'Printer Output Type Color\nColor Black\nPrinting Technology Inkjet\nBrand HP\nPrinting Media Type Envelopes, Paper (plain), Card stock, Labels, Glossy photo paper, High-resolution paper', '299.89', '305.89', 'en', 782),
