(781, 'Intel Core i7-9700 Desktop Processor 8 Cores up to 4.7 GHz LGA1151 300 Series 65W', 'Brand Intel\nCPU Model Core i7\nProcessor Speed 3 GHz\nProcessor Socket LGA 1151\nProcessor Count 88 Cores /8 Threads\nUp to 4.7 GHz. Bus Speed = 8 GT/s. Cache = 12 MB Intel Smart Cache. Max Memory bandwidth = 41.6 GB/s\nCompatible with Intel 300 Series chipset based motherboards\nBios update may be required for motherboard compatibility\nSupports Intel Optane memory\nCompatible Product Name:Intel Q370 Chipset,Intel B365 Chipset,Intel B360 Chipset,Intel H370 Chipset,Intel H310 Chipset,Intel Z390 Chipset,Intel Z370 Chipset', 'Brand Intel\nCPU Model Core i7\nProcessor Speed 3 GHz\nProcessor Socket LGA 1151\nProcessor Count 8', '263.99', '269.27', 'en', 784),
(782, 'Verbatim DVD+R DL 8.5GB 8X with Branded Surface - 20pk Spindle', '20 high-grade non-rewritable DVD+R discs with a one hundred year archival life; OEM drive certified\nAdvanced AZO recording dye optimizes read/write performance and is supported by high speed double layer writers.\nBlazing speeds up to 10X allow for 8.5GB files to record in approximately 12-15 minutes and store 4 hours of DVD quality television and video\nIdeal for archiving home movies. Compatible with most DVD-R and DVD+R drives including Pioneer, Apple, Sony, Dell, LG, HP, Lenovo and others\nVerbatim has been a leader in data storage technology since 1969, and guarantees this product with a limited lifetime warranty and technical support', '', '22.97', '23.43', 'en', 785),
(783, 'FIFA 20 Standard Edition - PlayStation 4', 'This year FIFA 20 brings two sides of The World’s Game to life, the prestige of the professional stage and an all-new authentic street soccer experience in EA Sports Volta\nEA Sports Volta takes soccer back to the streets representing the authentic culture, creativity and style\nIn EA Sports Volta, you can build your character, express your style, and play various forms of free flowing soccer in environments all over the world\nBuild your dream squad from thousands of players and compete in FIFA 20 ultimate team, the most popular mode in FIFA\nExperience Soccer Intelligence, an unprecedented platform of game play realism that puts you at the centre of every match in FIFA 20', '', '21.0', '21.42', 'en', 786),
