(787, 'Victorinox Swiss Army Classic SD Pocket Knife, Yellow, 58mm', 'Brand Victorinox\nColor Yellow\nItem Dimensions LxWxH 2.28 x 0.71 x 0.35 inches\nItem Weight 0.7 Ounces\nBlade material Stainless SteelA CUT ABOVE THE REST: Compact, agile and ready to face any adventure head-on. Our range of Swiss Army Knives have been established since 1897 and continue to be an icon of utility and smart design.\nDURABLE CONSTRUCTION: Swiss made stainless steel construction encased in our popular scales offers a slimmer profile and is extremely resistant.\nCOMPACT CARRY: Bring this knife with you on your daily adventures without sacrificing space. It makes a great gift for any occasion or stocking stuffer for Christmas.\nFIT FOR ALL TASKS: At their heart, all our pocket knives are a survival tool; multitaskers that deliver in any situation. At their most evolved they have surpassed basic function to pioneer space travel and restart engines.\nTRUSTED QUALITY: Made in Switzerland; Victorinox provides a lifetime guarantee against defects in material and workmanship. Making a lifetime commitment has never been so easy. No assembly required, money back guarantee.\nPRODUCT DETAILS: Swiss made pocket knife with 7 functions. Height: 0.4 in, Length: 2.3 in., Weight: 0.7 oz., MM: 58mm, Scale Material: ABS/Cellidor\nFUNCTIONS: small blade, scissors, nail file, screwdriver 2.5 mm, key ring, toothpick, tweezers', 'Brand Victorinox\nColor Yellow\nItem Dimensions LxWxH 2.28 x 0.71 x 0.35 inches\nItem Weight 0.7 Ounces\nBlade material Stainless Steel', '17.31', '17.66', 'en', 790),
(788, 'Bose Wave SoundTouch Music System IV, works with Alexa - Platinum Silver', 'Brand Bose\nColor Platinum Silver\nSpeaker Type Wireless\nControl Method Voice\nItem Weight 14.55 PoundsWorks with Alexa for voice control (Alexa device sold separately), Power Cord 8 feet\nEnjoy all your music easily: online music services, Internet radio, your stored music library, CDs and AM/FM radio\nExclusive Bose waveguide speaker technology delivers lifelike, room filling sound\nWireless connection via your home Wi Fi network; also works with Bluetooth. Supported audio formats: MP3, WMA, AAC, FLAC, Apple Lossless. Wireless network compatibility 802.11 b/g/n\nOne touch access to music services (Amazon Music, Spotify, Pandora), Internet radio and music library playlists with six personalized presets on the remote or SoundTouch app\nAsk away. With the new Bose Skill for Alexa you can now enjoy hands free voice control of your SoundTouch speakers using any Alexa enabled device – like the Echo Dot\nWaveguide speaker technology delivers deep, high performance sound', 'Brand Bose\nColor Platinum Silver\nSpeaker Type Wireless\nControl Method Voice\nItem Weight 14.55 Pounds', '479.0', '488.58', 'en', 791),
