(791, 'Optoma HD28HDR 1080p Home Theater Projector for Gaming and Movies | Support for 4K Input | HDR Compatible | 120Hz refresh rate | Enhanced Gaming Mode, 8.4ms Response Time | High-Bright 3600 lumens', 'Model Name HD28HDR\nHardware Interface Lightning, HDMI\nMounting Type Ceiling mount, table top\nBrand Optoma\nWattage 295 wattsNEXT GENERATION TECHNOLOGY: Enjoy clear detailed 1080p (1920×1080) images (with 4K input) and 50,000:1 contrast ratio renders sharp and detailed images from high definition content without downscaling or compression\nHDR COMPATIBLE: HDR10 technology (with 4K input) enables brigher whites and deeper black levels for an enhanced viewing experience\nHIGH BRIGHT & COLORFUL IMAGE: Enjoy an incredible 4,000 lumens of brightness for lights-on viewing; a 6-segment color wheel (RYGCWB) produces accurate color with sRGB & REC.709 color profile\nFAST RESPONSE TIME: Enhanced Gaming Mode enables lightning-fast response time of 16ms with a 120Hz refresh rate; Game Display Mode boosts shadows and dark scenes for greater visibility of impending obstacles\nMORE IMAGE DEPTH: Dynamic Black technology provides more depth to the image by smoothing lamp output to create high contrast; bright scenes appear clear while dark scenes remain detailed\nMOVIES, GAMING & MORE: Connect to media players and gaming consoles for big screen movies and gaming; connect a 4K UHD HDMI dongle such as the Amazon Fire TV, Google Chromecast, or Apple TV to play games, stream videos and share photos\nLONG LAMP LIFE: Enjoy up to 15,000 hours of lamp life enabling an average of 4 hours of viewing time every day 10+ years', 'Model Name HD28HDR\nHardware Interface Lightning, HDMI\nMounting Type Ceiling mount, table top\nBrand Optoma\nWattage 295 watts', '649.0', '661.98', 'en', 794),
