(806, 'Brother Printer LC3011C Single Pack Standard Cartridge Yield Up to 200 Pages LC3011 Ink Cyan', 'Brand Brother\nColor Cyan\nCompatibility Options OEM\nPage Yield 200Make sure this fits by entering your model number.\nBROTHER GENUINE INK CARTRIDGE: Brother Genuine LC-3011C Single Pack Standard-yield Cyan Ink Cartridge\nYIELDS UP TO 200 PAGES: Excellent inkjet print quality you can consistently rely on for up to 200 pages* for rich, vivid color prints\nSEAMLESS INTEGRATION: Intelligently engineered to work in seamless unison with your Brother inkjet printer\nCOMPATIBLE WITH INKJET PRINTERS: For use with Brother Work Smart Series inkjet all-in-one printers: MFC-J491DW, MFC-J497DW, MFC-J690DW, MFC-J895DW\nAMAZON DASH REPLENISHMENT CARTRIDGE - Upon activation with your Dash-eligible Brother printer, LC3011C replacement cartridges can be automatically ordered through Amazon Dash Replenishment and sent directly to your door\nSave 10% on all ink reorders with Dash Replenishment. Upon activation, your printer measures ink levels and places smart reorders when you are running low. No subscription fees. Cancel anytime', 'Brand Brother\nColor Cyan\nCompatibility Options OEM\nPage Yield 200', '8.49', '8.66', 'en', 809),
