(823, 'Lian Li Strimer RGB PSU Cable', 'Color Black\nBrand Lian Li\nWattage 125 watts\nItem Weight 0.18 Kilograms【Show Yourself】Available in 24 and 8 pin variations, Lian Li power strimers allow for next level chassis customization. Power your motherboard with a unique flare!\n【Two Layers Design】With a two layer design, lighting effects are routed controlled and supplied independently from the 8-pin GPU or 24-Pin motherboard power supply cables.. 24cm in total length.\n【PCI Bracket Controller 】24-pin variant is packaged with a PCI bracket lighting effect controller allowing for simple and easily configurable lighting effect customization. *Only packed with 24-pin variation.\n【Compatibility】Only supports 3-pin 5v addressable LED enabled motherboard. Will not work with 4-pin RGB header. Strimers are 1.5 cm thick and require enough space to be routed properly.\n【We Care】Comes with a limited 1-year warranty and complimentary premium support.', 'Color Black\nBrand Lian Li\nWattage 125 watts\nItem Weight 0.18 Kilograms', '47.99', '48.95', 'en', 826),
