(827, 'Z50 for smartphone, tablet and laptop - Grey', 'Brand Logitech\nColor Grey\nSpeaker Type Speaker System\nSeries Z50 Multimedia Mini Speaker\nItem Weight 260 GramsConnect to multiple devices, such as your smartphone, tablet or laptop\n2.25\" driver produces 5 watts of power for a superior, loud sound\nMove the portable speaker from room to room and play your multimedia. System Requirements: TelevisionComputerSmartphoneTabletMusic player|Television|Computer|Smartphone|Tablet|Music player\nSmall speaker, loud sound: 2; 25-\"driver and 10W of peak power produce surprisingly big sound\nCompact, portable size: Single mini speaker gives you the freedom to play your favorite music around the home\nWorks with multiple devices: Connects to smartphones, tablets and laptops via 3; 5mm jack\nPlug and play simplicity: Super-easy setup; Just plug the speaker into your device and start listening\nNo battery hassles: AC powered so you never have to change or recharge batteries', 'Brand Logitech\nColor Grey\nSpeaker Type Speaker System\nSeries Z50 Multimedia Mini Speaker\nItem Weight 260 Grams', '19.88', '20.28', 'en', 830),
(828, 'KRK Classic 5 Professional Bi-Amp 5\" Powered Studio Monitor', 'Brand KRK\nSpeaker Type Woofer\nMounting Type Floor StandingHigh/Low-frequency controls contour your sound for environment, preference, and music style, and the custom bi-amped, class A/B amp offers large headroom and low distortion\nSoft-dome tweeter with optimized waveguide provides smooth, pristine and articulate highs up to 35kHz\nThe low-resonance enclosure minimizes distortion and color, and the lightweight, glass-aramid composite woofer delivers clear midrange and tight bass\nFlat Low Frequency Adjustment adding versatility and improved accuracy for mixes that translate in different environments\nSuperior low-end extension with optional setting of +2dB KRK Bass Boost acclaimed by music creators worldwide\nFactory installed under-monitor foam pad provides isolation between the speaker and surface for improved clarity\nSystem-optimized auto-limiter prevents unexpected peaks from damaging the speakers while offering consistency and clarity at high volumes', 'Brand KRK\nSpeaker Type Woofer\nMounting Type Floor Standing', '149.5', '152.49', 'en', 831),
(829, 'Pyle Wireless Portable PA Speaker System - 800W High Powered Bluetooth Compatible Indoor & Outdoor DJ Sound Stereo Loudspeaker w/USB SD MP3 AUX 3.5mm Input, Flashing Party Light & FM Radio-PPHP1244B', 'Brand Pyle\nColor Black\nSpeaker Type Subwoofer, Personal, Outdoor\nSpeaker Size 12 Inches\nControl Method Remote800 WATT POWER: This portable high powered full range audio loudspeaker PA system has a maximum power output of 800 watt peak power so you can play your favorite tracks as loud as you want and with style\n12 inch SUBWOOFER 1 inch TWEETER: This compact but powerful portable PA stereo speaker kit is equipped with 12 inch subwoofers, high performance 1 inch tweeters, mic and compression driver w/ FM radio and digital display\nCOMPATIBLE WITH BLUETOOTH: This PA loud speaker is compatible with bluetooth for wireless audio streaming and works with devices like iPhone, android mobile phone, iPad, tablet, PC. Ideal for personal indoor home use or for outdoor DJ party\n4 INPUTS: Equipped with a USB flash drive and SD card reader so it can serve as an MP3 player, 3.5 millimeter AUX input, and ¼ inch microphone input for karaoke. The set is complete with remote control and power adapter\nFLASHING PARTY LIGHT: To complement any party, the PA speaker system is built with a multi color flashing LED party light. It can be controlled by the remote with flashing LED lights bounce mode and pulse to the music beat; 1/4 inch Microphone Input', 'Brand Pyle\nColor Black\nSpeaker Type Subwoofer, Personal, Outdoor\nSpeaker Size 12 Inches\nControl Method Remote', '103.99', '106.07', 'en', 832),
(830, 'Canon EF 50mm f/1.4 USM Standard and Medium Telephoto Lens for Canon SLR Cameras, Fixed', 'Brand Canon\nLens Type Telephoto\nCompatible Mountings Canon EF\nMax Focal Length 50 Millimeters\nMin Focal Length 50 MillimetersMake sure this fits by entering your model number.\nStandard focal length 50 millimeter lens is effective in a multitude of shooting situations and ideal for day-to-day shooting\nElements/Groups: 7/6, Diaphragm: Blades 8, Filter Thread: Font 58 millimeter. Minimum focusing distance: 17.8 inch\nAn f/1.4 maximum aperture provides clear imaging in low light situations and shallow depth of field\nUltrasonic autofocus motor (USM) operation is fast, smooth and virtually silent\n2 high-refraction lens elements and new Gaussian optics eliminate astigmatism and suppress astigmatic difference\nThis large aperture standard prime lens has superior peripheral brightness even at the maximum aperture\nLens Construction: 8 elements in 6 groups, Filter Size: 77mm', 'Brand Canon\nLens Type Telephoto\nCompatible Mountings Canon EF\nMax Focal Length 50 Millimeters\nMin Focal Length 50 Millimeters', '399.0', '406.98', 'en', 833),
(831, 'HTC Vive Cosmos Elite Virtual Reality System', 'Brand HTC\nItem Weight 10.7 Pounds\nPlatform Windows\nOperating System Windows\nDisplay LCDLighthouse tracking - base station 1.0 provides up to 160 sq. Feet of play space for those that demand the best in Vive VR gaming.\nCrystal-clear graphics - see the virtual world through a 2880 x 1700 combined Pixel resolution. All-new LCD panels reduce the distance between Pixels, minimizing the screen-door effect.\nFlip-up design - go easily between reality and virtual reality with the flip-up design, without disrupting your VR journey.\nVive port - Get the most out of VR with Infinity. Enjoy unlimited access to hundreds of VR games, apps, and videos.\nVive reality system - Vive reality system lets you navigate seamlessly between virtual experiences. Discover new content, launch titles from your library, play a video, or browse the web.', 'Brand HTC\nItem Weight 10.7 Pounds\nPlatform Windows\nOperating System Windows\nDisplay LCD', '899.0', '916.98', 'en', 834),
(832, 'SanDisk Ultra 3D NAND 500GB Internal SSD - SATA III 6 Gb/s, 2.5 Inch /7 mm, Up to 560 MB/s - SDSSDH3-500G-G25', 'Brand SanDisk\nType of product 2.5 inches\nDigital Storage Capacity 500 GB\nHardware Interface SATA 6.0 Gb/s\nRead Speed 560 Megabytes Per SecondAccelerate your PC for faster boot-up and blazing-fast gaming and graphics\nUltra-fast: sequential read speeds of up to 560MB/s; sequential write speeds of up to 530MB/s (Based on internal testing; performance may vary depending upon drive capacity, host device, OS and application. 1 megabyte (MB) = 1,000,000 bytes.)\n3D NAND provides greater endurance so your drive lasts longer and uses less power\nNCache 2.0 technology delivers blazing-fast speeds\nLimited 5-year manufacturer warranty or 200TBW, whichever is sooner [US 500GB] (See official SanDisk website for more details regarding warranty in your region.)\nOrder with your Alexa enabled device. Just ask \"Alexa, order SanDisk Internal SSD.\"\nAccelerate your PC for faster boot-up and blazing-fast gaming and graphics', 'Brand SanDisk\nType of product 2.5 inches\nDigital Storage Capacity 500 GB\nHardware Interface SATA 6.0 Gb/s\nRead Speed 560 Megabytes Per Second', '59.99', '61.19', 'en', 835),
(833, 'Puyo Puyo Tetris 2: Launch Edition - PlayStation 5', 'Japan’s beloved puzzle game series Puyo Puyo and the world-renowned Tetris game franchise have teamed up again to deliver even more Puyo-popping and Tetrimino-clearing fun in Puyo Puyo Tetris 2.\nPlaying is easy: match 4 or more same-colored Puyos or complete a line of blocks to clear them from your board and dump Garbage into your opponent’s game. But keep an eye on what’s coming your way too.\nPlay traditional Puyo Puyo and Tetris…or mix them together to level up your game. Offline or online, you’ll have loads of modes that let you play the way you want from single-player Adventure to couch-competition Versus to ranked Online matches, and more.\nBrand-new Skill Battle introduces character-based skills that can quickly turn the tables on a match, plus Item Cards to power up your team.\nBoost your strategy and power your team in Puyo Puyo Tetris 2’s brand-new Skill Battle mode with this pack of rare Item Cards--including 3 special cards featuring items from the Sonic the Hedgehog series!', '', '29.99', '30.59', 'en', 836),
