(884, 'Yamaha YHT-5950UBL 4K Ultra HD 5.1-Channel Wired Home Theater System with Wi-Fi, Bluetooth and Musiccast, Works with Alexa', 'Your Purchase Includes: 1 Wi-Fi enabled home theater in a box system with a music cast AV receiver, 5 wired speakers, a subwoofer and speaker wire in a single package\nClear, powerful 5; 1 Channel surround sound; 4K Ultra HD HDMI (4 in/1 out) with HDR10 and Dolby Vision\nEasy setup with Yamaha YPAO room optimization and flexible speaker placement options, including virtual cinema front\nWi-Fi, Bluetooth, airplay 2, Spotify connect and Music Cast multi room; Music Cast Surround Capable: Add Music Cast 20 speakers to create a 5.1-channel setup with wireless rear surrounds\nAdd Music Cast 20 speakers to create a 5.1-channel setup with wireless rear surrounds (Sold separately)\nSpotify, Pandora, Sirius internet radio, TIDAL, Deeper, Napster and more. System Frequency Response - 28Hz–25kHz. Impedance - 6 ohms (without subwoofer)\n› See more product details', '', '599.95', '611.95', 'en', 887),
(885, 'NBA 2K20 Xbox One', 'Best in class game play: Take your skills to the next level with the most realistic player control ever, featuring an upgraded motion engine with signature styles, advanced shooting controls, a new dribble size up system, refined off ball collisions, and a new read & react defensive game\nMy career: Up and coming visionary Sheldon Candis directs the most visually stunning My career cinematic experience to date; A star studded cast including Idris Elba, Rosario Dawson, and NBA all-stars past and present bring the journey to life in a completely new and immersive way\nWNBA: For the first time, all 12 WNBA teams and over 140 players are in the game and ready to run in play now and season modes; Complete with gameplay animations, play styles, and visuals built exclusively for the women’s game\nFree demo combo guard or stretch five? Glass cleaner or sharpshooter? two weeks before launch, download the free demo to test out the new My player builder and experiment with multiple my player builds before the full game officially tips off\nDynamic Soundtrack: In collaboration with Steve Stout and United Masters, this year’s Soundtrack features a diverse array of top songs from both well-known and up and coming artists from across the globe; As a platform for creativity and discovery, the Soundtrack will be Dynamically updated with new music post launch for the first time ever, from the known and the next generations of top artists', '', '20.99', '21.41', 'en', 888),
(886, 'StarTech.com 1 Port PCI 10/100/1000 32 Bit Gigabit Ethernet Network Adapter Card (ST1000BT32)', 'Brand StarTech\nHardware Interface Ethernet\nOperating System Linux Windows Server 2012 Windows 7 Windows 8 Windows 10 Windows Server 2016 Windows Server 2019\nItem Dimensions LxWxH 4.8 x 0.8 x 2.5 inches\nData Link Protocol IEEE 802.3, Ethernet, Gigabit EthernetCARD\nPCI-based 10/100/1000 Mbps Gigabit Ethernet Network Adapter Card.\nCompatible with IEEE 802.3, 802.3u, 802.3ab and 802.3x standards.\nOperating systems, including Linux, Windows 98SE, ME, 2000, XP, XP-64bit, Vista, Vista-64bit, 7, 7-64bit and Mac OSX', 'Brand StarTech\nHardware Interface Ethernet\nOperating System Linux Windows Server 2012 Windows 7 Windows 8 Windows 10 Windows Server 2016 Windows Server 2019\nItem Dimensions LxWxH 4.8 x 0.8 x 2.5 inches\nData Link Protocol IEEE 802.3, Ethernet, Gigabit Ethernet', '10.99', '11.21', 'en', 889),
(887, 'The Padcaster Parrot Teleprompter Kit, Portable Teleprompter for iPhone', 'ON-THE-GO: Transform your smartphone into a professional, lightweight, and mobile teleprompter. With easy-to-read text displayed on a quality 30R/70T beam splitter glass screen, your video productions will always be professional.\nCOMPATIBILITY: The Padcaster Parrot Teleprompter works with any smartphone and can be mounted to almost any DSLR camera, plus other Padcaster products such as the Padcaster for iPad and Padcaster Verse for smartphones.\nUNMATCHED VERSATILITY: Easily mount The Padcaster Parrot Teleprompter by attaching directly to the lens filter thread of almost any camera. Additional accessories may also be used with the Parrot for more professional results.\nUSER-FRIENDLY TECHNOLOGY: The free Padcaster Parrot app is easy to use with your cell phone and is compatible with both iOS and Android.\nWIRELESS SOLUTION: The Padcaster Parrot Teleprompter comes with a Bluetooth Remote so you can pause, play, and adjust speed remotely.', '', '99.0', '100.98', 'en', 890),
(888, 'Bose Portable Smart Speaker — with Alexa Voice Control Built-In, Black', 'Brand Bose\nColor Triple Black\nConnections Bluetooth, Wi-Fi, Wired\nModel Name Bose Smart Speaker\nItem Weight 1060 GramsAll-in-one: The most versatile smart speaker from Bose; a portable Bluetooth speaker, a home speaker, and a voice control speaker with 360 degrees of deep, clear, lifelike sound and powerful bass\nPortability: Grab the handle and take this lightweight (just over 2 lbs) speaker wherever you go out of the house, or move it with you from room to room around the house\nRugged and ready: This portable speaker has a durable design, battery life of up to 12 hours, and a water-resistant IPX4 rating for all life’s drops, bumps, sprays, and splashes\nBluetooth speaker: Outside Wi-Fi range, use it as a portable Bluetooth speaker and control it with your mobile phone or tablet to listen to anything your device can play\nSmart speaker: Within Wi-Fi range, control the speaker with your voice and use it as an Amazon Alexa speaker or your Google Assistant speaker to play integrated music services like Amazon Music, Spotify, and Pandora\nMake or take calls: With Alexa only, make or take calls from this portable speaker to Bose smart products, Amazon Echo products, and anyone in your contacts list. Hands free, phone free, and free of charge.\nCompatible products: This Bluetooth speaker is part of the Bose Smart Home Family and works with other Bose smart speakers and soundbars for a multi-room listening experience', 'Brand Bose\nColor Triple Black\nConnections Bluetooth, Wi-Fi, Wired\nModel Name Bose Smart Speaker\nItem Weight 1060 Grams', '349.0', '355.98', 'en', 891),
(889, 'Wacom Cintiq Adjustable Stand', 'Color Black\nBrand Wacom\nItem Dimensions LxWxH 12.2 x 7.9 x 2.2 inches\nItem Weight 1.45 PoundsVariety of tilt angles from 19-68°\nAnti-slip base for stability in use\nIncludes VESA FDMI (mis-d75) for use with a Display arm\nCompatible with Wacom Cintiq 16 (dtk-1660), not compatible with Wacom Cintiq Pro 13, 16, 24 or Cintiq 22 (DTH-1320, DTH-1620, dth-2420, dtk-2420, dtk-2200)', 'Color Black\nBrand Wacom\nItem Dimensions LxWxH 12.2 x 7.9 x 2.2 inches\nItem Weight 1.45 Pounds', '79.95', '81.55', 'en', 892),
