(892, 'AVerMedia Live Gamer Ultra – 4Kp60 HDR Pass-Through, 4Kp30 Capture Card, Ultra-Low Latency for Broadcasting and Recording PS4 Pro and Xbox One X, USB 3.1 (GC553)', '4Kp60 High Dynamic Range (HDR) Pass-through (For 4K, HDR or High frame rate recording only NVIDIA graphics card are supported.)\nHigh Refresh Rate Pass-through at Full HD up to 240Hz; 4Kp60 / 1440p144 / 1080p240\nMax Recording: 4Kp30 / 1440p60 / 1080p120 / 1080p60HDR\nUltra low latency: enjoy playing uncompressed video straight on their PC monitor with virtually no latency\nPlug and play right out of box. Mac system requirement - Operating System :Windows 10 (64bits) (Support UVC Protocol),MacOS High Sierra 10.13\nCyber link Power Director 15 included for 4K video editing\nRecommended to use with Intel chipset.', '', '229.84', '234.44', 'en', 895),
(893, 'eneloop Panasonic K-KJS1MCA2BA D Size Battery Adapters with eneloop AA 2100 Cycle Ni- MH Pre-Charged Rechargeable Batteries, 2 Pack with 2\"D Adapters', 'Brand Eneloop\nVoltage 1.2 Volts\nItem Dimensions LxWxH 1.38 x 4.75 x 8 inches\nBattery Cell Type NiMHRecharge up to 2100 times\nMaintain up to 70% of their charge after 10 years (when not it use)\n2000mAh type, 1900mAh min, Ni-MH pre-charged rechargeable battery\nD size spacers allow eneloop AA batteries to be used as D cell batteries\nNo memory effect - batteries can be recharged when fully, or partially discharged', 'Brand Eneloop\nVoltage 1.2 Volts\nItem Dimensions LxWxH 1.38 x 4.75 x 8 inches\nBattery Cell Type NiMH', '7.99', '8.15', 'en', 896),
(894, 'DOOM Eternal: Standard Edition - Xbox One', 'Gain access to the latest demon-killing Tech with the DOOM Slayer\'s advanced praetor suit, including a shoulder-mounted flamethrower and the retractable wrist-mounted DOOM Blade\nUpgraded guns and mods, such as the Super shotgun\'s new distance-closing meat hook attachment, and abilities like the double Dash make you faster, stronger, and more versatile than ever\nYou can\'t Kill demons when you\'re Dead, and you can\'t stay alive without resources. These tools are the key to your survival and becoming the ultimate demon-slayer\nA new class of (destructible) demon\nBattle mode is the new 2 versus 1 multiplayer experience built from the ground up at id software', '', '28.94', '29.52', 'en', 897),
(895, 'Crucial Ballistix 3200 MHz DDR4 DRAM Laptop Gaming Memory Kit 16GB (8GBx2) CL16 BL2K8G32C16S4B', 'Ideal for laptop gamers and performance enthusiasts\nEngineered for the latest AMD and Intel platforms\nXMP 2 0 support for automatic overclocking or run at JEDEC default profile\nHigh-quality extruded aluminum heat spreader for max heat dissipation and thermal management', '', '69.99', '71.39', 'en', 898),
(896, 'Victorinox Swiss Army Junior 9 Pocket Knife, Red, 85mm', 'Brand Victorinox\nColor Red\nItem Dimensions LxWxH 3.31 x 0.5 x 0.75 inches\nItem Weight 1.3 Ounces\nBlade material Stainless Steel\nBlade edge Compound BevelA CUT ABOVE THE REST: Compact, agile and ready to face any adventure head-on. Our range of Swiss Army Knives have been established since 1897 and continue to be an icon of utility and smart design.\nDURABLE CONSTRUCTION: Swiss made stainless steel construction encased in our popular scales offers a slimmer profile and is extremely resistant.\nCOMPACT CARRY: Bring this knife with you on your daily adventures without sacrificing space. It makes a great gift for any occasion or stocking stuffer for Christmas.\nFIT FOR ALL TASKS: At their heart, all our pocket knives are a survival tool; multitaskers that deliver in any situation. At their most evolved they have surpassed basic function to pioneer space travel and restart engines.\nTRUSTED QUALITY: Made in Switzerland; Victorinox provides a lifetime guarantee against defects in material and workmanship. Making a lifetime commitment has never been so easy. No assembly required, money back guarantee.\nPRODUCT DETAILS: Swiss made pocket knife with 8 functions. Height: 0.7 in, Length: 3.3 in., Weight: 2.0 oz., MM: 85mm, Scale Material: ABS/Cellidor\nFUNCTIONS: key ring, toothpick, tweezers, large blade with rounded tip, nail file, nail cleaner, Phillips screwdriver 1/2, wood saw', 'Brand Victorinox\nColor Red\nItem Dimensions LxWxH 3.31 x 0.5 x 0.75 inches\nItem Weight 1.3 Ounces\nBlade material Stainless Steel\nBlade edge Compound Bevel', '26.86', '27.4', 'en', 899),
(897, 'weBoost Drive Reach (470154) Vehicle Cell Phone Signal Booster | Car, Truck, Van, or SUV | U.S. Company | All U.S. Networks & Carriers -Verizon, AT&T, T-Mobile, Sprint & More | FCC Approved', 'OUR MOST POWERFUL VEHICLE BOOSTER — With 74% farther range than the weBoost Drive X, the weBoost Drive Reach signal booster offers fewer dropped calls, better voice quality, faster mobile internet, improved audio and video streaming, and greater hotspot capability even in the most remote areas\nCARRIER COMPATIBILITY — With multi-user functionality, every passenger can enjoy stronger cell signal from Verizon, AT&T, Sprint, T-Mobile, U.S. Cellular and all wireless networks\n5G READY — weBoost products will continue to boost cell signal for the next decade and beyond in a 5G world\nLONGER BATTERY LIFE — The Drive Reach provides stronger cell service with less battery power consumption for up to 2 hours of additional talk time\nTOOL-FREE INSTALLATION — Includes a user-friendly guide to help ensure quick, easy, and hassle-free setup in any type of car, truck, van, or SUV\nPROUDLY AMERICAN — The only booster designed, assembled, and tested in the USA: Our products are not manufactured in China\nFCC APPROVED — The weBoost Drive Reach meets all FCC guidelines and won’t interrupt or harm any carriers’ signals to and from the cell tower', '', '499.54', '509.53', 'en', 900),
(898, 'Mogami Gold INSTRUMENT-10 Guitar Instrument Cable, 1/4\" TS Male Plugs, Gold Contacts, Straight Connectors, 10 Foot', 'Compatible Devices Tablet\nColor Black\nBrand Mogami\nConnector Gender MaleMogami GOLD INSTRUMENT Guitar Instrument Cables provide crystal-clear tone and a drop-dead silent background. The top choice for wiring professional recording studios for decades, Mogami Gold Instrument Cables exhibit amazing clarity and preserve the unique personality of your instrument and effects.\nEngineered for the highest level of transparency, Mogami Gold Instrument Cables are constructed with a conductive polymer sub-shield, an Ultra High Density (UHD) spiral shield, and an oxygen-free copper (OFC) core. For musicians on the move, Mogami Gold Instrument Cables are also designed with a carbon impregnated PVC anti-static shield layer to prevent all handling noise.\nWired with Mogami Guitar/Instrument High Impedance Cable, Mogami Gold Instrument Cables feature high definition sound ideal for use with acoustic guitar, electric guitar, bass guitar, keyboard, pedal effects, and other unbalanced instrument cable applications.\nThis Mogami GOLD INSTRUMENT-10 Guitar Instrument Cable is a 10 foot length. The Mogami GOLD INSTRUMENT Guitar Instrument Cable series is also available in 3, 6, 18, and 25 foot lengths.\nMogami Lifetime \"No Excuses\" Warranty: all brand new Mogami cables include Mogami\'s Limited Lifetime \"No Excuses\" Warranty to the original purchaser and are proudly supported by Mogami and their dedicated network of Authorized Resellers. Please reference the entirety of Mogami Cable\'s Limited Lifetime \"No Excuses\" Warranty specification for complete details.', 'Compatible Devices Tablet\nColor Black\nBrand Mogami\nConnector Gender Male', '55.95', '57.07', 'en', 901),
(899, 'Rock-N-Roller R2RT (Micro) 8-in-1 Folding Multi-Cart/Hand Truck/Dolly/Platform Cart/26\" to 39\" Telescoping Frame/350 lbs. Load Capacity, Black', 'Instantly transforms into 8 different shapes, replacing 8 different cart types\nCarries huge amounts of equipment yet folds small for storage\nR-Trac tires ride smoothly with excellent traction, like pneumatic tires without the hassle of upkeep or repair\nTextured, powder coated steel is durable and also reduces slippage during transport\nFeatured in college engineering textbooks for its outstanding design. Polypropylene Hub with Polyurethane Foam tires', '', '89.64', '91.43', 'en', 902),
(900, 'ViewSonic VX3276-2K-MHD 32 Inch Frameless Widescreen IPS 1440p Monitor with HDMI DisplayPort and Mini DisplayPort', 'Standing screen display size 32 Inches\nResolution QHD Wide 1440p\nDisplay Technology LCD\nBrand ViewSonic\nSeries VX3276-2K-MHDFORM & FUNCTION: With ultra-slim frameless design, QHD (2560x1440p) resolution, and premium IPS panel, this monitors look as good as it performs\nAMAZING AT ANY ANGLE: IPS panel ensures stunning views no matter your vantage point\nENHANCED VIEWING COMFORT: Flicker-Free technology and Blue Light Filter for all-day comfort. Compatability - PC - Windows 7, Windows 8, Windows 8.1, Windows 10 certified. Mac - Power Mac tested\nFLEXIBLE CONNECTIVITY: The VX3276-2K-MHD supports laptops, PCs, and Macs with HDMI, DisplayPort, and Mini DisplayPort inputs\nINDUSTRY-LEADING WARRANTY: 3-year coverage with access to our US-based customer service team\nINCLUDED IN THE BOX: LCD Monitor, Power Cable, HDMI Cable', 'Standing screen display size 32 Inches\nResolution QHD Wide 1440p\nDisplay Technology LCD\nBrand ViewSonic\nSeries VX3276-2K-MHD', '279.99', '285.59', 'en', 903),
(901, 'GoPro Dual Battery Charger + Battery (MAX) - Official GoPro Accessory', 'Brand GoPro\nBattery Weight 30 Grams\nItem Dimensions LxWxH 1.5 x 1.81 x 2.6 inches\nReusability Rechargeable\nItem Weight 0.32 PoundsConveniently charges two max batteries using a USB port\nOptimizes charging so you’ll get a fully charged battery as quickly as possible\nDual LED lights display charging status of both batteries', 'Brand GoPro\nBattery Weight 30 Grams\nItem Dimensions LxWxH 1.5 x 1.81 x 2.6 inches\nReusability Rechargeable\nItem Weight 0.32 Pounds', '69.0', '70.38', 'en', 904),
(902, 'Canon Image CLASS D1620 Multifunction, Monochrome Wireless Laser Printer with AirPrint (2223C024)', 'Printer Output Type Monochrome\nPrinting Technology Laser\nBrand Canon\nPrinting Media Type Paper (plain)\nConnections Wireless, USB, NetworkableMonochrome print up to 45 ppm\nPrint up to 8 1/2 x 14 inches\n2,300 sheet maximum paper capacity. Operating temperature 50 to 86 degree fahrenheit\nThree year limited warranty standard; Typical Energy Consumption: 0.47 kWh\nCommunication Protocol: File: FTP, SMB; Email/iFax:: SMTP, POP3, iFax (Simple). Power consumption maximum approximate 1390 watts\nSave 10% on all ink reorders with Dash Replenishment. Upon activation your printer measures ink levels and places smart reorders when you are running low. No subscription fees. Cancel anytime.', 'Printer Output Type Monochrome\nPrinting Technology Laser\nBrand Canon\nPrinting Media Type Paper (plain)\nConnections Wireless, USB, Networkable', '299.99', '305.99', 'en', 905);
