(903, 'StarTech.com 1ft DVI Splitter Cable - M / F - DVI-D to 2x DVI-D Dual Video Splitter for Your Split Screen Computer Monitor (DVISPL1DD), Black', 'connector-type Coaxial\nBrand StarTech\nWarranty Type LifetimeSPLIT SCREEN FUNCTIONALITY: Connect two DVI-D displays simultaneously to a single DVI-D video source with this 1ft DVI to DVI splitter.\nHIGH QUALITY CONNECTORS: This DVI Y shaped splitter cable is designed with molded gold plated connectors with strain relief to provide a high quality and consistent connection.\nFLEXIBLE CONNECTION: This 1ft DVI-D splitter offers 12\" in cable length and removes strain from the DVI-D connectors and reduces the potential of blocking other available ports.\nVERSATILE MONITOR SPLITTER: Mirror two identical DVI-D displays from a single DVI-D video source, enabling you to have a 2 way dual monitor or split screen setup.\nLIFETIME WARRANTY: Constructed of high quality materials, this DVI dual video splitter cable is backed by a StarTech.com lifetime warranty and free lifetime support.\nCompatible devices: CD TV, LCD Projectors, Plasma TV, HDTV and DVD Player and set-top box.', 'connector-type Coaxial\nBrand StarTech\nWarranty Type Lifetime', '10.14', '10.34', 'en', 906),
