(947, 'Sekonic L-308X-U Flashmate Light Meter (401-305)', 'Exposures accurate down to a tenth-of-a-stop for both ambient and electronic flash light readings in full-stop mode.\nAt ISO 100 the ambient EV range is 0 to 19.9 flash f/stops range from f/1.0 to f/90.9 with a shutter-speed span of 60-seconds to 1/8000th-of-a-second (1 sec to 1/500th for flash).\nPhoto Mode: for still image photographers featuring shutter or aperture priority display of a full range of ambient and flash functions including cord and cordless flash measurement\nHD Cine Mode: perfect for DSLR and mirrorless videographers who need to take exposure readings and control light using shutter speeds and frame rates\nCine Mode: designed for use with cinema grade cameras, allows users to select from the most useful frame rates and shutter angles for exposure control with one-tenth stop accuracy.\n› See more product details', '', '219.0', '223.38', 'en', 950),
(948, 'POLAR VANTAGE M –Advanced Running & Multisport Watch with GPS and Wrist-based Heart Rate (Lightweight Design & Latest Technology)', 'Brand POLAR\nColor Black\nItem Dimensions LxWxH 3.35 x 3.74 x 4.92 inches\nItem Weight 1.6 OuncesULTRA-LONG BATTERY LIFE : The Polar Vantage M Advanced GPS Running & Multisport Watch lasts for up to 30 hours of training time.\nPOLAR PRECISION PRIME HEART RATE : Polar’s heart rate monitor watches redefine the gold standard in optical heart rate accuracy by combining the latest in bio-impedance electrodes and optical sensors.\nTRAINING LOAD PRO: The Vantage M is the ultimate fitness tracker, separating cardio load, muscle load and perceived load. Polar’s Training Load Pro provides an unparalleled look into how your training affects your body\nSWIM/BIKE/RUN FUNCTIONALITY : As a waterproof watch, long-distance running watch and biking activity tracker combined, you can capture key metrics like swimming stroke and pace. You can even pair with your favorite compatible cycling accessory.\nPERSONALIZE WITH YOUR OWN STYLE : With customizable fitness band options, tailor your Vantage M with replaceable wrist bands of multiple colors.', 'Brand POLAR\nColor Black\nItem Dimensions LxWxH 3.35 x 3.74 x 4.92 inches\nItem Weight 1.6 Ounces', '255.90', '0', 'en', 951),
