(1078, 'Summer Baby Pixel Cadet Video Baby Monitor with 4.3-Inch Color Display, Remote Steering Camera – Baby Video Monitor with Clearer Nighttime Views and SleepZone Boundary Alerts', 'ADDED PEACE OF MIND - When baby sleeps well, the whole family sleeps well! The Summer Baby Pixel Cadet Video Baby Monitor brings a greater level of peace of mind right into the hands of parents, so everyone sleeps better.\nSET A VIRTUAL BOUNDARY – With SleepZone Virtual Boundary, you can set a boundary box around a selected area and be alerted on the video monitor when your child exits their safe space. You can also purchase more cameras to monitor up to 4 rooms total.\nBETTER VIEW OF BABY – The remote camera steering pans left to right and tilts up and down, so you always have the perfect view! Plus, the 4.3” handheld monitor has temperature display, 3-level zoom, wall mount hardware and up to 1,000-ft range.\nVOICE-ACTIVATION – When baby wakes during the night and cries, babbles or fusses, the voice activated video on/off technology (VOX) auto-wakes the infant monitor screen display, so you can quickly and easily see your little one.\nOTHER FEATURES – Lullabies, white noise, automatic night vision, 100% digital technology, two-way talk back, handheld portability, rechargeable batteries, kickstand, sound activated LED lights, one-touch video on/off, low battery & out of range indicators\n› See more product details', '', '117.71', '120.06', 'en', 1081),
(1079, 'Optoma UHD30 True 4K UHD Gaming Projector | 16ms Response Time with Enhanced Gaming Mode | Lowest Input Lag on 4K Projector | 240Hz Refresh Rate | HDR10 & HLG', 'TRUE 4K ULTRA HD: Experience high-quality home cinema feel with 4K Ultra HD with 8.3 million distinct addressable on-screen pixels\nLAG-FREE GAMING: Introducing the ultra-fast 240Hz gaming projector enabling blur-free visuals and unparalelled smoothness––combined with Enhanced Gaming Mode to produce a 16ms response time, or 26ms at 4K UHD for the lowest input lag on a 4K projector\nHDR & HLG COMPATIBLE: Enjoy brighter whites and deeper black levels for an enhanced viewing experience of images and videos, enabled by HDR10 & HLG technologies\nCRISP, COLORFUL PICTURE: UltraDetail technology ensures enhanced image sharpness with a higher frame rate to deliver a crystal clear picture; RGBWRGBW 8 segment color wheel increases the color ratio for richer, vivid and cinematic image\nDYNAMIC BLACK: Dynamic Black technology provides more depth to the image by smoothing lamp output to create a high contrast ratio (500,000:1); bright scenes appear clear while dark scenes remain detailed\nEASY IMAGE SETUP: Whether ceiling mounted or placed on a table, get the picture just right with 1.1x zoom and ±40° keystone correction\nULTRA-BRIGHT: Enjoy 3,400 lumens of brightness in your home theater room, family room, gaming room – or even outdoors for backyad movie nights', '', '1299.0', '1324.98', 'en', 1082),
(1080, 'On-Stage QK-2B Quik-Release Microphone Clip Adapter, Black', 'Instantly connect or disconnect your mic clip or boom from your stand\nEasy to use quik-release push button\nShock absorbing rubber washer\nStandard 5/8-27\" Threading at both ends\nBlack color', '', '6.99', '7.13', 'en', 1083),
