(1082, 'Crimson Trace CMR-208 Universal Rail Master Tactical Light with 2 Mode Flashlight and Instant Activation for Pic Rail Mounts, Shooting, Competition and Range', 'BRIGHTNESS: Features a 420 (high), 110 (low) lumen white LED flashlight with a broad beam for maximum versatility\nRUNTIME: 1.5 hours of battery life that runs on (1) CR123 lithium battery (included) with Constant On, Momentary On and Strobe modes\nEASE OF USE: Soft press the paddles for momentary on or hard press to turn off/on\nVERSATILITY: Can be used on most pistols, rifles, and shotguns with M1913 Picatinny or similar accessory rail & 1-1/16\" between the recoil lug and the trigger guard\nDURABLE: Constructed of anodized aluminum for water resistance and long term use\nGUARANTEED: This product is covered by a 1-Year Limited Warranty. For questions or warranty contact us at support@crimsontrace.com', '', '70.27', '71.68', 'en', 1085),
