(1084, 'Shure EABKF1-10M Foam Sleeves for E3c, E4c, E5c, E500PTH, i3c, i4c and SE Earphones, Black,Medium', 'Brand Shure\nColor Black\nItem Weight 0.06 PoundsIncludes 5 pairs of Black Foam Sleeves (Medium) to replace foam sleeves for Shure Sound Isolating Earphones.\nCompatible with: E1, E3, E4, E5, SCL3, SCL4, SCL5, SE110, SE210, SE310, SE420, SE530, SE115, SE215, SE315, SE425, SE535, SE846.\nLegendary Shure quality to withstand the rigors of everyday use.\nNOT Compatible with SE102MPA.', 'Brand Shure\nColor Black\nItem Weight 0.06 Pounds', '11.79', '12.03', 'en', 1087),
(1085, 'APC UPS BR1500MS, 1500VA Sine Wave UPS Battery Backup & Surge Protector, AVR, (2) USB Charger Ports, Back-UPS Pro Uninterruptible Power Supply Black', '1500VA / 900W Backup Battery power supply\nSinewave UPS optimizes performance for high-end electronics (see video on the left). Ideal battery backup for computer.\n10 Outlets (NEMA 15-15R): 6 Battery backup with up surge protection, and 4 Surge-protection only. PLUS, (1) USB-C Charging port, and (1) Type-A USB charging port (15W combined)\nAutomatic Voltage Regulation (AVR) instantly corrects low/high voltage fluctuations, and is Active PFC compatible\n6\' Power Cord, space saving right-angle NEMA 15-15P wall plug. Plus FREE PowerChute power-management software for Windows PC (Mac OS uses native \'Energy Saver\' in settings)\nBacked by APC\'s 3 YEAR WARRANTY, plus a $250,000 connected-equipment policy', '', '214.99', '219.29', 'en', 1088),
(1086, 'FLIR TG165 - Spot Thermal Camera - with 2-Meter Drop Durability for Your Toughest Jobs', 'Brand FLIR\nMaterial Standard\nItem Dimensions LxWxH 8.3 x 2.5 x 3.2 inches\nItem Weight 4.5 PoundsItem is a Class II laser product, 1mW power output. Minimum focus distance 4 inch. Focus free. Object temperature range: –25 to +380°C (–13 to +716°F). Minimum measurement distance 10 inch\n100,000 hours. Operating Temperature Range-(-10°C) to 45°C (14°F to 113°F). Humidity (Operating and Storage)- 0-90% RH (0-37°C (32-98.6°F)), 0-65% RH (37-45°C (98.6-113°F)), 0-45% RH (45-55°C (113-131°F))\nIntuitive to operate with no special training required, and featuring a safe 24:1 spot size ratio for safer distance measuring.Image Frequency:9 Hz\nEasily save images and data to the included 8GB micro SD card for documentation; Tripod Mounting: 1/4 Inches-20 on handle bottom\nDownload images fast over USB with included cable or from removable micro SD; Storage Temperature Range: 30 to +55°C ( 22 to 131°F)\nCompact and durable to easily stow in a crowded tool bag, and covered by 2 years product, and 10 years Thermal Imaging Detector\n› See more product details', 'Brand FLIR\nMaterial Standard\nItem Dimensions LxWxH 8.3 x 2.5 x 3.2 inches\nItem Weight 4.5 Pounds', '369.99', '377.39', 'en', 1089),
(1087, 'Photographic Solutions PEC-12 2 oz Photographic Emulsion Cleaner with Dropper Tip', 'New bottle design and size, dropper tip not spray bottle, now 2 oz. size\nPec-12 evaporates almost instantly without affecting the emulsion\nPec-12 intended for use with contemporary, hardened silver-base films (slides and negatives) and papers (color, B&W, fibre, RC)\nPec-12 cleans film or print surfaces of non water-soluble stains, including ball point ink, most permanent ink and finger oil', '', '12.95', '13.21', 'en', 1090),
