(1102, 'GoPro Large Tube Mount (Roll Bars + Pipes + More) (GoPro Official Mount)', 'Color Black\nBrand GoPro\nItem Dimensions LxWxH 3.92 x 2.09 x 3.94 inches\nItem Weight 0.03 PoundsThe hinged, non slip design connects quickly to any 1.4 to 2.5in (3.5 to 6.35cm) diameter tube\nIntegrated base features 360 Degree rotation with 16 secure positions, ensuring the perfect camera angle\nMove your camera between mounts on the fly with the included Vertical Mounting Buckle to enable multiple POVs for more dynamic footage\nDurable construction prevents slipping and breaking and minimizes vibration and camera shake\nNo loose parts to drop or lose', 'Color Black\nBrand GoPro\nItem Dimensions LxWxH 3.92 x 2.09 x 3.94 inches\nItem Weight 0.03 Pounds', '39.0', '39.78', 'en', 1105),
(1103, 'PYRAMID 100ft 18 Gauge Speaker Wire - Copper Cable in Spool for Connecting Audio Stereo to Amplifier, Surround Sound System, TV Home Theater and Car Stereo - RSW18100', '18 GAUGE THICKNESS: This 18-gauge copper speaker wire offers very easily connection for speakers to amplifiers or receivers. The thickness is just enough for resistance and electrical flow without the risk of overheating\nCUT AS DESIRED: The wire can be cut as desired for specific installation needs. If the plastic jacket is removed, the wire can be left bare or use wire crimp accessories to connect to stereo and speakers\nUNDISTORTED SIGNAL: Made with plastic jacket surrounding the speaker wire to help deliver high-quality undistorted signals to and from all of connected audio equipment. This also helps with insulation\nPOLARITY MARK: There’s a red mark outlined on one side of the cable wire. Its purpose is to easily distinguish the polarity and help properly set up any audio stereo, surround sound system, TV home theater and even a car\n100FT CONVENIENT DISPENSE: This very long 100ft speaker wire is neatly wrapped around a hard plastic spool for easy and convenient dispensing. It can be used without hassle and instantly too\n› See more product details', '', '12.49', '12.74', 'en', 1106),
(1104, 'Platinum Tools 100054C Clamshell EZ-Rjpro Hd Crimp Tool', 'Ratcheted, high leverage and stable platform for consistent, repeatable terminations\nPatented \"crimp and trim system\" delivers a clean, flush trim on the extended conductors for all EZ Connectors\nTool steel die head assembly provides 360 degrees of connector support\nFull Surface to surface contact delivers uniform crimp force\nBuilt-in cutter and stripper from flat and round cable\n› See more product details', '', '66.82', '68.16', 'en', 1107),
(1105, 'Fellowes Step File Junior Wire Organizer Rack, 6 Sections, Black (72613)', 'Color Black\nMaterial Metal\nItem Dimensions LxWxH 6.5 x 4.38 x 7.75 inches\nItem Weight 0.06 Pounds\nPlug Profile CountertopIdeal for sorting mail, memos and more\nIncludes 6 stepped sorter compartments\nSteel sorter is 100% recyclable\nProvides open visual access to documents and files\nSix graduated sections for mail, memos, checks, telephone messages\nWire design will not collect dust\nDimension: 4-3/8w x 6-1/2d x 7-3/4h\nColor: Black\n› See more product details', 'Color Black\nMaterial Metal\nItem Dimensions LxWxH 6.5 x 4.38 x 7.75 inches\nItem Weight 0.06 Pounds\nPlug Profile Countertop', '13.19', '13.45', 'en', 1108),
(1106, 'StarTech.com 7.1 USB Sound Card - External Sound Card for Laptop with SPDIF Digital Audio - Sound Card for PC - Silver (ICUSBAUDIO7D)', 'This 7.1 USB sound cards offers a high quality solution for upgrading desktop or laptop sound. Home Theater-Ready Audio Solution Providing a robust USB audio experience, the external sound card for your laptop or PC connects to a host computer through a single USB 2.0 connection, to deliver impressive external audio capability that can instantly be swapped between systems, without having to open the computer case for installation. Cost-Saving Solution Supporting analog and digital audio for 2 to 7.1 channel audio applications, the SPDIF output sound card provides a cost-saving upgrade from built-in/on-board sound that turns desktop/laptop sound into a home theater-ready audio solution. The audio to USB adapter features easy-to-use volume control and two external microphone inputs, for applications requiring high quality sound with multi-input capability with support for 44.1 KHz and 48 KHz sampling rates for analog playback and recording or 48 KHz for SPDIF. Easy Setup A more than suitable solution for home theater, gaming or multi-media presentations, the External USB Sound Card is easy to install with plug and play support in Windows XP and Windows Vista operating systems. The USB stereo audio adapter is backed by our 2-year warranty and free lifetime technical support. Note: The audio adapter’s SPDIF optical pass-through port supports two-channel audio, this port does not support 5.1 or 7.1 audio.\n7.1 Sound card: This 1.7 USB Sound card turns your laptop or desktop PC into a 7.1-channel home theater-ready sound system through a single USB 2.0 connection.\nCost-saving upgrade: With support for analog and digital audio output for stereo to 7.1 channel audio applications, the audio to USB adapter upgrade the existing integrated audio on a laptop or portable computer.\nBuilt-in features: The external sound card features easy-to-use volume control and two external microphone inputs. It also supports 44.1KHz and 48KHz sampling rates for analog playback and recording or 48KHz for SPDIF.\nEasy installation: The digital audio adapter is easy to install with plug and play support in Windows XP and Windows Vista operating systems.\nReliable support: Backed by a 2-year StarTech.com warranty, this 7.1 USB sound card also comes with free lifetime technical support.', '', '32.4', '33.05', 'en', 1109),
(1107, 'Sony TOUGH-M series SDXC UHS-II Card 64GB, V60, CL10, U3, Max R277MB/S, W150MB/S (SF-M64T/T1)', 'Brand Sony\nMemory Type UHS II SD\nColor Black\nHardware Interface SDHC\nSpeed Class Class 10Waterproof (IPX8)/ Dustproof (ipx6)2\nUp to 277MB/s read speed and 150MB/s write speed\nToughness design (18x stronger than standard UHS II card)\nSupports 4K video recording\nFive (5) year limited Warranty', 'Brand Sony\nMemory Type UHS II SD\nColor Black\nHardware Interface SDHC\nSpeed Class Class 10', '39.99', '40.79', 'en', 1110),
(1108, 'Microsoft Surface Pro Signature Type Cover – Ice Blue', 'Features a full mechanical keyset, backlit keys, and large trackpad for precise navigation and control\nSlim and compact, yet performs like a traditional, full-size keyboard\nClicks in place instantly — use in combination with Surface Pro 7 kickstand for a best-in-class laptop experience anywhere.\nLuxurious Alcantara material on select covers is soft and smooth, yet durable and stain resistant\nClose to protect screen and conserve battery, or fold back completely for a take-anywhere tablet', '', '114.98', '117.28', 'en', 1111),
