(1110, 'Shure PGA48-QTR Cardioid Dynamic Vocal Microphone', 'Brand Shure\nPolar Pattern Unidirectional\nColor Black\nConnector Type XLR Connector\nConnections XLR\nItem Weight 1.9 PoundsTailored microphone cartridge design specifically for clarity in the standard frequency range of speech\nCardioid polar pattern picks up audio from the source while rejecting unwanted noise\nUpdated industrial design with black metallic finish and grille featuring classic silver ball grille\nThree available options: (1) with 15-foot XLR-XLR cable, (2) with 15-foot XLR-QTR cable, and (3) without cable\nOn/Off switch for discrete control of microphone operation\nStand adapter for mounting to a microphone stand\nZipper pouch included for additional protection during storage or transport\nLegendary Shure quality design and construction for exceptional performance in rigorous environments', 'Brand Shure\nPolar Pattern Unidirectional\nColor Black\nConnector Type XLR Connector\nConnections XLR\nItem Weight 1.9 Pounds', '39.0', '39.78', 'en', 1113),
(1111, 'Crucial MX500 1TB 3D NAND SATA M.2 (2280SS) Internal SSD, up to 560MB/s - CT1000MX500SSD4', 'Brand Crucial\nDigital Storage Capacity 1 TB\nHardware Interface SATA 6.0 Gb/s\nRead Speed 560 Megabytes Per Second\nWrite Speed 510Make sure this fits by entering your model number.\nSequential reads/writes up to 560/510 MB/s and random reads/writes up to 95k/90k on all file types\nAccelerated by Micron 3D NAND technology\nIntegrated Power Loss Immunity preserves all Your saved work if the power unexpectedly gets cut\nAES 256 bit hardware based encryption keeps data safe and secure from hackers and thieves\nCrucial 5 year Limited Warranty', 'Brand Crucial\nDigital Storage Capacity 1 TB\nHardware Interface SATA 6.0 Gb/s\nRead Speed 560 Megabytes Per Second\nWrite Speed 510', '113.99', '116.27', 'en', 1114),
