(1224, 'Logan Graphics Compact Classic Versatile Portable Mat Cutter Model 301-1', 'This large-capacity precision mat cutting system creates professional beveled mats for all your framing projects.\nBevel cutting head and mat knife for straight cuts as well as a parallel mat guide to maximize cutting potential and options\nOpen ended machine means the length of a cut can be infinite by cutting and sliding the material through the length of the machine. Not limited to 32 inch length cut.\nWorks with standard thickness 4-ply mat board only and uses Logan 270 blades\nIncludes 1 cutting board, mat guide, bevel cutter, straight cut knife and instruction manual', '', '98.99', '100.97', 'en', 1227),
