(1231, 'Brother ImageCenter ADS-2800W Wireless Document Scanner, Multi-Page Scanning, Color Touchscreen, Integrated Image Optimization, High-Precision Scanning, Continuous Scan Mode, Black', 'Memory Card Slot Receipt, Photo, Business Card\nScanner Type Document\nBrand Brother\nModel Name Brother\nConnections USB\nItem Dimensions LxWxH 10.2 x 12.1 x 9.8 inches\nSee moreFAST SCANNING: Scan single and double-sided materials in a single pass, in both black-and-white and color, at speeds of up to 40 pages per minute\nMULTI-PAGE SCANNING FEATURES: Select 2-in-1 mode to capture 11″ × 17″ documents or continuous scan mode to scan unlimited pages into a single file\nFLEXIBLE MEDIA HANDLING: Scan photos, documents, receipts, embossed plastic cards, business cards, and more in color and black and white\nDIRECT SCANNING VIA WIRELESS: The wireless networking with Web Connect allows direct scanning to cloud applications, including Google Drive and more\nOperating system compatibility is windows xp 32-bit only, windows vista, windows 7, windows 8, windows 8.1, windows 10, mac OS X v10.8.x and up and linux\nOUTSTANDING CUSTOMER SUPPORT: Includes a one-year limited warranty and free phone, online and chat technical support for the life of the product', 'Memory Card Slot Receipt, Photo, Business Card\nScanner Type Document\nBrand Brother\nModel Name Brother\nConnections USB\nItem Dimensions LxWxH 10.2 x 12.1 x 9.8 inches\nSee more', '449.98', '458.98', 'en', 1234),
