(1233, 'StarTech.com 6ft Mini DisplayPort to DisplayPort Cable - M/M - mDP to DP 1.2 Adapter Cable - Thunderbolt to DP w/ HBR2 Support (MDP2DPMM6)', 'Compatible Devices Laptop, Monitor, PC\nColor Black\nBrand StarTech\nData Transfer Rate 21.6 Gigabits Per Second4K x 2K RESOLUTION SUPPORT: Create a high-resolution 4K x 2K connection with HBR2 support between your Mini DisplayPort equipped laptop and a standard DisplayPort monitor with this mDP to DP adapter cable.\nBACKWARD COMPATIBLE: Designed and manufactured to DisplayPort 1.2 standards, this mDP to DP cable is also backward compatible with DisplayPort 1.1.\nHIGH TRANSFER SPEEDS: This Mini DisplayPort to DisplayPort cable features support for High Bit Rate 2 (HBR2) bandwidth of up to 21.6 Gbps.\nBROAD COMPATIBILITY: For ultimate convenience, this Mini DisplayPort to DisplayPort adapter cable works with your PC, Mac and Microsoft Surface devices, as well as mDP-equipped computers with Thunderbolt 2 ports.\nLIFETIME WARRANTY: Constructed of high-quality materials, this Mini DisplayPort to DisplayPort 1.2 cable is backed by a StarTech.com lifetime warranty, making it a truly cost-efficient solution.', 'Compatible Devices Laptop, Monitor, PC\nColor Black\nBrand StarTech\nData Transfer Rate 21.6 Gigabits Per Second', '8.85', '9.03', 'en', 1236),
