(1237, 'Acer Chromebook 311 CB311-9H-C12A, Intel Celeron N4000, 11.6\" HD, 4GB LPDDR4, 32GB eMMC, Gigabit WiFi, Bluetooth 5.0', 'Brand Acer\nOperating System Chrome OS\nCPU Manufacturer Intel\nStanding screen display size 11.6 Inches\nRAM 4 GBChromebook runs on chrome OS - an operating system by Google that is built for the way we live today. It comes with built-in virus protection, updates automatically*, boots up in seconds and continues to stay fast over time. (*Internet connection is required).\nAll the Google apps you know and love come standard on every Chromebook, which means you can edit, download, and convert Microsoft Office files in Google Docs, Sheets and slides.\nGet access to more than 2 million Android apps from Google Play to learn and do more.\nChromebooks come with built-in storage for offline access to your most important files and an additional 100GB of Google Drive space to ensure that all of your files are backed up automatically.\nCB311-9H-C12A comes with 11.6” HD Display, Intel Celeron N4000, 4GB LPDDR4 Memory, 32GB eMMC, Google Chrome, up to 10-hours Battery Life\n› See more product details', 'Brand Acer\nOperating System Chrome OS\nCPU Manufacturer Intel\nStanding screen display size 11.6 Inches\nRAM 4 GB', '207.99', '212.15', 'en', 1240),
