(1241, 'X-Rite ColorChecker Passport Video (MSCCPPVC), Black, 4.9 x 0.3 x 3.5 inches', 'Color Black\nStyle Colorchecker Passport Video\nBrand X-Rite\nItem Dimensions LxWxH 4.92 x 3.54 x 0.35 inches\nItem Weight 0.19 PoundsDESIGNED FOR FILMMAKERS: This color tool will help you get a better camera-to-camera match, achieve perfect exposure & easily edit for mixed lighting in a convenient portable protective case. Reduce video editing time & get to your creative look faster\nACCURACY & CONSISTENCY: The Color Checker will help you achieve worry-free color balance that\'s consistently neutral & ideally exposed. Get a better camera-to-camera match & easily edit for mixed lighting, all in a convenient portable protective case.Humidity range- 85% or less, non-condensing.Temperature range for normal use of the case- 32° - 104° Fahrenheit / 0° - 40° Celsius\nIDEAL COLOR BALANCING: The Passport includes 6 chromatic color chips aligned with video production, 6 skin tone chips, 6 gray balance chips, and 6 highlight and shadow chips (including a high gloss black) to enable you to achieve the ideal color balance.\nCONVENIENT & EFFICIENT: The convenient pocket-sized ColorChecker Passport Video target is great for pre-camera checks both in studio & on location. Include it in every shoot to make your video workﬂow faster, more consistent, more balanced & repeatable', 'Color Black\nStyle Colorchecker Passport Video\nBrand X-Rite\nItem Dimensions LxWxH 4.92 x 3.54 x 0.35 inches\nItem Weight 0.19 Pounds', '148.99', '151.97', 'en', 1244),
