(1243, 'Fender 60L 0730880303 Acoustic Guitar Coated Ball End Strings, 12-52', 'Fender dura-tone strings feature brightness and claritywith extra long life.\nThey are an excellent all-purposestring, whose clear, even tones make them the perfectchoice for most styles of acoustic music.\nWe started with our 80/20 bronze strings and addeda specially applied micro-treatment to makeFenderdura-tone strings.\nThis special coating resiststone-killing grime and corrosion, resulting in a stringthat lasts up to five times longer while retaining naturalfeel and clear, full tone.\nBy the way, dura-tone is also an excellent choice forguitars on display that may be subject to humiditychanges or the many hands of numerous players.', '', '10.94', '11.16', 'en', 1246),
(1244, 'ExpoDisc Professional White Balance Filter - 82mm lens thread - Get Beautiful Color in Your Photos and Video, Easy-to-Use, No Software Required, Save Time Fixing Color', 'Brand ExpoDisc\nPhoto Filter Thread Size 82 Millimeters\nPhoto Filter Effect Type Color CorrectingSAVE TIME FIXING COLOR - set a custom white balance to get beautiful color straight from your camera - stop wasting time fixing your color later with software\nEASY TO USE - the ExpoDisc is easier to use than white balance cards, gray cards, and photographic calibration targets - simply attach the ExpoDisc to your lens and set your camera’s custom white balance\nQUICKLY SET WHITE BALANCE - just attach the ExpoDisc to your camera’s lens and follow a few simple steps to set the white balance - in most cameras you can set a custom white balance in just 15 - 20 seconds\nMETER FOR 18% EXPOSURE - ExpoDiscs are individually calibrated to transmit 18% light - this produces a gray frame reference that can be used instead of a photographic gray card to establish an 18% exposure\nMADE IN USA - we care about our products - we assemble, calibrate, and certify every ExpoDisc in California - 1 year warranty', 'Brand ExpoDisc\nPhoto Filter Thread Size 82 Millimeters\nPhoto Filter Effect Type Color Correcting', '49.95', '50.95', 'en', 1247),
