(1248, 'Orbit Card - Bluetooth Wallet Finder - Smart GPS Item Tracker and Locator with Rechargeable Battery - Free iOS & Android Phone App - Works with Alexa - Waterproof', 'Color Black\nStyle Minimalist\nBrand Orbit\nClosure Type Snap\nItem Dimensions LxWxH 3.3 x 2.1 x 0.06 inchesFIND YOUR WALLET: Save yourself the stress of searching for misplaced items. Slip the Orbit inside your wallet so you can find it in seconds just by using your Smartphone. If your Orbit is within range, it will play a loud tune until you locate it.\nFIND YOUR PHONE: Misplaced your phone? Simply press the button on your Orbit Card to make your phone ring even on silent!\nTAKE A SELFIE: Take the perfect selfie or group shot every time. Simply set up your phone, stand back and use the Orbit as a selfie remote. No need for a Selfie Stick.\nLAST KNOWN GPS LOCATION: Want to know the last time and place you had your wallet? Give your memory a break and let the app tell you if you left it somewhere, so you know where to look first.\nRECHARGEABLE BATTERY: No yearly subscriptions and no product wastage! No need to throw out your Orbit Card after the battery runs flat (battery life up of 3 months). The Orbit app will send you a notification that your battery is running low, and using the included charging cable recharge in a couple of hours', 'Color Black\nStyle Minimalist\nBrand Orbit\nClosure Type Snap\nItem Dimensions LxWxH 3.3 x 2.1 x 0.06 inches', '39.95', '40.75', 'en', 1251),
