(1251, 'Yamaha YDP144 Arius Series Piano with Bench, Dark Rosewood', 'Your purchase includes One Yamaha Arius Series, YDP144 model | Bench, 50 Classical Music Masterpieces Book, Owner’s manual & Quick Operation Guide\nPiano dimensions – 53-7/16” W x 32-1/16” H x 16-5/8” | Weight – 83 lbs. | Number of pedals – 3 | Max polyphony – 192 | Number of voices – 10 | Headphones – (2) Standard Stereo phone jack | With Recording and Playback capabilities\nGHS weighted action is heavier in the low keys and lighter in the high keys, just like an acoustic piano\nHalf-damper pedal control allows for continuously increasing amounts of sustain as the pedal is depressed\nThe CFX Premium Grand Piano Voice recreates the power and tone of the flagship CFX concert grand piano from Yamaha\nThe special matte black key tops are designed to absorb moisture and remain tactile after extended use without becoming slippery', '', '1099.99', '1121.99', 'en', 1254),
(1252, 'Audio-Technica ATH-SR30BTBK Bluetooth Wireless Over-Ear Headphones, Charcoal Gray', 'Brand Audio-Technica\nColor Charcoal Gray\nConnections Wireless\nModel Name ATH-SR30BTBK\nHeadphones Form Factor Over EarExceptionally pure audio of sound reality in a wireless design\nInternal battery provides an astounding 70 Hours of continuous use on a full charge\nHousing’s dual-layer isolation structure keeps the electric circuitry separate from the acoustic Space for optimal phase and transient response\nLightweight fold-flat design for easy portability\nMic and controls built into the ear cup for convenient handling of calls music playback and volume adjustment', 'Brand Audio-Technica\nColor Charcoal Gray\nConnections Wireless\nModel Name ATH-SR30BTBK\nHeadphones Form Factor Over Ear', '69.0', '70.38', 'en', 1255),
(1253, 'StarTech.com 2U Vertical Wall Mount Patch Panel Bracket - Steel Rack Mount Bracket w/Hardware for 19\" Network, Server and Data Equipment (RK219WALLV),Black', 'Mounting Type Wall Mount, Ceiling Mount\nBlade Movement Fixed\nBrand StarTech\nMaterial Steel\nColor Black\nMin. Compatible Size 19 Inches\nCompatible Devices TabletsVERSATILE FUNCTIONALITY: This multi-use 2U vertical patch panel bracket enables you to mount your server, data, networking or AV equipment vertically on a wall or horizontally under a desk for added versatility.\nSTURDY DESIGN: Constructed to EIA-310 19in rack standards, the black wall mount patch panel bracket features a solid steel design for ultimate durability. The rack can hold up to 125.3lb (56.7kg) to ensure your equipment is secure.\nNO ASSEMBLY REQUIRED: The open frame, L-shaped rack arrives fully assembled with cage screws for mounting equipment and 1 ½” screws for mounting the rack to wood surfaces. It’s a convenient solution for all your SoHo (small office/home office) rack needs.\nSTANDARDIZED HOLE SIZING: The wall mounting holes on the 2U vertical mountable rack bracket are 16” center to center to provide greater stability and match standard wall studs. It works with most 19” rack mountable equipment for ultimate compatibility.\nINDUSTRY-LEADING SUPPORT: StarTech.com offers a lifetime warranty and free lifetime technical support on this wall mount patch panel bracket, and has been the choice of IT professionals and businesses for over 30 years.', 'Mounting Type Wall Mount, Ceiling Mount\nBlade Movement Fixed\nBrand StarTech\nMaterial Steel\nColor Black\nMin. Compatible Size 19 Inches\nCompatible Devices Tablets', '46.99', '47.93', 'en', 1256),
