(1262, 'Aputure Light Dome II Softbox 35 Inch Deep Octagon Softbox for Aputure 120D Mark 2 300D II 300X 120D 120T and Other Bowen-S Mount Lights', 'Smooth round-shaped hexadecagon light output for beautiful catchlight, best for portraits, interviews, professional filmmaking and facial shots.\n35 inch large outer difuser increases size of beam, which makes a softer and more flattering light, and deep dome design ensures tigher and more focused beam.\nFull silver coating intensifies output strength for more control over light source; unique dual diffuser design ensures even distribution of the light across the entire field.\nWith honeycomb grid add-on help control light spill spread by 40 degrees; with a gel holder for filmmaker to design light colors.\nRe-designed 16 rods of wear-resistant steel construction and features a new generation of the quick-release speed ring, you can now easily install and disassemble the dome.', '', '219.0', '223.38', 'en', 1265),
