(1268, 'Joby JB01571-BWW GorillaPod Starter Kit, Flexible Mini Tripod with Universal Smartphone Clamp, GoPro and Torch Mount Up to 325 g Payload', 'Brand Joby\nMaterial TPE\nMaximum Height 14.7 Centimeters\nMinimum Height 5 Centimeters\nItem Weight 85 GramsThe tripod\'s ball-and-socket design enables you to stand it on any surface or wrap and hold onto any tree branch or railing you can find.\nThe 1/4\"-20 threaded camera mount allows you to thread on a compact camera or other accessories with the same size socket.\nThe flashlight/microphone mount is a spring-loaded grip with TPE rubber pads to hold these accessories with diameters between 18 and 32mm.\nThe smartphone clamp has a Tightening Shock Cord grip that you pull on to hold smartphones with screens up to 6\" and that weigh up to 0. 7 lb.\nThe GoPro mount provides a stable support for an action camera.', 'Brand Joby\nMaterial TPE\nMaximum Height 14.7 Centimeters\nMinimum Height 5 Centimeters\nItem Weight 85 Grams', '25.1', '25.6', 'en', 1271),
