(1271, 'Rode SC6-L Dual TRRS Input Lightning Mobile Interface for Apple iOS Devices', 'ENSURE YOU BUY GENIUNE RØDE PRODUCTS! Products from sellers which say ‘fulfilled by Amazon’ under the price are NOT authorized resellers, and may not be selling genuine product.\nBuy only from Amazon.com (labelled ‘shipped and sold by Amazon.com’)\nDual TRRS input and headphone output for Apple Devices\nCan be used with two RØDE smartLav+ microphones and one pair of headphones, allowing audio monitoring and playback, perfect for interview scenarios\nOptimised to work seamlessly with the easy-to-use RØDE Reporter App; Enable/disable direct monitoring, alter the gain boost, and choose between summed stereo and dual-mono', '', '78.0', '79.56', 'en', 1274),
(1272, 'Eton ARCBB202C-SNG American Red Cross Emergency LED Motion Sensor, LED Flashlight & Multi-Color Nightlight, Soothing Glow, USB Charging, Blackout Buddy Color', 'Color Multicoloured\nStyle Blackout Buddy Color\nLight Source Type LED\nPower Source Battery-powered, Solar-powered\nMaterial PlasticEMERGENCY FLASHLIGHT: Whether you prefer a clean white counter top, a calming blue bedroom, or a cool mint bathroom, this Blackout Buddy Colors is customizable for any area of your home.\nMULTIFUNCTION LED: Fold-up prongs allow you to use the Blackout Buddy as a flashlight anytime, & it features an on/off night light option. Plug it in your wall socket & you’ll never be in the dark!\nSTAY SAFE & HAVE FUN: For over 30 years we\'ve been dedicated to creating award-winning, innovative products for emergency preparedness & entertainment. We\'re a proud partner of the American Red Cross.\nKEEP CONNECTED: From weather alert radios & backup battery packs to solar-powered sound systems, we\'ll keep you connected & in the know at home, in the office, on the road or in the great outdoors.\nETON\'S COMMITMENT TO PREPAREDNESS: We\'re committed to helping you be prepared for everyday fun & unexpected emergency, whether you’re out on a 10-day backpacking trip or barbecuing in the backyard.', 'Color Multicoloured\nStyle Blackout Buddy Color\nLight Source Type LED\nPower Source Battery-powered, Solar-powered\nMaterial Plastic', '14.99', '15.29', 'en', 1275),
(1273, 'B + W 77mm UV Protection Filter (010) for Camera Lens - Xtra Slim Mount (XS-PRO), MRC Nano, 16 Layers Multi-Resistant and Nano Coating, Photography Filter, 77 mm, Clear Protector', 'Brand B + W\nMaterial Glass\nPhoto Filter Thread Size 77 Millimeters\nPhoto Filter Effect Type UltravioletPROTECT YOUR EXPENSIVE CAMERA LENSES - The B + W 77 mm UV haze clear camera filter is here to add 16 multi-resistant nano-coating layers of protection against accidental drops, dust, flying, fingerprints, dirt, scratches sand or seawater spray. Enjoy outdoor photography without worrying about your precious lenses anymore.\nTAKE BLUE CAST OUT OF THE PICTURE - Literally. Whether you are a professional photographer or a beginner, the invisible Ultra-Violet component of light from the sky is a common issue. Our UV-blocking haze protector filter for 77mm lenses will eliminate blue cast and help you snap clearer images.\nXS-PRO MOUNT - Thanks to precise precision manufacturing, B+W sockets fit absolutely accurately and are easy to install. The 77mm narrow XS-PRO mount will eliminate vignetting in most cases, even at high wide-angle shots. The internal thread means that a conventional lens hood can also be fitted.\nCHOOSE YOUR SIZE – To select the appropriate filter size, check your lens. On all lenses from Canon, Nikon, Olympus, Samsung, Fuji and other manufacturers there is a printed diameter symbol that determines the filter size.\nMADE IN GERMANY - Schneider Kreuznach (B + W) – We are proudly your precision mechanics specialists for filters, photography, optics and precision, with more than 100 years of German experience. Schneider products have already been used in NASA\'s Apollo missions. Thanks to our multi-resistant nano coating lens filter, we are helping photographers everywhere take clearer, crisper images.', 'Brand B + W\nMaterial Glass\nPhoto Filter Thread Size 77 Millimeters\nPhoto Filter Effect Type Ultraviolet', '60.98', '62.2', 'en', 1276),
