(1276, 'G-Technology 6TB G-DRIVE USB 3.0 Desktop External Hard Drive, Silver - Compact, High-Performance Storage - 0G03674-1', 'Brand G-Technology\nDigital Storage Capacity 6000 GB\nHardware Interface USB 3.0\nCompatible Devices DesktopHigh speed USB 3.0 for universal, high-speed data transfer\nSolid, stylish all-aluminum case for durability\nWith capacities up to 18TB for multimedia intensive files (Total accessible capacity varies depending on operating environment.)\nTime Machine-ready for easy file back-up\nPlug-and-play on Mac; easily reformatted on Windows\n3-year limited manufacturer\'s warranty', 'Brand G-Technology\nDigital Storage Capacity 6000 GB\nHardware Interface USB 3.0\nCompatible Devices Desktop', '199.95', '203.95', 'en', 1279),
(1277, 'Hercules DJControl Compact', 'The most complete and portable DJ controller; \"On the go\" DJ companion; Measures only 13.4\" x 3.9\" and weighs less than 1.23 pounds; Fits very easily into a bag or laptop shoulder bag; USB bus-powered (detachable USB cable included)\nErgonomics that adapt perfectly to your laptop; All of the essential Djing functionality in an ultra-portable design; Two-deck DJ controller; 2 jog wheels, 2.95\" in diameter; Mixer controls in the center, individual deck controls on the left and right\n4 modes (Loop, Fx, Samples, Cue) per deck; 4 pads per deck; 2 equalization potentiometers per deck; 1 volume potentiometer per deck; 1.77\" crossfader; 10 control buttons including a SHIFT command allowing you to double all the pad controls\nThe essentials of the mix at your fingertips; Scratch as naturally as with a vinyl record with the help of the jog wheels; The jog wheels also control the Pitch and navigation within the tracks\nHighly intuitive features to create Loops, add effects and launch samples thanks to the unrivalled feel of the pads; Includes DJUCED 18 DJ software; Powerful and intuitive software; Mix two audio tracks on the fly; Save your mixes as audio files\nOperating system (32-bit/64-bit): Microsoft Windows Vista/7/8/8.1/10; macOS 10.7/10.8/10.9/10.10 on Mac Core Duo', '', '89.99', '91.79', 'en', 1280),
