(1279, 'StarTech.com USB to Serial Adapter - 1 port - USB Powered - FTDI USB UART Chip - DB9 (9-pin) - USB to RS232 Adapter (ICUSB2321F),Black', 'Brand StarTech\nWarranty Type Limited\nNumber of Ports 1MULTI-USE FUNCTIONALITY: Use this versatile USB to serial RS232 adapter for everything from digital signage to connecting point of sale systems and barcode scanners.\nCUSTOMIZABLE SOLUTION: This USB serial hub features an FTDI chipset, making it highly customizable and compatible, and the ideal solution for any setup.\nCOMPACT DESIGN: Designed with a small form factor, this serial RS232 converter is USB powered and requires no bulky power adapters or an outlet.\nEASY INSTALLATION: This serial adapter lets you enjoy simple installation and operation with COM port retention that provides robust serial connectivity for legacy devices.\nRELIABLE SUPPORT: Backed by a StarTech.com 2-year warranty, this USB to serial RS232 adapter with FTDI has free lifetime technical support.', 'Brand StarTech\nWarranty Type Limited\nNumber of Ports 1', '20.69', '21.1', 'en', 1282),
(1280, 'VELCRO Brand Sticky Back Hook and Loop Fasteners, Perfect for Home or Office, 5/8\", Pack of 15, White, Coins', 'Compatible material Glass, Plastic, Metal\nColor Coins\nBrand VELCRO BrandSCHOOL SUPPLIES FOR TEACHERS AND EDUCATORS - Numerous applications to keep the classroom tidy - fasten items to desks and folders, stick nametags to back the back of chairs. Adhere your whiteboard erasers and markers to the board with our sticky back tape\nBACK TO SCHOOL SUPPLIES FOR STUDENTS - Add closures to your homework folders, hang items and decorate your lockers, add arts and crafts touches to school projects, organize your desk at home and in the classroom\nSUITABLE FOR SMOOTH SURFACES - Sticky Back Coins adhere to most smooth surfaces; features a strong adhesive to organize at home, school, or office; no sewing, gluing or ironing required\nSTRONG AND SECURE HOLD - Creates a long-lasting bond that applies easily to walls, glass, tile, plastic, metal and wood—ideal for everyday use –the possibilities are endless\nPRESS AND SET COINS - Simple to use pre-cut Coins, just clean surface, peel off the protective backing and firmly press against the surface; allow adhesive bond to set for 24 hours to achieve full strength', 'Compatible material Glass, Plastic, Metal\nColor Coins\nBrand VELCRO Brand', '2.89', '2.95', 'en', 1283),
(1281, 'Furman M-8X2 Merit Series 8 Outlet Power Conditioner and Surge Protector', 'AC noise filtering reduces RFI/EMI, Spike & surge protection ensures equipment stays safe & power stays clean,\n15 amp rating with circuit breaker and \"Protection OK\" Front Panel Indicator to let you know that your equipment is being protected\n9 Total outlets: 8 rear panel outlets (including 3 with \"wall wart\" spacing) and 1 front panel convenience outlet\nFiltration rating greater than 23 dB, 200 Khz to 10 Mhz, perfect for instrument rigs, home recording, DJ equipment, pro audio rigs and home entertainment systems\nFurman\'s AC noise filtering reduces RFI and EMI interference to deliver a cleaner sound without pops, crackles and the local radio station coming out of your amp', '', '79.0', '80.58', 'en', 1284),
(1282, 'Mackie Mix Series, 8-Channel Compact Mixer with Studio-Level Audio Quality (Mix8)', 'Brand Mackie\nItem Dimensions LxWxH 3.3 x 9.1 x 13.3 inches\nItem Weight 3.5 Pounds8-channel compact mixer with proven high-headroom, low-noise performance\n2 mic/line inputs with studio-level audio quality, pan, level and overload indication and phantom power for studio condenser mics\n2 stereo 1/4\" line inputs\n3-band EQ on all channels with clean, precise tone shaping\n1 aux send with stereo 1/4\'\' returns', 'Brand Mackie\nItem Dimensions LxWxH 3.3 x 9.1 x 13.3 inches\nItem Weight 3.5 Pounds', '89.99', '91.79', 'en', 1285),
