(1284, 'X-Rite i1Display Pro Plus (EODIS3PL)', 'Accurately measure Luminance/brightness levels up to 2000 nits.\nObtain correct neutral detail levels and higher accuracy in dark colors with new black current subtraction technology, especially beneficial on OLED displays or any display that can achieve close to zero black Point.\nIncluded i1Profiler software supports HDR and video workflows while the i1Display Pro Plus colorimeter has been designed for current and future high-luminance monitors making this the most capable and future proof solution available today.\nUsb-c Compatible with included USB-C to USB-A adapter\nA NOTE ABOUT 3RD PARTY SOFTWARE: Please check with your 3rd party software developer to verify if this device is supported. X-Rite can only guarantee compatibility with the included X-Rite i1Profiler software.', '', '299.0', '304.98', 'en', 1287),
