(1327, 'ZTS – Mini Multi-Battery Load Tester Mini-MBT', 'ACCURATE MEASUREMENT: Patented high accuracy Pulse Load Technology measures the charge and life of your batteries under a load; more reliable than just a voltage readout\nSIMPLE TO USE: No switches or settings, fully automatic 2-second test easily identifies weak or failing 1.5 V AAA AA C D N 1.2v NiMH NiCd 3.6v Li-Ion 3v Photo Lithium 9v alkaline batteries\nSAVES YOU MONEY: Test the remaining percentage of your battery’s capacity before recycling it, keep an eye on all the batteries in your home\nCOMPACT DESIGN: Small size is easy to pack and travel with, probe and lead wire conveniently store away in the seam\nBUY WITH CONFIDENCE: Proudly made in the United States with a one year warranty from date of purchase\n› See more product details', '', '45.0', '45.9', 'en', 1330),
(1328, 'Apple Smart Folio (for 10.9-inch iPad Air - 4th generation) - White', 'Color White\nMaterial Polyurethane\nItem Dimensions LxWxH 10.12 x 7.44 x 0.67 inches\nBrand AppleThe Smart Folio for iPad Air is constructed from a single piece of polyurethane to protect the front and back of your device.\nIt automatically wakes your iPad when opened and puts it to sleep when closed.\nYou can easily fold the Smart Folio into different positions to create a stand for reading, viewing, typing, or making FaceTime calls.', 'Color White\nMaterial Polyurethane\nItem Dimensions LxWxH 10.12 x 7.44 x 0.67 inches\nBrand Apple', '72.99', '74.45', 'en', 1331),
(1329, 'SabineTek SmartMike+ - Rechargeable Wireless Bluetooth Microphone, Hands-Free w/Noise Cancellation, Compatible w/GoPro, Canon Camera, iPhone/Android - Perfect for Vlogging & Interviewing(Black)', 'Brand SabineTek\nPolar Pattern Omnidirectional\nColor Black\nconnector-type USB\nConnections Bluetooth, Auxiliary\nHardware requirements PC, Camera, Smartphone\nItem Weight 0.3 Pounds\nSee morePERFORMANCE YOU CAN RELY ON: The wireless mic offers professional full-band audio 44.1~48kHz stereo CD-quality with more than 6 times the frequency of conventional mono microphones. Real-Time Auto-Sync Technology helps reduce your post-editing time.\nADVANCED MULTILEVEL NOISE CANCELLATION TECHNOLOGY: As a professional wireless microphone for smartphones, Multi-Level Noise Cancellation embedded algorithm controlled by the SmartMike+ APP, blocks outer surrounding noise and picks up the most authentic sound, providing a high-quality audio source for speech recognition. Clear sound without effort even if the environment around you is noisy. (Twin Package is needed for Receiver/Mic mode)\nREAL-TIME MONITORING FEATURES: The SmartMike+ comes with headphones that can be attached to the microphone/phone and all the sounds in the video can be listened to in real-time from the headphones to keep track of the shooting progress. The wireless microphone has built-in Qualcomm and MFI chipset. The advanced Bluetooth 5.0 technology provides a faster, easier, and more stable connection.\nPORTABLE & DURABLE: The wireless lavalier microphone is equipped with 110mAh high-quality lithium battery, providing 5 hours of battery life after being fully charged. The Mini Metal Clip allows you to easily clip the SmartMike+ or your shirt with ease. Compact and lightweight design is easy to carry around and it\'s constructed with premium materials, durable enough to use through the years. (Twin Package is needed for Receiver/Mic mode)\nSMART CHOICE: Just connect your Smartphone with SabineTek SmartMike+ microphone via Bluetooth and say goodbye to messy and confusing cables! You can create the perfect videos and audio files on your smartphone anywhere! Ideal for vloggers, YouTubers, podcasters, interviewers, and more. (Twin Package is needed for Receiver/Mic mode)', 'Brand SabineTek\nPolar Pattern Omnidirectional\nColor Black\nconnector-type USB\nConnections Bluetooth, Auxiliary\nHardware requirements PC, Camera, Smartphone\nItem Weight 0.3 Pounds\nSee more', '99.99', '101.99', 'en', 1332),
