(1342, 'Digital Innovations 60120-00 CleanDr Laser Lens Cleaner', 'Laser lens cleaner for CD and DVD players having issues with discs that load slowly, skip, or freeze during playback\nCleaning the laser lens can extend the life of the CD or DVD player, while improving sound and image quality\nExclusive 10-brush Cyclone Clean Process removes dust, dirt, and debris from the laser lens\nSafe for CD and DVD players, Computers (CD/DVD), XBOX/XBOX360 and PS1/2 game systems\nNot recommend for multi-disc CD/DVD players. Not intended for use with Blu-Ray players, WiiU, XBOX ONE or PS3/PS4\nOptimizes CDs, DVDs, and game system performance\nUnique 10-brush, three-stage Cyclone Clean Process demagnetizes and removes dust and dirt from the laser lens , ensuring optimal performance\nDo not use with Blu-ray or Playstation 3 systems.', '', '11.37', '11.6', 'en', 1345),
