(1467, 'B + W 77mm UV Protection Filter (010) for Camera Lens – Standard Mount (F-PRO), MRC, 16 Layers Multi-Resistant Coating, Photography Filter, 77 mm, Clear Protector', 'Brand B + W\nMaterial Glass\nPhoto Filter Thread Size 77 Millimeters\nPhoto Filter Effect Type UltravioletPROTECT YOUR EXPENSIVE CAMERA LENSES - The B + W77 mm UV haze clear camera filter is here to add 16 multi-resistant layers of protection against accidental drops, dust, flying, fingerprints, dirt, scratches sand or seawater spray. Enjoy outdoor photography without worrying about your precious lenses anymore.\nTAKE BLUE CAST OUT OF THE PICTURE - Literally. Whether you are a professional photographer or a beginner, the invisible Ultra-Violet component of light from the sky is a common issue. Our UV-blocking haze protector filter for 77mm lenses will eliminate blue cast and help you snap clearer images.\nF-PRO MOUNT - Thanks to precise precision manufacturing, B+W sockets fit absolutely accurately and are easy to install. The robust F-PRO filter with 77mm ensures easy handling, is suitable for wide-angle applications, and has a large selection of diameters as well as filter types. The internal thread means that a conventional lens hood can also be fitted.\nCHOOSE YOUR SIZE – To select the appropriate filter size, check your lens. On all lenses from Canon, Nikon, Olympus, Samsung, Fuji and other manufacturers there is a printed diameter symbol that determines the filter size.\nMADE IN GERMANY - Schneider Kreuznach (B + W) – We are proudly your precision mechanics specialists for filters, photography, optics and precision, with more than 100 years of German experience. Schneider products have already been used in NASA\'s Apollo missions. Thanks to our multi-resistant nano coating lens filter, we are helping photographers everywhere take clearer, crisper images.', 'Brand B + W\nMaterial Glass\nPhoto Filter Thread Size 77 Millimeters\nPhoto Filter Effect Type Ultraviolet', '49.95', '50.95', 'en', 1470),
(1468, 'OM Digital Solutions LB-T01 Lens Barrier For TG-1, 2, 3, 4, 5 & 6', 'Protects lens surface from scratches and dirt\nTurn the lens barrier to open and close for instant shooting\nEasy to use even when wearing gloves\nCannot be used while the silicone jacket csch 127 is on the camera', '', '44.95', '45.85', 'en', 1471),
(1469, 'Barska BI12330 Loaded Gear VX-100 Tactical Vest & Leg Platforms (OD Green)', 'Full Body Platform: The vest comes with 2 uility pouches, 2 double section magazine pouches, 2 adjustable drop leg platforms, radio/phone pouch, double section pouch, belt, detachable dump pouch and detachable right hand draw holster.\nWeb System: The vest is tough mesh webbing designed with Mil-Spec MOLLE attachment system, making it fully adjustable to fit most adult body types (S-XXL) and allows easy re-configurations.\nFunctional Design: The vest features front and back velcro areas for attaching ID patches, reinforced rescue pull handle on the upper back, and D-rings located on either shoulder.\nAdditional Storage: A tough mesh pocket at the interior back of the vest fits hydration packs, allowing added storage capacity.\nQuick Reload: The magazine pouches can fit standard 30 round magazines, and feature quick-release elastic pull-tab retainers for easy access.', '', '122.99', '125.45', 'en', 1472),
(1470, 'Atmosphere Aerosol 2 Pack 8oz Haze/Fog Spray for Photographers and Filmmakers', 'One 8 oz. can easily fits in your camera bag\nSafe, non-toxic, clear aerosol spray\nQuickly and easily spray for 20 seconds or more in a room or still area to add haze or fog to your photos and films\nGet the look of fog or haze without the need for power, a fog machine or fluid', '', '30.0', '30.6', 'en', 1473),
