(1474, 'New Microsoft Surface Pro X Keyboard (QJW-00001)', 'Features a full mechanical keyset, backlit keys, and large trackpad for precise navigation and control.\nSlim and compact, yet performs like a traditional, full-size keyboard.\nClicks in place instantly — use in combination with Surface Pro X kickstand for a best-in-class laptop experience anywhere.\nClose to protect screen and conserve battery, or fold back completely for a take-anywhere tablet.\nEnhanced magnetic stability — adjusts to virtually any angle.', '', '102.99', '105.05', 'en', 1477),
(1475, 'Victorinox Swiss Army One-Hand Sentinel Non-Serrated Pocket Knife', 'Brand Victorinox\nColor Black\nItem Dimensions LxWxH 2 x 2 x 2 inches\nItem Weight 0.05 Pounds\nBlade material Stainless Steel\nBlade edge SerratedA CUT ABOVE THE REST: Compact, agile and ready to face any adventure head-on. Our range of Swiss Army Knives have been established since 1897 and continue to be an icon of utility and smart design.\nDURABLE CONSTRUCTION: Swiss made stainless steel construction encased in our popular scales offers a slimmer profile and is extremely resistant.\nCOMPACT CARRY: Bring this knife with you on your daily adventures without sacrificing space. It makes a great gift for any occasion or stocking stuffer for Christmas.\nFIT FOR ALL TASKS: At their heart, all our pocket knives are a survival tool; multitaskers that deliver in any situation. At their most evolved they have surpassed basic function to pioneer space travel and restart engines.\nTRUSTED QUALITY: Made in Switzerland; Victorinox provides a lifetime guarantee against defects in material and workmanship. Making a lifetime commitment has never been so easy. No assembly required, money back guarantee.\nPRODUCT DETAILS: Swiss made pocket knife with 4 functions. Height: 0.5 in, Length: 4.4 in., Weight: 2.6 oz., MM: 111mm, Scale Material: Polyamide\nFUNCTIONS: large blade, tweezers, toothpick, key ring', 'Brand Victorinox\nColor Black\nItem Dimensions LxWxH 2 x 2 x 2 inches\nItem Weight 0.05 Pounds\nBlade material Stainless Steel\nBlade edge Serrated', '27.67', '28.22', 'en', 1478),
