(1504, 'Korg Nu:Tekt NTS1 DIY Digital Synth', 'Powerful: The Korg Nu:Tekt NTS-1 digital KIT is a unique, flexible, and easy DIY synthesizer that you can easily assemble yourself (tool included), without any soldering. The first of its kind from Korg’s DIY-focused Nu:Tekt brand, NTS-1 packs a powerful synth and multi-effects engine into a compact and highly portable form factor\nFilters: A wide selection of filters (Low pass 2/4-pole, High pass 2/4-pole, Bandpass 2/4-pole, and OPEN mode, all with resonance) give you control over the overall tone of the oscillator\nCompatibility: NTS-1 is also completely compatible with the logue-SDK, making it possible to create custom oscillators and effects or upload any of the content available for minilogue xd and prologue\nBenefits: The main oscillator can produce Sawtooth, Triangle, Square, and VPM waveforms, and can load custom oscillators created from Korg’s logue SDK, which means it’s compatible with content created for prologue and minilogue xd. These waveforms can be easily re-shaped and adjusted just by simply turning a couple of knobs\nKorg Authorized Dealer: Includes USA Manufacturer Warranty', '', '99.99', '101.99', 'en', 1507),
(1505, 'Pyle Desktop Microphone Stand - Universal Tabletop Mic Holder w/ Flexible 8.2\'\' Inch Gooseneck Mount and Solid U Shape Base - Perfect for Table Desk or Counter - PMKS8', 'ADJUSTABLE GOOSENECK: The Pyle desktop microphone stand is 8.2” inches high. It does not create static noise during adjustment. Quite and effortless mic adjustment comes with a universal microphone holder or clip attachment.\nVERSATILE POSITIONING: This ideal mic stand with a flexible and bendable shaft is perfect for table, desk, counter and the like. Also, the gooseneck shaft gives you the ability to position your microphone smoothly in all directions you desired.\nSTURDY U SHAPE BASE STAND: With it\'s solid die casting iron U shape base in 5.6\'\' x 6.8\'\' dimension, Pyle mic stand will provide stability and precise balance to avoid it from falling. And, 2.02 lbs counterweight for a stable microphone placement.\nCONVENIENT BENDABLE TUBE DESIGN: This is an ideal professional mic stand for table, desk and counter. It is simple with durable design for long term use and lightweight makes it easy to transport from show to show or home to home.\nWORKS PERFECTLY: Perfect mic positioning and optimal pickup for in studio or on stage performances. The Pyle PMKS8 is a class at its own gooseneck mount.\nWORRY-FREE SHOPPING: With the Pyle PMKS8, we are confident of the quality of our product, therefore, we offer a 30 day money back guarantee no questions asked.', '', '9.99', '10.19', 'en', 1508),
