(1545, 'Sigma 16mm F/1.4 DC DN Contemporary Lens for Canon EF-M (402971)', 'Brand Sigma\nLens Type Wide Angle\nCompatible Mountings Canon EF-M\nMax Focal Length 16 Millimeters\nMin Focal Length 16 MillimetersAuthorized Sigma Reseller, 4-Year U.S.A. Warranty\nDESIGN - The Sigma 16mm 1.4 DC DN Contemporary is a high performance prime with a large aperture of F1.4 designed for APS-C Mirrorless cameras. The Contemporary line is part of Sigma Global Vision and is the perfect blend of image quality and compact size. The large aperture is great for lowlight and for creating depth of field and its small size makes it highly portable.\nOPTICAL - The optical design makes use of several low dispersion and aspherical glass elements to control color fringing and various aberrations to provide high sharpness and clarity throughout the aperture range. Individual elements also feature Sigma\'s Super Multi-Layer Coating to suppress flare and ghosting for greater contrast and color fidelity when working in strong lighting conditions.\nLOW LIGHT - Fast f/1.4 maximum aperture is well-suited for working in low-light conditions and also provides greater control over the focus position when using shallow depth of field techniques.\nCOMPATIBILITY - Canon EOS M10, Canon EOS M100, Canon EOS M200, Canon EOS M3, Canon EOS M5, Canon EOS M50, Canon EOS M6, Canon EOS M6 Mark II', 'Brand Sigma\nLens Type Wide Angle\nCompatible Mountings Canon EF-M\nMax Focal Length 16 Millimeters\nMin Focal Length 16 Millimeters', '390.99', '398.81', 'en', 1548),
