(1553, 'StarTech.com 10/100Mbps Ethernet to USB 2.0 Network Print Server - Windows 10 - LPR - LAN USB Print Server Adapter (PM1115U2),Black', 'Compatible Devices PC, Mac\nColor Black\nBrand StarTech\nData Transfer Rate 100 Megabits Per SecondNEW FIRMWARE UPDATE AVAILABLE: To enhance the performance of your 10/100Mbps networking USB print server we suggest downloading the latest version of the product firmware to improve stability in varied network environments.\nSHARE A PRINTER: Share a USB printer w/ multiple users over an Ethernet network. The print server has 10Base-T/100Base-TX auto-sensing to ensure a reliable connection, letting you print from any network computer, across the office or over the Internet.\nGREAT FOR ANY ENVIRONMENT: This USB print server adapter is the perfect printing solution. It\'s ideal for home or small office applications, and government and educational institutions that require shared printing capabilities.\nBROAD COMPATIBILITY: This USB to Ethernet print server is USB 2.0 compliant, and works w/ Mac & Windows, including Windows 10. The print adapter also supports LPR network printing and Bonjour Print Services to provide ultimate compatibility.\nPRINT FROM ANYWHERE: Print from any computer connected to the LAN. This print server doesn’t require a wired connection to a computer, however you must connect the server to your networking device (eg. router) w/ the included RJ45 network cable.', 'Compatible Devices PC, Mac\nColor Black\nBrand StarTech\nData Transfer Rate 100 Megabits Per Second', '41.59', '42.42', 'en', 1556),
