(1612, 'BenQ HT2150ST 1080P Short Throw Projector | 2200 Lumens | 96% Rec.709 for Accurate Colors | Low Input Lag Ideal for Gaming | Stream Netflix & Prime Video,White', 'Hardware Interface HDMI\nMounting Type Ceiling Mount\nBrand BenQ\nWattage 353 watts\nLuminous Flux 2200 LumenUNPARALLELED PICTURE QUALITY:: Native 1080p Full HD image quality with 2200 ANSI Lumens, 15, 000:1 contrast ratio, 6x RGBRGB color wheel delivers rich colors and crisp details that are calibrated for movies and gaming.\nVIDEO GAMES ON THE BIG SCREEN: superior short throw projection enables you to project 100 inch screen from just 3 Feet letting you fully immerse into your games. Project up to 300 inches\nLOW INPUT LAG: The specialized low input lag and unique game modes ensure gamers an ultra-smooth and comprehensive gaming experience\nINDUSTRY LEADING WARRANTY : 3-year limited parts and labor coverage makes you rest easy that our us-based customer service team is here when you need it\nAWARD WINNING PROJECTOR - Best Overall - Best Projectors for Gaming 2019 - IGN\nFLEXIBLE INSTALLATION: Vertical keystone correction and a 1. 2x zoom allows easy installation\nDLP TECHNOLOGY: DLP is the leading technology used in 90% of the world’s cinemas and 100% of digital IMAX theaters. You will experience a longer lasting, slimmer design, sharper and crisper image in BenQ projector', 'Hardware Interface HDMI\nMounting Type Ceiling Mount\nBrand BenQ\nWattage 353 watts\nLuminous Flux 2200 Lumen', '799.0', '814.98', 'en', 1615),
(1613, 'Furman Power Conditioner (PST-8)', 'Advanced Linear Filtering dramatically reduces AC line noise and contamination resulting in improved audio/video clarity\nSeries Multi-Stage Protection Plus (SMP+) for the highest level of AC surge suppression; Automatic extreme voltage shutdown guards your valuable equipment from dangerous wiring faults\nZero ground contamination circuitry assures the delivery of pure AC power thus protecting critical audio/video components\nCable satellite and Telco connectors deliver advanced protection to connected equipment\nFrom the #1 brand in professional power conditioning. Perfect for instrument rigs, home recording, DJ equipment, pro audio rigs and home entertainment systems\nAdvanced Linear Filtering dramatically reduces AC line noise and contamination resulting in improved audio/video clarity\nSeries Multi-Stage Protection Plus (SMP+) for the highest level of AC surge suppression', '', '129.77', '132.37', 'en', 1616),
