(1617, 'Victorinox Swiss Army Cutlery Rosewood Santoku Knife, Granton Blade, 7-Inch', 'Blade material Carbon\nBrand Victorinox\nColor Rosewood\nHandle material Wood\nItem Dimensions LxWxH 11.63 x 1.88 x 0.63 inchesELEGANT SANTOKU KNIFE. A classically designed Rosewood handle combined with a versatile Japanese style knife. The Granton blade creates air pockets, preventing food from sticking and minimizes friction for easier chopping, mincing, and dicing.\nFIT FOR ALL TASKS. Designed to handle kitchen tasks both big and small, this durable knife\'s razor sharp and laser-tested blade effortlessly chops, minces, slices and dices. An essential for every kitchen.\nEASY HANDLING. This knife features a Rosewood handle for a comfortable grip and easy handling. This exceptional knife is weighted and balanced with triple handle rivets for maximum durability.\nKNIFE DIMENSIONS. Stainless steel blade -- 7\" in length.\nTRUSTED SWISS QUALITY. Expertly crafted in Switzerland in 1884, Victorinox provides a lifetime guarantee against defects in material and workmanship. Making a lifetime commitment has never been so easy.', 'Blade material Carbon\nBrand Victorinox\nColor Rosewood\nHandle material Wood\nItem Dimensions LxWxH 11.63 x 1.88 x 0.63 inches', '50.6', '51.61', 'en', 1620),
(1618, 'StarTech.com DisplayPort to DVI-D Adapter - 1920x1200 - Passive DVI Video Converter with Latching DP Connector (DP2DVI2),Black', 'connector-type Dvi\nCable Type DVI\nCompatible Devices Projector, Monitor\nColor Black\nBrand StarTechSECURE PORT CONNECTION: This DisplayPort to DVI video adapter converter features a latching DisplayPort connector, so you’re able to fasten and secure the connector to the port\nELIMINATE UPGRADING COSTS: Save the cost of upgrading by connecting your DisplayPort device directly to a DVI monitor or projector with this DisplayPort to DVI-D adapter\nHASSLE-FREE SETUP: The DisplayPort to DVI video adapter lets you connect your DP laptop or desktop computer to a DVI display, supporting plug and play connectivity\nCRYSTAL-CLEAR PICTURE: With support for resolutions up to 1920x1200, this DP to DVI converter allows you to take full advantage of single link DVI capability and produce crystal clear picture quality\nTHE STARTECH.COM ADVANTAGE: StarTech.com offers a 3-year warranty and free lifetime technical support on this adapter and has been the choice of IT professionals and businesses for over 30 years', 'connector-type Dvi\nCable Type DVI\nCompatible Devices Projector, Monitor\nColor Black\nBrand StarTech', '14.31', '14.6', 'en', 1621);
