(1630, 'StarTech.com 4K 30Hz HDMI to DisplayPort Video Adapter w/ USB Power - 6 in - HDMI 1.4 (Male) to DP 1.2 (Female) Active Monitor Converter (HD2DP)', 'connector-type 19 pin HDMI Type A; 20 pin DisplayPort; 4 pin USB Type A\nBrand StarTech\nWarranty Type LimitedCONNECT AN HDMI VIDEO SOURCE: Connect your HDMI enabled Ultrabook, laptop or desktop computer to a DP monitor, screen or projector using this active HDMI (male) to DisplayPort (female) video adapter with USB power.\nBOOST PRODUCTIVITY: This DP converter lets users connect a secondary screen or display to their HDMI equipped computer, helping to increase their productivity. The adapter transmits high quality audio and video to ensure functionality is not compromised.\n4K SUPPORT: Experience astonishing UHD picture quality with the HDMI 1.4 to DisplayPort 1.2 converter that delivers resolutions up to 4K 30Hz (3840x2160). For added convenience, the adapter is backward compatible with displays supporting lower resolutions.\nPLUG-AND-PLAY: With no drivers or software required, this HDMI to DP converter offers a true plug-and-play experience. It is USB powered so no external power cord is required, making it the perfect solution for professionals on the go.\nINDUSTRY-LEADING SUPPORT: StarTech.com offers a 3-year warranty and free lifetime technical support on this HDMI to DisplayPort video adapter with USB power, and has been the choice of IT professionals and businesses for over 30 years.', 'connector-type 19 pin HDMI Type A; 20 pin DisplayPort; 4 pin USB Type A\nBrand StarTech\nWarranty Type Limited', '41.84', '42.68', 'en', 1633),
