(1633, 'Motorola Solutions T480 Talkabout Rechargeable Emergency Preparedness Two-Way Radio Single Unit (Red/White)', 'Brand Motorola\nColor Red/White\nnumber_of_channels 22\nItem Dimensions LxWxH 1.37 x 2.26 x 7.54 inches\nItem Weight 0.42 PoundsWith a range of up to 35 miles and freedom to communicate wirelessly, the T480 won\'t slow you down. The range in real-life conditions can be reduced from maximum range.\n22 Channels each with 121 Privacy Codes. With 22 channels and 121 privacy codes, totaling 2,662 combinations, it is easy to find an available channel.\nWhen in danger, easily ask for help. Press the emergency alert button and the radio will transmit an alert siren followed by spoken or incidental sounds. This will allows others to know that you have an impending danger.\nKeep updated with real-time weather conditions by turning on the weather channel or initiating weather alerts. With these capabilities, you will always be prepared for the unexpected.\nPush-To-Talk (PTT) power boost allows you to extend the transmission range by increasing the transmitter power output. It also saves battery life when no power boost is necessary.', 'Brand Motorola\nColor Red/White\nnumber_of_channels 22\nItem Dimensions LxWxH 1.37 x 2.26 x 7.54 inches\nItem Weight 0.42 Pounds', '46.47', '47.4', 'en', 1636),
(1634, 'BOSS Wireless Guitar Headphones System (WAZA-AIR), WAZA-Air (WAZA-Air)', 'Integrated BOSS wireless technology provides exceptional sound quality with ultra-low latency\nEasy-to-use controls for guitar volume and Bluetooth audio playback, plus instant access to six user-configurable tone settings\nLarge, custom-designed 50 mm drivers deliver premium audio quality with rich, full sound\nVersatile two-way design folds down for compact storage or flat transport in a guitar bag pocket\nBuilt-in rechargeable batteries with auto standby/wake function to conserve battery life\nUp to five hours of play time with the headphones and up to 12 hours with the included BOSS WL-T Transmitter\nUnique onboard tuner function with audible tones that guide your tuning; visual chromatic tuner also available in the BOSS Tone Studio app', '', '399.99', '407.99', 'en', 1637),
