(1638, 'Pyle Universal Speaker Tripod Stand Mount - 6\' Sound Equipment Holder Height Adjustable Up to 70 Inches For Speakers w/ 35mm Compatible Insert Perfect for Home, On Stage or In Studio Use - PSTND25', 'EASY HEIGHT ADJUSTMENT: It features a telescoping center column that is adjustable ranging from 42.4’’ to 70’’ high. Secured it with the sturdy pin and screw locks. Features rugged and durable metal construction tubing for safe and long term use\nTRIPOD LEG DESIGN: Center brace connects tripod legs for increased stability. The tripod speaker stand collapses easily to fit inside the bag for easy transportation. It can hold speakers of up to 130 lbs. firmly and steadily for better sound effect\n35mm COMPATIBLE INSERT: The professional flexible 6 feet speaker stand holder mount works with all speakers with 35mm compatible insert. An ideal heavy duty audio stand for loud speakers, PA speakers, studio monitors, and more\nTENSION LOCKING MECHANISM: Built with knob style tension locking mechanism that holds the maximum weight of a speaker attached to the stand. It also supports the height of the speaker stand and prevent it from collapsing\nNON SLIP FEET: Pyle features universal floor standing speaker stand as well as non-slip rubber feet. The equal length distribution makes the base extremely stable and safe. Perfect for on-stage or in-studio use', '', '22.19', '22.63', 'en', 1641),
