(1642, 'Coast FL85R 700 Lumen Dual Color (White/Red) Focusing Rechargeable LED Headlamp, Rechargeable Battery Included', 'PURE BEAM FOCUSING WITH TWIST FOCUS: Pack two powerful beams into one and seamlessly transition—with no halos or hot spots—between short and long-range viewing. COAST’s patented focusing technology adapts to your need. The Ultra View Flood beam delivers edge-to-edge clarity in a broad circle, and the Bulls-Eye Spot beam sends a sharp ray of light at a distance with a transitional halo around the spot to increase the effective viewing area.\nFLEX CHARGE DUAL POWER: Power up on your terms. Lights with COAST Flex Charge technology feature a rechargeable battery that can be recharged either inside or outside the light. A simple USB connection to either AC or DC ensures you can always get juice. With COAST Dual Power technology, you have the choice to power your light with USB-rechargeable batteries or with standard alkaline batteries.\nSPECS: Light Output 700 lumens (high), 90 lumens (low). Beam Distance: 200 meters (high), 70 meters (low). Runtime: 1.75 hours (high), 8.5 hours (low). Tested and rated to ANSI/FL1 standards.\nTOUGH & RELIABLE: Backed by the COAST Lifetime Warranty against defects in materials and workmanship. IPX4 rated design for water resistance and durable body for 1-meter drop protection.\nIncluded Accessories: 1 x Li-Ion Battery Pack, 3 x AAA Alkaline Batteries, USB cable, AC Adapter, DC Adapter, and Hard Hat Clips\n› See more product details', '', '62.91', '64.17', 'en', 1645),
