(1676, 'HP 712 Black 80-ml Genuine Ink Cartridge (3ED71A) for DesignJet T650, T630, T230, T210 & Studio Plotter Printers', 'Brand HP\nColor Black\nCompatibility Options OEM\nPage Yield 1\nCompatible Devices HP DessignJet T230 Printer, HP DessignJet Studio Printers, HP DessignJet T210 Printer, HP DessignJet T250 Printer, HP DessignJet T630 Printer See moreInk Color: Black HP Bright Office DesignJet Ink\nCatridge Capacity: 80 ml Ink cartridge, genuine HP 712 Ink\nHP Bright Office Inks achieve outstanding line quality and bright color distinction to bring out every detail. Bold images, true neutral grays, and archival durability with water-resistant blacks.\nHP 712 DesignJet ink is designed together with your HP DesignJet printer to deliver consistently high-quality prints on a wide range of media – saving you time, money, and ensuring your customers’ satisfaction.\nHP’s dual ink technology is an innovative combination of the brightest dye-based color inks and permanent and water-resistant pigment-based black to bring out every detail on plain paper, enabling full and accurate communication.\nReliable alternative to remanufactured inks: While non-HP inks may cost less, they can cause frequent printhead replacement, unsellable prints – wasting time and money – and increased printer downtime and maintenance. Genuine DesignJet Inks, Printheads, and DesignJet large format printer plotters are designed and engineered to work together as an optimized printing system.\nEnvironmentally friendly alternative to remanufactured inks: Return empty ink cartridges and printheads free of charge to HP Planet Partners Program, a groundbreaking closed loop recycling process using plastic from recycled Genuine HP cartridges plus recycled soda bottles and hangers preventing them from going to landfill to instead create new Genuine HP cartridges.', 'Brand HP\nColor Black\nCompatibility Options OEM\nPage Yield 1\nCompatible Devices HP DessignJet T230 Printer, HP DessignJet Studio Printers, HP DessignJet T210 Printer, HP DessignJet T250 Printer, HP DessignJet T630 Printer See more', '59.98', '61.18', 'en', 1679),
