(1746, 'Victorinox Swiss Army Electrician Pocket Knife (Silver Alox Ribbed),Silver Alox, Ribbed', 'Color Silver Alox\nMaterial Other\nBrand Victorinox\nItem Dimensions LxWxH 2 x 2 x 2 inches\nItem Weight 2.1 OuncesA CUT ABOVE THE REST: Compact, agile and ready to face any adventure head-on. Our range of Swiss Army Knives have been established since 1897 and continue to be an icon of utility and smart design.\nDURABLE CONSTRUCTION: Swiss made stainless steel construction encased in our popular scales offers a slimmer profile and is extremely resistant.\nCOMPACT CARRY: Bring this knife with you on your daily adventures without sacrificing space. It makes a great gift for any occasion or stocking stuffer for Christmas.\nFIT FOR ALL TASKS: At their heart, all our pocket knives are a survival tool; multitaskers that deliver in any situation. At their most evolved they have surpassed basic function to pioneer space travel and restart engines.\nTRUSTED QUALITY: Made in Switzerland; Victorinox provides a lifetime guarantee against defects in material and workmanship. Making a lifetime commitment has never been so easy. No assembly required, money back guarantee.\nPRODUCT DETAILS: Swiss made pocket knife with 7 functions. Height: 0.5 in, Length: 3.6 in., Weight: 2.1 oz., MM: 93mm, Scale Material: Alox\nFUNCTIONS: Large blade, electrician\'s blade, wire scraper, reamer, bottle opener, screwdriver, wire stripper', 'Color Silver Alox\nMaterial Other\nBrand Victorinox\nItem Dimensions LxWxH 2 x 2 x 2 inches\nItem Weight 2.1 Ounces', '34.0', '34.68', 'en', 1749),
(1747, 'HP 711 Cyan 29-ml 3-Pack Genuine Ink Cartridges (CZ134A) for DesignJet T530, T525, T520, T130, T125, T120 & T100 Large Format Plotter Printers', 'Brand HP\nColor Cyan\nCompatibility Options OEM\nCompatible Devices DesignJet T120 Printer (discontinued), DesignJet T125 Printer, DesignJet T525 Printer, DesignJet T130 Printer, DesignJet T100 Printer, DesignJet T530 Printer, DesignJet T520 Printer (discontinued) See moreMake sure this fits by entering your model number.\nInk Color: Cyan HP Bright Office DesignJet Ink.\nCartridge Capacity: 29 ml 3-pack Ink cartridges, genuine HP 711 Ink.\nHP Bright Office Inks achieve outstanding line quality and bright color distinction to bring out every detail. Bold images, true neutral grays, and archival durability with water-resistant blacks.\nHP 711 DesignJet ink is designed together with your HP DesignJet printer to deliver consistently high-quality prints on a wide range of media – saving you time, money, and ensuring your customers’ satisfaction.\nHP’s dual ink technology is an innovative combination of the brightest dye-based color inks and permanent and water-resistant pigment-based black to bring out every detail on plain paper, enabling full and accurate communication.\nBetter alternative to remanufactured, compatible, and third-party replacement ink cartridges: While non-HP inks may cost less, they can cause frequent printhead replacement, unsellable prints – wasting time and money – and increased printer downtime.\nBetter for the environment than remanufactured inks: HP\'s groundbreaking closed loop recycling process uses plastic from recycled Original HP cartridges plus recycled bottles and hangers to create new Original HP cartridges.', 'Brand HP\nColor Cyan\nCompatibility Options OEM\nCompatible Devices DesignJet T120 Printer (discontinued), DesignJet T125 Printer, DesignJet T525 Printer, DesignJet T130 Printer, DesignJet T100 Printer, DesignJet T530 Printer, DesignJet T520 Printer (discontinued) See more', '62.