(1819, 'ViewSonic VG2239SMH 22 Inch 1080p Ergonomic Monitor with HDMI DisplayPort and VGA for Home and Office, Black', 'Standing screen display size 22 Inches\nResolution FHD 1080p\nDisplay Technology LCD\nBrand ViewSonic\nSeries VG2239SMHQUALITY SCREEN TIME: From big data to beautiful presentations, this monitor deliver Full HD (1920x1080p) viewing for any task\nPRODUCTIVITY & COMFORT: Advanced ergonomics help to boost productivity with all-day comfort\nAMAZING AT ANY ANGLE: This MVA panel ensures stunning views no matter your vantage point. OS Compatibility- macOS, Windows, Linux, Ubuntu, Android, Chrome OS\nFLEXIBLE CONNECTIVITY: The VG2239SMH supports laptops, PCs, Macs, and POS systems with HDMI, DisplayPort, USB, and VGA inputs\nINDUSTRY-LEADING : 3-year coverage with access to our US-based customer service team', 'Standing screen display size 22 Inches\nResolution FHD 1080p\nDisplay Technology LCD\nBrand ViewSonic\nSeries VG2239SMH', '139.99', '142.79', 'en', 1822),
(1820, 'StarTech.com USB C to Gigabit Ethernet Adapter - Black - USB 3.1 to RJ45 LAN Network Adapter - USB Type C to Ethernet (US1GC30B)', 'INSTANT GIGABIT NETWORK CONNECTION: Add a GbE connection using the USB Type C or Thunderbolt 3 port on your computer with this USB C to Gigabit Ethernet adapter. You can access large files over the network at 10 / 100 / 1000 Mbps network speeds with support for checksum and large-send offload.\nUSES USB TYPE-C & THUNDERBOLT 3: Delivers Gigabit speeds using the USB-C or Thunderbolt 3 port on your computer without requiring an internal Ethernet card in your device.\nNATIVE DRIVER SUPPORT: Simply plug the USB C network adapter into the USB-C port on your laptop and connect to your network. The adapter’s Realtek RTL8153 chipset provides native driver support so no driver or software installation is required.\nCOMPACT & SELF-POWERED DESIGN: Compact and portable, this is the ideal desktop LAN adapter or laptop accessory for those who require more portability. It’s powered directly from the USB port making it easy to connect when you’re on the go.\nRELIABLE PRODUCT SUPPORT: This USB 3.1 ethernet adapter makes it easy to add a wired network connection to your laptop, desktop or tablet. StarTech.com offers a 3-year warranty on this USB C to RJ45 adapter with North American based Technical Support before and after purchase.', '', '22.99', '23.45', 'en', 1823),
