(1822, 'ViewSonic TD2230 22 Inch 1080p 10-Point Multi Touch Screen IPS Monitor with HDMI and DisplayPort, Black', 'Standing screen display size 22 Inches\nResolution FHD 1080p\nDisplay Technology LED\nBrand ViewSonic\nSeries VIEWSONIC INC22-Inch Full HD 1080p (1920x1080) 16:9 LED Touch Screen Monitor with HDMI, DisplayPort, USB 3.0, and VGA Inputs\nWith a robust, scratch resistant 10-point multi-touch Full HD 1080p touchscreen, versatile connections, and frameless-design, the TD2230 is ideal for use in retail, education, or enterprise\nFreestanding slim bezel tablet design with muted black finish, stable adjustable stand, and 7H scratch resistant surface\n50M:1 Dynamic Contrast Ratio; Two Built-In Speaker; 178/178 Degree Viewing Angles; Physical Dimensions: 19.3” x 11.8” x 5.1”\n3-year Limited Warranty; Energy Star Certified; Package Content: TD2230 Monitor, Power Cable, Power Adapter, HDMI Cable, USB 3.0 Cable, Audio Cable, Quick Start Guide, and ViewSonic Wizard CD\nCompatible with Windows only; ideal for both laptops and desktops', 'Standing screen display size 22 Inches\nResolution FHD 1080p\nDisplay Technology LED\nBrand ViewSonic\nSeries VIEWSONIC INC', '252.36', '257.41', 'en', 1825),
