(1834, 'Shure AONIC 215 True Wireless Sound Isolating Earbuds, Premium Audio Sound with Deep Bass, Bluetooth 5, Secure In-Ear Fit, Long Battery Life with Charging Case, Fingertip Controls - Black [New Update]', 'NEW ENHANCED FEATURES: New enhanced features for the AONIC 215 True Wireless earphones.\nAWE-INSPIRING TRUE WIRELESS WITH CLEAR SOUND & DEEP BASS: No cords. No wires. Just pure listening.\nSECURE, OVER-EAR FIT: Built with the same design musicians use for in-ear monitoring on-stage. Your earbuds stay in place for unmatched, long-wearing comfort even during high-energy activities.\nSOUND ISOLATING TECHNOLOGY & ENVIRONMENT MODE:  Block up to 37 dB of noise to eliminate distractions. Enjoy the most immersive listening experience no matter where you are and hear the outside world with the touch of a button.\nUP TO 8 HOURS BATTERY LIFE PER CHARGE: Plus included carrying case provides three additional charges for a total of up to 32 hours battery life on-the-go. Uninterrupted audio wherever you are – on the train, in the gym, or at home.\nDETACHABLE CONNECTION: Allows the AONIC 215 Earphones to attach to different cable accessories. Stay connected to any device, including airplane entertainment systems.\nENJOY CLEAR CALLS WITH EXCEPTIONAL AUDIO: Through integrated microphones for video conferencing and phone calls. Call audio only heard in the right earphone.', '', '0.0', '0', 'en', 1837),
