(1850, 'Rokinon FE14M-C 14mm F2.8 Ultra Wide Lens for Canon (Black)', 'Brand Rokinon\nLens Type Wide Angle\nCompatible Mountings Canon EF\nMax Focal Length 14 Millimeters\nMin Focal Length 14 MillimetersMake sure this fits by entering your model number.\nUltra wide-angle 14mm lens with an approximately 90° angle of view using an APS-C camera, for dramatic effects\nLens has a minimum focusing distance of 0.9\' (28 cm) for enhanced close-up shots. Lens includes a built-in petal-type lens hood.Do not soak the lens in water, and avoid water splashing onto the lens\nMaximum Diameter: 3.4”(87mm). Aperture Range: F2.8 to F22\nFocal Length: 14mm. Mounts : Canon: FE14M-C, Nikon AE: FE14AF-N. Pentax K: FE14M-P. Sony α: FE14M-S, Fuji X: FE14M-FX, Samsung NX: FE14M-NX, Sony E: FE14M-E, Four Thirds: FE14M-O, Micro 4/3: FE14M-MFT, Canon AE : AE14M-C', 'Brand Rokinon\nLens Type Wide Angle\nCompatible Mountings Canon EF\nMax Focal Length 14 Millimeters\nMin Focal Length 14 Millimeters', '299.0', '304.98', 'en', 1853),
(1851, 'COAST HP7 530 Lumen Focusing LED Flashlight with Slide Focus and Beam Lock', 'PURE BEAM FOCUSING: The Patented Pure Beam Focusing Optic technology combines our largest Ultra View Flood Beam with the Bulls-Eye Spot Beam making either up close or downrange illumination highly effective\nSLIDE FOCUS SYSTEM: The Slide Focus System allow the user to shape the flashlight beams from Flood to Spot modes with a push or pull of a thumb\nBEAM LOCK SYSTEM: The Beam Lock system allow the user to lock the beam focus in position in flood or spot mode or anywhere in between\nSPECS: Light Output: 530 lumens (high), 70 lumens (low). Beam Distance: 574 feet (high), 196 feet (low). Runtime: 1.5 hours (high), 9 hours (low), Length: 5.6 Inches, Weight: 7.2 oz. IPX4 weatherproof rating\nINCLUDES: 4 x AAA Batteries, and the HP7 Flashlight is backed by Coast’s lifetime warranty against defects in materials and workmanship. Tested and rated to ANSI/FL1 standards.\n› See more product details', '', '39.49', '40.28', 'en', 1854),
