(1861, 'JOBY Suction Cup with GorillaPod Arm for GoPro HERO6 Black, GoPro HERO5 Black, GoPro HERO5 Session, Contour and Sony Action Cam', 'Color Black/Red\nBrand Joby\nItem Dimensions LxWxH 1.89 x 5.94 x 8.31 inches\nItem Weight 0.24 PoundsCAPTURE SUPERIOR PERSPECTIVES. Look at life from a different point of view with as you mount this suction cup action camera mount to any non-porous purpose. The flexible GorillaPod Arm maneuvers 360 degrees letting you get the angle you want, for the shot you need.\nQUICK-TWIST LOCK. Just twist and turn a quarter turn to the right as you feel the lock click into place, right beneath your fingertips. Let your Go-Pro or other action sports camera hold on tight, with this suction cup, it’s not going anywhere.\nMIX AND MATCH. Innovative, high tech, and easy to use. This JOBY Suction Cup with GorillaPod Arm is ultra-versatile. The modular design and removable arm and mount allows you to mix and match using the universal ¼”-20 screw design.\nREADY FOR ADVENTURE. We know your travels take you far and wide. The industrial strength suction locks into place while the, Go-Pro tripod quick release mount, and GorillaPod Arm keep your equipment safe and secure, no matter where life takes you.\nSTICK ON STRONG. Made of medical-grade ABS plastic, stainless steel, and TPE, it’s made for the wear and tear of everyday life, or the rigor of adventure. Move beyond the selfie as you set your tripod up on the toughest terrain getting you the best shots', 'Color Black/Red\nBrand Joby\nItem Dimensions LxWxH 1.89 x 5.94 x 8.31 inches\nItem Weight 0.24 Pounds', '22.99', '23.45', 'en', 1864),
