(1868, 'Nextbase 322GW Dash Cam 2.5\" HD 1080p Touch Screen Car Dashboard Camera, Quicklink WiFi, GPS, Emergency SOS, Wireless, Black', 'Are Batteries Included No\nBrand NEXT BASE\nStanding screen display size 2.5 Inches\nItem Dimensions LxWxH 1.77 x 3.35 x 1.85 inches\nVideo Capture Resolution 1080p\nBattery Cell Type LithiumTHE WORLD\'S FIRST DASH CAM WITH EMERGENCY SOS RESPONSE, BLUETOOTH 4.2, AND WiFi: In the event of an accident the dash cam will alert the emergency services to your location thanks to it\'s high accuracy GPS. The alert instantly sends your personal medical data such as blood type and medical history to paramedics to aid in rescue.\nTHE ULTIMATE IN CAR SAFETY: Record your journey on the road with a 1080p/60fps HD dash cam with the highest quality images of everything that happens to you on the road. View and share footage using the free MyNextbase cloud storage. All Nextbase cameras are equipped with night vision to record the road at anytime of day.\nTOUCH SCREEN INTERFACE: 2.5\" IPS HD touch screen for enchanced ease of use while on the road.\nMODULAR CAPABILITIES: Easily add on additional camera modules to your Nextbase 322GW to expand viewing area\'s including rear view, rear window, and cabin view. Great for keeping an eye on kids or Uber and Lyft passagers\nAWARD WINNING PERFORMANCE: Nextbase is the most awarded Dash Cam company in the world.', 'Are Batteries Included No\nBrand NEXT BASE\nStanding screen display size 2.5 Inches\nItem Dimensions LxWxH 1.77 x 3.35 x 1.85 inches\nVideo Capture Resolution 1080p\nBattery Cell Type Lithium', '124.5', '126.99', 'en', 1871),
