(1870, 'Sonnet Allegro Pro USB 3.2 Type A PCIe Card (Four SuperSpeed 10Gbps USB Connectors)', 'SuperSpeed+ 10Gbps USB Ports—Adds four 10Gbps USB-A ports to your Mac Pro, Windows PC, or Linux computer with PCIe slots; or Thunderbolt to PCIe card expansion system\nDual USB 3.2 Gen 2 Controllers—Support data transfers at up to twice as fast as USB 3.0 and USB 3.1 Gen 1, and boost data transfer speeds between connected drives\nPowered Ports—Supports USB bus-powered SSD, SSD RAID, and hard drive devices with up to 7.5W power per port\nProtected Power Delivery—Independent power regulation isolates each port to prevent cross-coupled power glitches that may cause accidental disconnects; resettable device overcurrent fuses protect the card and computer, and may be reset by a simple shutdown\n2-year warranty and free lifetime customer support since 1986', '', '139.99', '142.79', 'en', 1873),
(1871, 'Glow EZ Lock Collapsible White Beauty Dish (25\")', '25\" Glow EZ Lock White Beauty Dish, 25\" External Diffuser, Internal Diffuser, 25\" Eggcrate Grid, Bowens Speedring Adapter (Insert Size 150mm), Reversible Deflection Disk, Storage Bag, 2-Year Glow USA Warranty\nQuick and easy EZ Lock system for safe and sure setup Super-efficient 25\" large beauty dish design Great for travel, location, and studio Soft beauty light for fashion and portrait photography\nMore dramatic contrast and tactile feel than softboxes and umbrellas All of the benefits of a metal beauty dish without the worry of damage Reversible Deflector element assures no center hot spot\nIncludes translucent diffusers for a broader light spread Eggcrate grids for extra beam control and spill kill Interchangeable speedring adapters for favorite flash reflector mounts\nThe Glow EZ Lock Beauty Dish attaches onto the favorite Bowens mount with the included speedring, but most brands of studio flash and monolights can efficiently use this beauty dish with separately purchased Glow adapters for almost any monolight or the Glow S-Type Speedlite Bracket with Bowens S-Mount for speedlights and barebulb strobes.', '', '69.0', '70.38', 'en', 1874),
(1872, 'Verbatim DVD+R 4.7GB 16x AZO Recordable Media Disc - 100 Disc Spindle', '100 high-grade non-rewritable DVD+R discs with a one hundred year archival life and OEM drive certified\nAdvanced AZO recording dye optimizes read/write performance allowing to record in approximately 5 minutes\n4.7GB is ideal for storing digital images, music , video and more. Each DVD+R allows you to store up to 1550 photos or more than 120 minutes of 720p video\nCompatible with most DVD-R and DVD+R drives including Pioneer, Apple, Sony, Dell, LG, HP, Lenovo and others\nVerbatim has been a leader in data storage technology since 1969, and guarantees this product with a limited lifetime warranty and technical support', '', '33.25', '33.91', 'en', 1875),
(1873, 'Zoom F6 Field Recorder/Mixer, Professional Field Recording, Audio for Video, 32-Bit Float Recording, 14 Channel Recorder, 6 XLR Inputs, Timecode, Ambisonics Mode, Battery Powered, iOS Wireless Control', '32-Bit float recording with dual a/D converters\n6-Channel/14-track field audio recorder/mixer\n6 discrete inputs with locking Neutrik XLR connectors\nAdvanced look-ahead hybrid Limiters for 24-bit recording\nIos wireless control with F control app', '', '649.99', '662.99', 'en', 1876);
