(1908, 'Fujifilm X-T4 Mirrorless Camera Body - Black', 'Brand Fujifilm\nModel Name Fujifilm\nCompatible Mountings Fujifilm X\nColor Black\nLens Type PrimePutting stability in your hands: A huge part of creating great photos or videos is making sure you are in the right place at the right time – and that often means making handheld images to get to the heart of the action. X-T4’s state-of-the-art, five-axis In-Body Image Stabilization (IBIS) provides up to 6.5 stops of image stabilization to make sure that, even in the midst of all the excitement, your images remain steady and sharp. Combine this with the new four-axis digital image stabilizer, and you have lots of room to maneuver.\nPerformance you can rely on: For any serious image maker, having a tool that can be relied upon to perform flawlessly whenever it is required is extremely important. For this reason, X-T4 features a newly developed mechanical shutter that is the fastest and most robust in the history of the X series. Not only can it make images at 15 frames per second, but it is also rated for 300,000 actuations 2. When you combine this with its larger capacity battery that is capable of up to 600 frames per charge 2, X-T4 has the power and the durability to give you the peace of mind that you’ll never miss the perfect opportunity.\nFind the best angle for your story: When chasing the perfect image, versatility is key, so the last thing you want is to be hampered by awkward angles. The 1.62 million pixel vari-angle touchscreen LCD featured on X-T4 can be adjusted to make it visible from a wide range of positions. This not only gives you a high-quality monitor to frame with, but also provides quick and simple controls when you need them most. On the flip side, there are times when you need to minimize the light and distractions that a screen can create. That’s why X-T4’s LCD has been designed to easily fold away so it is completely hidden from view, leaving the updated 3.69 million pixel/100fps electronic viewfinder to help you focus on the moment at hand.\nWhen your story needs movement: The modern image maker is blurring the lines between photography and videography, and X-T4 has been designed to celebrate this new generation of hybrid creativity. With the simple flick of a switch, movie mode is activated, meaning X-T4 is capable of recording both professional-level DCI 4K/60p and Full HD/240p super slow-motion video. It is also possible to record F-Log footage in 10-bit color, straight to the card. What’s more, the innovative AF-C subject tracking works in low-light conditions down to -6EV and the camera’s use of a new, high capacity battery lets you push your creative limits.\nPowerful image manipulation made easy: For over 85 years, Fujifilm has produced photographic films that have been used by some of the world’s best-known moviemakers to create some of the world’s most successful movies. This legendary reputation in color science is celebrated with their hugely popular selection of Film Simulations, which digitize some of the industry’s most iconic films and puts them right at your fingertips. X-T4 introduces Eterna Bleach Bypass, the newest addition to this much-loved collection of film simulation modes available in the X Series product line, which creates a beautiful de-saturated, high-contrast look that any image-maker will find irresistible.', 'Brand Fujifilm\nModel Name Fujifilm\nCompatible Mountings Fujifilm X\nColor Black\nLens Type Prime', '1699.95', '1733.95', 'en', 1911),
(1909, 'Brother Genuine DK-2210 Continuous Length Black on White Paper Tape for Brother QL Label Printers, 1.1\" x 100\' (29mm x 30.4M), 1 Roll per Box, DK2210', 'Color White\nMaterial Paper\nBrand BrotherCONTINUOUS LENGTH: These generous length paper labels can be cut to a precise size and work with all Brother QL label printers.\nWHITE PAPER LABELS: These labels are easy to see and identify. Just print these white paper labels and stick for the superior adhesive and durability you know and trust from Brother.\nCUSTOM CUT: Depending on the type of Brother QL label printer you own, you can custom cut these continuous feed labels to the size you need.\n100 FEET: With a generous 100 feet (30.4m), you\'ll have plenty of label tape to create and print a variety of labels for shipping, identification, archiving, storage and more.\nCOMPATIBLE WITH BROTHER LABEL PRINTERS: QL500, QL550, QL570, QL570VM, QL580N, QL650TD, QL700, QL710W, QL720NW, QL800, QL810W, QL820NWB, QL1050, QL1050N, QL1060N, QL1100 and QL1110NWB', 'Color White\nMaterial Paper\nBrand Brother', '11.95', '12.19', 'en', 1912),
