(2013, 'B + W 43mm UV Protection Filter (010) for Camera Lens – Standard Mount (F-PRO), MRC, 16 Layers Multi-Resistant Coating, Photography Filter, 43 mm, Clear Protector', 'Brand B + W\nMaterial Glass\nPhoto Filter Thread Size 43 Millimeters\nPhoto Filter Effect Type UltravioletPROTECT YOUR EXPENSIVE CAMERA LENSES - The B + W43 mm UV haze clear camera filter is here to add 16 multi-resistant layers of protection against accidental drops, dust, flying, fingerprints, dirt, scratches sand or seawater spray. Enjoy outdoor photography without worrying about your precious lenses anymore.\nTAKE BLUE CAST OUT OF THE PICTURE - Literally. Whether you are a professional photographer or a beginner, the invisible Ultra-Violet component of light from the sky is a common issue. Our UV-blocking haze protector filter for 77mm lenses will eliminate blue cast and help you snap clearer images.\nF-PRO MOUNT - Thanks to precise precision manufacturing, B+W sockets fit absolutely accurately and are easy to install. The robust F-PRO filter with 43mm ensures easy handling, is suitable for wide-angle applications, and has a large selection of diameters as well as filter types. The internal thread means that a conventional lens hood can also be fitted.\nCHOOSE YOUR SIZE – To select the appropriate filter size, check your lens. On all lenses from Canon, Nikon, Olympus, Samsung, Fuji and other manufacturers there is a printed diameter symbol that determines the filter size.\nMADE IN GERMANY - Schneider Kreuznach (B + W) – We are proudly your precision mechanics specialists for filters, photography, optics and precision, with more than 100 years of German experience. Schneider products have already been used in NASA\'s Apollo missions. Thanks to our multi-resistant nano coating lens filter, we are helping photographers everywhere take clearer, crisper images.', 'Brand B + W\nMaterial Glass\nPhoto Filter Thread Size 43 Millimeters\nPhoto Filter Effect Type Ultraviolet', '21.95', '22.39', 'en', 2016);
