(2031, 'ASUS ROG Strix Scar 17 Gaming Laptop, 17.3” 300Hz FHD IPS Type, Intel Core i7-10875H, 16GB DDR4, 1TB PCIe SSD, Per-Key RGB Keyboard', '<p>Brand ASUS Operating System Windows 10 Home CPU Manufacturer Intel Standing screen display size 17.3 Inches RAM 16 GBNVIDIA GeForce RTX 2070 SUPER 8GB GDDR6 with ROG Boost (Base: 1140MHz, Boost: 1380MHz, TDP: 115W) Latest 10th Gen Intel Core i7-10875H Processor 300Hz 3ms 17.3” Full HD 1920x1080 IPS-Type Display 16GB DDR4 3200MHz RAM | 1TB PCIe SSD | Windows 10 Home ROG Intelligent Cooling thermal system with Thermal Grizzly Liquid Metal Thermal Compound ROG Aura Sync System with RGB Keyboard, Logo, and Light Bar Gig+ Wi-Fi 6 with RangeBoost &amp; Bluetooth 5.0 | ROG Keystone II | ROG Easy Upgrade Design Bundle: Get 30 days of Xbox Game Pass for PC with purchase › See more product details</p>\r\n', '<p>Brand ASUS Operating System Windows 10 Home CPU Manufacturer Intel Standing screen display size 17.3 Inches RAM 16 GB</p>\r\n', '1999.99', '2039.99', 'en', 2034),
(2032, 'Magewell USB Capture HDMI Plus', 'Loop-through HDMI signal\nAudio input via 3 5mm mic jack\nExtract HDMI embedded audio output via 3 5 mm headphones jack', '', '359.0', '366.18', 'en', 2035),
(2033, 'Glow EZ Lock Collapsible White Beauty Dish (34\")', '34\" Glow EZ Lock White Beauty Dish, 34\" External Diffuser, Internal Diffuser, 34\" Eggcrate Grid, Bowens Speedring Adapter (Insert Size 150mm), Reversible Deflection Disk, Storage Bag, 2-Year Glow USA Warranty\nQuick and easy EZ Lock system for safe and sure setup Super-efficient 34\" large beauty dish design Great for travel, location, and studio Soft beauty light for fashion and portrait photography\nMore dramatic contrast and tactile feel than softboxes and umbrellas All of the benefits of a metal beauty dish without the worry of damage Reversible Deflector element assures no center hot spot\nIncludes translucent diffusers for a broader light spread Eggcrate grids for extra beam control and spill kill Interchangeable speedring adapters for favorite flash reflector mounts\nThe Glow EZ Lock Beauty Dish attaches onto the favorite Bowens mount with the included speedring, but most brands of studio flash and monolights can efficiently use this beauty dish with separately purchased Glow adapters for almost any monolight or the Glow S-Type Speedlite Bracket with Bowens S-Mount for speedlights and barebulb strobes.', '', '79.0', '80.58', 'en', 2036),
(2034, 'Panasonic DMW-BLC12 Lithium-Ion Battery for Panasonic Lumix®', 'Brand Panasonic\nVoltage 7.2 Volts\nBattery Weight 1 Pounds\nCompatible Devices Camera\nItem Dimensions LxWxH 0.37 x 0.26 x 0.16 inches7.2V, 1200mAh battery\nWorks With: DMC-GH2HK', 'Brand Panasonic\nVoltage 7.2 Volts\nBattery Weight 1 Pounds\nCompatible Devices Camera\nItem Dimensions LxWxH 0.37 x 0.26 x 0.16 inches', '48.95', '49.93', 'en', 2037),
(2035, 'Olympus PT-059 Underwater Housing for The TG-6', 'Can withstand pressure to a water depth of 147 feet (45 meters)\nAll Camera controls can be easily accessed\nCompatible with step up Ring psur 03 (260606), underwater macro conversion lens ptmc 01 (200975) and underwater wide conversion lens ptwc 01 (200973) sold separately\nCan accommodate two external flash units\nShips with o ring pol 058, optical cable adapter pfca 03, body cap prlc 14, LCD hood pfud 08, anti reflective ring posr 053, manual, , strap, silicone grease and O ring Remover, maintenance set pms 02, silicone gel, strap', '', '299.0', '304.98', 'en', 2038),
(2036, 'StarTech.com USB 3.0 to DisplayPort Adapter 4K Ultra HD, DisplayLink Certified, Video Converter w/ External Graphics Card - Mac & Windows (USB32DP4K),Black', 'connector-type USB Type A\nBrand StarTech\nWarranty Type Lifetime\nInput Voltage 5 VoltsTHE STARTECH.COM ADVANTAGE: StarTech.com offers a 3-year warranty and free lifetime technical support on this USB adapter and has been the choice of IT professionals and businesses for over 30 years.\nCREATE A DUAL MONITOR WORKSTATION: Use this USB 3.0 to DisplayPort converter to connect your Windows or Mac laptop / desktop to a secondary monitor, TV or projector using an available USB 3.0 port.\nPLUG & DISPLAY: This DisplayLink certified dongle, provides automatic driver installation updates to your Windows (7 / 8 / 10) enabled computers. It’s also USB-powered, requiring no external power.\n4K RESOLUTIONS: With support for resolutions up to 4K 30Hz and widescreen capabilities this USB 3.0 external video & graphics card delivers a full UHD experience, ensuring astonishing picture quality.\nMULTI USE FUNCTIONALITY: Use this IT-grade USB 3.0 display adapter (backward compatible with USB 2.0) to either extend or mirror your main laptop or desktop display.\nConnect an additional DisplayPort monitor to your PC with USB 3.0 technology capable of playback at 4K\nCompatible with USB 3.0-enabled computer systems and 4K DisplayPort monitors', 'connector-type USB Type A\nBrand StarTech\nWarranty Type Lifetime\nInput Voltage 5 Volts', '66.5', '67.83', 'en', 2039),
(2037, 'Bose Frames Lens Collection, Blue Gradient Alto Style, interchangeable replacement lenses', 'Customize your Bose Frames with interchangeable replacement lenses from the Bose Frames Lens Collection.\nIntuitive design lets you switch lenses easily.\nBlocks up to 99% of UVA/UVB rays.\nShatter and scratch resistant.\nNon-polarized lenses.', '', '19.0', '19.38', 'en', 2040),
(2038, 'Crown XLS1002 Two-channel, 350-Watt at 4Ω Power Amplifier', 'Class D amp with Crown ultra-efficient drive Core technology weighs less than 11 lb. (5 kg)\nHigher DSP capabilities: more control; has band pass filter per channel\nIncreased lighting functionality; turn off all LED indicators except clip and thermal to reduce distraction in dark venues\nSelectable input sensitivity; 1.4VRMS and .775VRMS options so that amp can be driven At full power\nSet sleep mode after specified time without having to press a button\nInput: balanced XLR (x2), ¼” TRS (x2), RCA jacks (x1 pair); output: ¼” speaker (x2)\nPower: 550W at 2ω, 350W at 4Ω, 215W at 8Ω\nAc input voltage: 100 – 240VAC (10%), 50/60Hz', '', '335.99', '342.71', 'en', 2041),
(2039, 'AVerMedia ExtremeCap, HDMI to USB 3.0 Capture Card, Record, Stream and Convert Uncompressed Full HD Video at 1080p60. Record via DSLR, Camcorder, perfect for Live Streaming, Mobile Streaming (BU110)', 'Stream and capture HDMI sources in 1080p60\nPlug and play No driver needed\nEasy connect your DSLR camcorder to your PC or Mac\nLive mobile streaming\nCompatible with mainstream 3rd party software\nUp/down scaling color space conversion\nSupports Mac/Windows/Linux', '', '127.49', '130.04', 'en', 2042),
(2040, 'StarTech.com 8 Port USB to Serial RS232 Adapter - Wall Mount - Din Rail - COM Port Retention - FTDI USB to DB9 RS232 Hub (ICUSB2328I), Black', 'INDUSTRIAL STRENGTH: Built to withstand harsh environments, this 8 port USB to serial RS232 adapter has a rugged all-metal enclosure for added durability in industrial settings\nCOM RETENTION CAPABILITIES: For added convenience, this FTDI USB to DB9 RS232 hub features COM retention so COM port assignments are maintained during reboots\nPLUG AND PLAY INSTALLATION: This DB9 serial converter is powered by an available USB port / cable so no external power adapter is required\nINSTALLATION OPTIONS: This USB serial adapter has integrated wall mount brackets and included DIN Rail clips for versatile mounting options\nRELIABLE SUPPORT: Backed by a StarTech.com 2-year warranty, this 8 port FTDI USB to serial DB9 RS232 adapter has free lifetime technical support', '', '137.92', '140.68', 'en', 2043),
(2041, 'Microsoft Sculpt Mobile Mouse - Wool Blue (43U-00011)', 'Connections Wireless, USB\nColor Wool Blue\nBrand Microsoft\nHand Orientation Ambidextrous\nOperating System Windows 8Windows button for easy access to the Start screen\nCompact design for ultimate portability\n4-way scroll wheel for navigating up, down, left and right\nWorks on virtually any surface with Blue Track Technology\nDesign is suitable for use with either hand\nMini-transceiver (USB)', 'Connections Wireless, USB\nColor Wool Blue\nBrand Microsoft\nHand Orientation Ambidextrous\nOperating System Windows 8', '12.99', '13.25', 'en', 2044),
(2042, 'SkyWatcher S20530 Star Adventurer Latitude (EQ) Base, Telescope Accessory, Black', 'Brand Sky Watcher\nModel Name Sky-Watcher\nTelescope Mount Description Equatorial Mount\nItem Weight 1.7 PoundsStar Adventurer accessory\nV-style dovetail plate\nMicro-adjustment knobs\nLatitude adjustment lock', 'Brand Sky Watcher\nModel Name Sky-Watcher\nTelescope Mount Description Equatorial Mount\nItem Weight 1.7 Pounds', '65.0', '66.3', 'en', 2045),
(2043, 'Shure SM-57 Cardioid Dynamic Instrument Microphone', 'Brand Shure\nPolar Pattern Unidirectional\nColor 1 Pack\nItem Weight 0.43 KilogramsConsumer Alert: Most users do not need a license to operate this wireless microphone system. Nevertheless, operating this microphone system without a license is subject to certain restrictions: the system may not cause harmful interference; it must operate at a low power level (not in excess of 50 milliwatts); and it has no protection from interference received from any other device.', 'Brand Shure\nPolar Pattern Unidirectional\nColor 1 Pack\nItem Weight 0.43 Kilograms', '99.0', '100.98', 'en', 2046),
(2044, 'Duracell - CRV3 High Power Lithium Batteries - 1 count', 'Brand Duracell\nVoltage 3 Volts\nBattery Weight 39 Grams\nCompatible Devices Camera\nItem Dimensions LxWxH 2.04 x 0.55 x 1.1 inchesDuracell CRV3 Batteries: This Duracell CRV3 3.0 Volts high power lithium battery is designed for use in household items like cameras, electronics, and more.\nLong Lasting Power: Duracell high power lithium batteries are designed and developed for long lasting performance.\nGuaranteed for 10 years in Storage: Duracell CRV3 high power lithium batteries are guaranteed for 10 years in storage.\nDuracell high power lithium batteries are designed to provide long lasting, reliable power to your specialty devices.\n#1 Trusted Battery Brand: This Duracell CRV3 High Power Lithium battery is equivalent to 3V CRV3, DLCCRV3, ELCRV3.\nWide operating temperature range\nDoes not require recharging\nUp to a 10 year shelf life', 'Brand Duracell\nVoltage 3 Volts\nBattery Weight 39 Grams\nCompatible Devices Camera\nItem Dimensions LxWxH 2.04 x 0.55 x 1.1 inches', '9.83', '10.03', 'en', 2047),
(2045, 'Sony HX400V Compact Digital Camera with 50x Optical Zoom, Black', 'Brand Sony\nModel Name Sony DSCHX400V\nShooting Modes\nProgram Auto, Aperture Priority, Shutter Speed Priority, Manual Exposure, MR (Memory Recall) 1,2, Movie Mode (Pro… See more\nOptical Sensor Size 1/2.3_inches\nCompatible Mountings Sony AlphaClear Image Zoom ZEISS Lens. Panorama (Recording): Intelligent Sweep Panorama (supports 360 format)\n20.4MP Exmor R CMOS Sensor for superb low  light images\nKeep your subject in focus with Lock-On AF. Screen type: 7.5cm (3.0 type)(4:3) / 921,600 dots / Xtra Fine / TFT LCD\nSimple connectivity to smartphones via Wi-Fi w/NFC3\nMap your images with GPS tagged photos.Focus Range (From the Front of the Lens):0.39 in - Infinity (W), 7.87 ft - Infinity (T)\nEnhance features w/ downloadable camera apps\n4K quality still image output via HDMI2\nMotion Shot Video traces subject movement', 'Brand Sony\nModel Name Sony DSCHX400V\nShooting Modes\nProgram Auto, Aperture Priority, Shutter Speed Priority, Manual Exposure, MR (Memory Recall) 1,2, Movie Mode (Pro… See more\nOptical Sensor Size 1/2.3_inches\nCompatible Mountings Sony Alpha', '448.0', '456.96', 'en', 2048),
(2046, 'On-Stage KSP100 Universal Sustain Keyboard Pedal', 'Full size piano-style pedal\nPolarity switch for universal compatibility\nChrome foot pedal comes with a removable scratch resistant cover, which doubles as a non-slip foot grip\nBuilt-in 6\' cord with 1/4\" input jack', '', '26.95', '27.49', 'en', 2049),
(2047, 'Panasonic SoundSlayer Gaming Speakers for PC | Dolby Atmos Soundbar with Built-in Subwoofer | Bluetooth Gaming Computer Speaker with Hi-Res Sound + 4K HDR Passthrough (SC-HTB01)', 'Brand Panasonic\nColor Black\nConnections Bluetooth\nSeries SC-HTB01 SoundSlayer\nItem Weight 5.6 PoundsDOLBY ATMOS-POWERED IMMERSIVE SOUND: Powerful & realistic 3D sound experience features revolutionary Dolby Atmos technology and DTX; individual sounds move all around you, delivering astonishingly realistic detail and depth.\nDESIGNED FOR GAMERS, BY GAMERS: Panasonic partnered with the Final Fantasy XIV Online sound team to design a breakthrough three-dimensional audio experience that fills your environment, with sounds heard even overhead and behind you.\nDEDICATED MODES FOR THE GAMES YOU PLAY: Three modes—RPG (Role-Playing Gamer), FPS (First Person Shooter) or Voice Mode (adventure games with a lot of dialogue) —optimize the sound for intensity and realism across every gaming genre.\nIMMERSIVE MUSIC AND MOVIES: Dolby Atmos is reinventing the way all sound is experienced; giving you a whole-body connection to music, movies and games, with dimensional dialogue, ambient music and environmental sound.\nINDUSTRY-LEADING TECHNOLOGY: 2.1 channel 3-way speaker system with 4K HDR passthrough for zero loss in image quality. Supports DTSX/DTSX virtual, adding spatial and temporal metadata to position audio objects in space and move them around freely.', 'Brand Panasonic\nColor Black\nConnections Bluetooth\nSeries SC-HTB01 SoundSlayer\nItem Weight 5.6 Pounds', '293.91', '299.79', 'en', 2050),
(2048, 'Brother Genuine DK-2243 Continuous Length Black on White Paper Tape for Brother QL Label Printers, 4\" x 100\' (101mm x 30.4M), 1 Roll per Box, DK2243', 'Color White\nMaterial Paper\nBrand Brother100 FEET: Enjoy a generous amount of paper label tape. You\'ll get 100 feet (30.4m) of premium-grade Brother Genuine tape per roll. That\'s both economical and affordable.\nHIGH-QUALITY BLACK ON WHITE LABELS: Crisp black text on a white label is easily readable, even from a distance, making sure your labels are noticed right away.\nCUT TO SIZE: Depending on your Brother QL label printer, you can custom cut these labels to a variety of sizes, making them perfect for all your labeling needs.\nSTUNNING RESULTS: Use these adhesive labels on boxes, folders, files, reports and much more with clear and flawless results that are sure to make an impression. Great for organization and storage.\nCOMPATIBLE WITH BROTHER LABEL PRINTERS: QL1050, QL1050N, QL1060N, QL1100 and QL1110NWB', 'Color White\nMaterial Paper\nBrand Brother', '32.99', '33.65', 'en', 2051),
(2049, 'Sony MRWG2 CFexpress Card Reader', 'Compatible with CFexpress Type A and SDXC/SDHC (UHS-I and UHS-II) memory cards\nSuperSpeed USB 10Gbps (USB 3.2 Gen 2) transfer speed via USB Type-C connector\nEstablish an efficient workflow when dealing with high-resolution images files, 4K video and other types of high-volume data\nThe MRW-G2 card reader can be used with CFexpress Type A and SDXC/SDHC (UHS-I and UHS-II) memory cards.', '', '118.0', '120.36', 'en', 2052),
(2050, 'Glow EZ Lock Deep Parabolic Quick Softbox (38\")', 'Glow EZ Lock 38\" Deep Parabolic Soft box, External Diffuser, Internal Diffuser, Eggcrate Grid, Bowens Mount Speedring Adapter (Insert Size 150mm), Reversible Deflection Cap Disk, Storage Bag, Glow 1 Year USA Warranty\nDeep Parabolic softbox, Quick and easy EZ Lock system for safe and sure setup, Quick to Assemble, Opens Like Umbrella, Easy. No hassles in opening and closing. Locks. EZ Lock is a breeze to use and unlocks without a struggle. Fast. Slick mechanism glides smoothly along the shaft.\nFast. Slick mechanism glides smoothly along the shaft.\nHeat-Resistant Material, Removable Inner Baffle & Front Diffuser, Grid and Carrying Case Included, Reflective Silver Interior\nCarrying bag provided for easy transport, Standard Bowens mount speed ring included, can be swapped out with optional Elinchrom or Profoto models, Fabric grid included to tighten beam angle and help control unwanted light.', '', '84.0', '85.68', 'en', 2053),
(2051, 'Minelab English Language Screen Protector Pack for Equinox Detectors, 5 Pack', 'Low-reflection screen protector pack. Keeps the original screen free from scratches.  Includes screen cloth.  English only.', '', '19.95', '20.35', 'en', 2054),
(2052, 'Optoma GT5600 Ultra Short Throw Gaming and Movie Projector, 3600 Lumens for Ambient Lighting, Easy Setup with Auto Keystone, 100-in Image from Only a Few Inches Away', 'Model Name GT5600\nHardware Interface VGA, HDMI, 3.5mm Audio\nMounting Type Table Mount, Wall Mount\nBrand Optoma\nLuminous Flux 3600 LumenULTRA-SHORT THROW: Experience a large 100\" diagonal image projected from only inches away with an ultra-short throw lens; ultra short throw projectors allow placement close to the screen or wall providing easy cable management and an unobstructed projected image from foot traffic or objects\nINCREDIBLE PICTURE QUALITY: Enjoy bright, razor-sharp images with 3, 600 lumens, 20, 000: 1 contrast ratio, and 1080p resolution\nEASY IMAGE SET-UP: The auto keystone sensors and four-corner correction ensure a sharp, detailed image for quick, trouble-free set-up; when the projector or table is bumped, the image will refocus instantly\nLONG LAMP LIFE: Enjoy up to 15, 000 hours of lamp life enabling an average of 4 hours of viewing time every day 10+ years\nFULL 3D: The GT5600 displays true 3D content from almost any 3D source, including 3D Blu-ray Disc players, 3D broadcasting, and the latest-generation game consoles. Support for 144Hz rapid-refresh rate provides ultra-smooth flicker-free images; 3D glasses required\nSCREEN MIRRORING: Enjoy content from iOS or Android mobile devices on the big screen with USB display connectivity\nGO WIRELESS: Share wireless presentations and images with Optoma HDCast Pro 1080p HDMI MHL Multimedia Stick, sold separately; WUSB adapter required, sold separately\n› See more product details', 'Model Name GT5600\nHardware Interface VGA, HDMI, 3.5mm Audio\nMounting Type Table Mount, Wall Mount\nBrand Optoma\nLuminous Flux 3600 Lumen', '1249.0', '1273.98', 'en', 2055),
(2053, 'JBL Professional CSS8018 Commercial Series 20-Watt Ceiling Speaker, 8-Inch, White', 'Brand JBL Professional\nColor White\nSpeaker Type In-Ceiling\nModel Name CSS8018\nSpeaker Size 8 InchesVery high 97 dB sensitivity\n10 Watt multi-tap transformer for 100V, 70V and 25V distributed lines\nFits JBL Professional CSS-BB8 back can and CSS-TR4/8x12 tile rail\nCoverage Angle 110° conical', 'Brand JBL Professional\nColor White\nSpeaker Type In-Ceiling\nModel Name CSS8018\nSpeaker Size 8 Inches', '34.0', '34.68', 'en', 2056);
