(35, 'newStyle', '.gradient-color {\r\n    background-color: #b9012a;\r\n    /* IE9, iOS 3.2+ */\r\n    background-image: url(data:image/svg+xml;base64,);\r\n    background-image: -webkit-gradient(linear, 0% 0%, 100% 100%,color-stop(0, rgb(250, 2, 29)),color-stop(1, rgb(119, 0, 54)));\r\n    /* Android 2.3 */\r\n    background-image: -webkit-repeating-linear-gradient(top left,rgb(250, 2, 29) 0%,rgb(119, 0, 54) 100%);\r\n    /* IE10+ */\r\n    background-image: repeating-linear-gradient(to bottom right,rgb(250, 2, 29) 0%,rgb(119, 0, 54) 100%);\r\n    background-image: -ms-repeating-linear-gradient(top left,rgb(250, 2, 29) 0%,rgb(119, 0, 54) 100%);\r\nborder : solid 1px #b9012a;box-shadow : 2px 2px 3px #b9012a; }\r\n.mine-color, .btn-inner-search { background-color:#b9012a; }\r\n.button-more::before { border-color: transparent #b9012a; }\r\n.btn-go-search:active,.btn-go-search:focus, .btn-go-search:hover, .button-more:hover, .button-more:focus, .button-more:hover { background-color: #c73454; }\r\ndiv.filter-sidebar .title, .title.alone {border-bottom: 3px solid #dc8095; }\r\ndiv.filter-sidebar .title span, .title.alone span {border-bottom : 3px solid #b9012a; }\r\n.cloth-bg-color {background-color:#b9012a;}\r\n.cloth-color {color:#b9012a;}\r\n.cloth--border-color {border-color:#b9012a;}\r\n.cloth-border-top-color {border-top-color: #b9012a;}\r\n.navbar.cloth .navbar-nav li.active a { color:#b9012a;}\r\n.navbar.cloth .navbar-nav li a:hover, .navbar.cloth .navbar-nav li a:focus {background-color:transparent !important; color:#b9012a;}\r\n.navbar.cloth .navbar-nav li:hover, .navbar.cloth .navbar-nav li.active {border-top:3px solid; border-top-color: #b9012a;}\r\n#small_carousel .product-list div.add-to-cart, #small_carousel .product-list .info-btn {background-color: #b9012a; }\r\n.products .product-list div.add-to-cart, .products .product-list .info-btn { background-color: #b9012a;}\r\n.part-label { background-color: #b9012a;}\r\n.pagination li a { color:#b9012a;}\r\n.pagination li.active a {background-color: #b9012a; border-color:#b9012a; }\r\n.list li a {background-color:#b9012a;}\r\n#home-slider .carousel-indicators .active, #small_carousel .carousel-indicators .active {background-color: #b9012a;}\r\n.btn-blue-round {    background-color: #b9012a;\r\n    /* IE9, iOS 3.2+ */\r\n    background-image: url(data:image/svg+xml;base64,);\r\n    background-image: -webkit-gradient(linear, 0% 0%, 100% 100%,color-stop(0, rgb(250, 2, 29)),color-stop(1, rgb(119, 0, 54)));\r\n    /* Android 2.3 */\r\n    background-image: -webkit-repeating-linear-gradient(top left,rgb(250, 2, 29) 0%,rgb(119, 0, 54) 100%);\r\n    /* IE10+ */\r\n    background-image: repeating-linear-gradient(to bottom right,rgb(250, 2, 29) 0%,rgb(119, 0, 54) 100%);\r\n    background-image: -ms-repeating-linear-gradient(top left,rgb(250, 2, 29) 0%,rgb(119, 0, 54) 100%);\r\n}\r\n.my-basket span.sum-scope {color:#b9012a;}\r\n.search .btn-red { border-bottom: 1px solid #dc8095; border-right: 1px solid #dc8095 ; border-left: 1px solid #dc8095 ;}\r\n#small_carousel .product-list h2 a {color:#b9012a;}\r\n#home-slider .item h1 a {color:#b9012a;}\r\n\r\n/* IE8- CSS hack */\r\n@media \\0screen\\,screen\\9 {\r\n    .gradient-color {\r\n        filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=\"#fffa021d\",endColorstr=\"#ff770036\",GradientType=0);\r\n    }\r\n}');
